INSERT INTO `oc_category_description` (`category_id`, `language_id`, `name`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(59, 2, 'Blue line', '&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;span style=&quot;color: rgb(27, 27, 27);&quot;&gt;Bycool &lt;/span&gt;&lt;span style=&quot;font-weight: bold; color: rgb(14, 65, 122);&quot;&gt;BLUE LINE&lt;/span&gt;&lt;span style=&quot;color: rgb(27, 27, 27);&quot;&gt; je výparníkový systém s&amp;nbsp;vysokým výkonom. Opiera sa o základný princíp prirodzeného ochladzovania vzduchu. &lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;span style=&quot;color: rgb(27, 27, 27);&quot;&gt;Horúci vzduch zvonku prúdi cez vlhký filter, kde sa voda odparuje, absorbuje horúčavu čím zase dochádza k ochladzovaniu vzduchu.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;', 'Blue line', '', ''),
(60, 1, 'Green line', '&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;span style=&quot;color: rgb(27, 27, 27);&quot;&gt;Our &lt;/span&gt;&lt;span style=&quot;font-weight: bold; color: rgb(53, 123, 43);&quot;&gt;GREEN LINE&lt;/span&gt;&lt;span style=&quot;color: rgb(27, 27, 27);&quot;&gt; consists of compressor based systems. They function even with an engine turned off, have low power consumption and are easy to maintain.&amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span style=&quot;color: rgb(27, 27, 27); font-size: 14px;&quot;&gt;They allow the driver to regulate temperature inside cab during the night, allowing him to rest comfortably.&lt;/span&gt;&lt;/p&gt;', 'Green line', 'Samostatné kompresorové jednotky', ''),
(60, 3, 'Green line', '&lt;p&gt;&lt;span style=&quot;font-size: 14px; color: rgb(27, 27, 27);&quot;&gt;Kompressor Systeme bieten wir unter der Bezeichnung Minicool &lt;/span&gt;&lt;span style=&quot;font-size: 14px; font-weight: bold; color: rgb(53, 123, 43);&quot;&gt;GREEN LINE&lt;/span&gt;&lt;span style=&quot;color: rgb(27, 27, 27); font-size: 14px;&quot;&gt; an. Diese Anlagen arbeiten bei abgeschaltetem Fahrzeugmotor, haben geringen Stromverbrauch und sind Wartungsfreundlich. &lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span style=&quot;color: rgb(27, 27, 27); font-size: 14px;&quot;&gt;Dieses System ermöglicht die Nachttemperaturen ohne Motorlauf zu regulieren und sorgt für angenehme Erholung des Fahrers.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'Green line', 'Samostatné kompresorové jednotky', ''),
(67, 1, 'Spare parts', '', 'Spare parts', '', ''),
(67, 2, 'Náhradné diely', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', 'Náhradné diely', '', ''),
