(74, 2, 'Dinamic', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', 'Dinamic', '', ''),
(74, 3, 'Dinamic', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', 'Dinamic', '', ''),
(60, 4, 'Green line', '&lt;p&gt;&lt;span style=&quot;color: rgb(27, 27, 27); font-size: 14px;&quot;&gt;Kompresszorrendszereinket Minicool &lt;/span&gt;&lt;span style=&quot;font-size: 14px; color: rgb(53, 123, 43); font-weight: bold;&quot;&gt;GREEN LINE&lt;/span&gt;&lt;span style=&quot;color: rgb(27, 27, 27); font-size: 14px;&quot;&gt; márkanéven kínáljuk. Leállított motor mellett is működnek, energiafogyasztásuk alacsony és karbantartásuk sem igényes. &lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(27, 27, 27); font-size: 14px;&quot;&gt;Ez a rendszer lehetővé teszi a hőmérséklet szabályozását a fülkében, éjjel is, leállított motor mellett, közben pedig a sofőr kellemesen kipiheni magát.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'Green line', 'Samostatné kompresorové jednotky', ''),
(67, 3, 'Ersatzteile', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', 'Ersatzteile', '', ''),
(90, 2, 'Milenium', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', 'Milenium', '', ''),
(59, 3, 'Blue line', '&lt;p&gt;&lt;span style=&quot;color: rgb(27, 27, 27); font-size: 14px;&quot;&gt;Bycool &lt;/span&gt;&lt;span style=&quot;font-size: 14px; color: rgb(14, 65, 122); font-weight: bold;&quot;&gt;BLUE LINE&lt;/span&gt;&lt;span style=&quot;color: rgb(27, 27, 27); font-size: 14px;&quot;&gt; ist ein Verdampfungssystem mit hoher Leistung. Bycool stützt sich aufs natürliche Grundprinzip von Luftabkühlung. &lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(27, 27, 27); font-size: 14px;&quot;&gt;Heisse Luft von aussen fliesst durch einen feuchten Filter hinein, hier verdampft das Wasser, absorbiert die Hitze, wodurch es zu der Luftabkühlung kommt.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'Blue line', '', ''),
(59, 1, 'Blue line', '&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;span style=&quot;color: rgb(27, 27, 27);&quot;&gt;Bycool &lt;/span&gt;&lt;span style=&quot;font-weight: bold; color: rgb(14, 65, 122);&quot;&gt;BLUE LINE&lt;/span&gt;&lt;span style=&quot;color: rgb(27, 27, 27);&quot;&gt; is a high performance evaporative cooling system based on the natural air cooling principle. &lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;br&gt;\r\n&lt;p&gt;&lt;span style=&quot;color: rgb(27, 27, 27); font-size: 14px;&quot;&gt;Hot air passes through a wet filter where water evaporates and heat gets absorbed, therefore producing cool air.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'Blue line', '', ''),
