(59, 4, 'Blue line', '&lt;p&gt;&lt;span style=&quot;color: rgb(27, 27, 27); font-size: 14px;&quot;&gt;A Bycool&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: rgb(14, 65, 122); font-size: 14px; font-weight: bold;&quot;&gt;BLUE LINE&lt;/span&gt;&lt;span style=&quot;color: rgb(27, 27, 27); font-size: 14px;&quot;&gt;&amp;nbsp;nagy teljesítményű párologtató rendszer. A levegő természetes lehűlési elvén alapul.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span style=&quot;color: rgb(27, 27, 27); font-size: 14px;&quot;&gt;A forró levegő kintről átáramlik egy nedves szűrőn, ahol a víz elpárolog, elnyeli a forróságot, miáltal újra a levegő lehűlésére kerül sor.&lt;/span&gt;&lt;/p&gt;', 'Blue line', '', ''),
(60, 2, 'Green line', '&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;span style=&quot;color: rgb(27, 27, 27);&quot;&gt;Kompresorové systémy ponúkame pod označením &lt;/span&gt;&lt;span style=&quot;font-weight: bold; color: rgb(53, 123, 43);&quot;&gt;GREEN LINE&lt;/span&gt;&lt;span style=&quot;color: rgb(27, 27, 27);&quot;&gt;. Pracujú aj pri vypnutom motore, majú nízku spotrebu energie a sú nenáročné na údržbu. &lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;span style=&quot;color: rgb(27, 27, 27);&quot;&gt;Tento systém umožňuje regulovať teplotu vo vozidle počas noci, pri vypnutom motore, čím si vodič príjemne oddýchne.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;', 'Green line', 'Samostatné kompresorové jednotky', ''),
