gt;&lt;li&gt;jednotka je predplnená chladiacim médiom&lt;/li&gt;\r\n	&lt;li&gt;upevnenie na strešné okno bez akýchkoľvek zmien v konštrukcii kabíny&lt;/li&gt;\r\n	&lt;li&gt;aerodynamický dizajn&lt;/li&gt;\r\n	&lt;li&gt;UV ochranný kryt&lt;/li&gt;\r\n	&lt;li&gt;jednoduchá výmena náhradných dielov&lt;/li&gt;\r\n	&lt;li&gt;rýchla montáž&lt;/li&gt;\r\n&lt;/ul&gt;', '                                                                                                                                                                                                &lt;ul&gt;\r\n\r\n\r\n&lt;li&gt;Plne elektrická jednotka&lt;/li&gt;\r\n\r\n\r\n&lt;li&gt;Znižuje náklady na pohonné hmoty&lt;/li&gt;\r\n\r\n\r\n&lt;li&gt;Šetrná ku prostrediu&lt;/li&gt;\r\n\r\n\r\n&lt;li&gt;Pohodlný oddych v kabíne znižuje riziko nehody&lt;/li&gt;\r\n\r\n\r\n&lt;li&gt;Inštálacia bez zásahu do motoru a konštrukcie vozidla&lt;/li&gt;\r\n\r\n\r\n&lt;li&gt;Operuje nezávisle od chodu motora&lt;/li&gt;\r\n\r\n\r\n&lt;/ul&gt;\r\n\r\n\r\n&lt;p&gt;&lt;br&gt;\r\nToto zariadenie je navrhnuté pre montáž na strechu kabíny nákladného vozidla. Jeho montáž je jednoduchá a rýchla, nevyžaduje žiadny zásah do kabíny vozidla. Pracuje v manuálnom alebo automatickom režime. Výhodou automatického režimu je, že sa vodič nemusí starať o reguláciu teploty, klimatizácia si toto reguluje automaticky.\r\n&lt;/p&gt;\r\n\r\n\r\n&lt;p&gt;\r\nZáruka 2 roky na všetky diely.\r\n&lt;/p&gt;                                                                                                                                                                                                ', '', 'Compact 3.0kW 24V Night &amp; Day', '', '', '', '', '', '', '', ''),
