li&gt;Znižuje náklady na pohonné hmoty&lt;/li&gt;&lt;li&gt;Šetrná ku prostrediu&lt;/li&gt;&lt;li&gt;Pohodlný oddych v kabíne znižuje riziko nehody&lt;/li&gt;&lt;li&gt;Inštálacia bez zásahu do motoru a konštrukcie vozidla&lt;/li&gt;&lt;li&gt;Operuje nezávisle od chodu motora&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;br&gt;Toto zariadenie je navrhnuté pre montáž na strechu kabíny nákladného vozidla. Jeho montáž je jednoduchá a rýchla, nevyžaduje žiadny zásah do kabíny vozidla. Pracuje v manuálnom alebo automatickom režime. Výhodou automatického režimu je, že sa vodič nemusí starať o reguláciu teploty, klimatizácia si toto reguluje automaticky.&lt;/p&gt;&lt;p&gt;Záruka 2 roky na všetky diely.&lt;/p&gt;                                                                                                                                                                                                                                                                                                                        ', '', 'Compact 1.6kW 24V MAN', '', '', '', '', '', '', '', ''),
