                                               &lt;ul&gt;\r\n\r\n\r\n\r\n&lt;li&gt;Plne elektrická jednotka&lt;/li&gt;\r\n\r\n\r\n\r\n&lt;li&gt;Znižuje náklady na pohonné hmoty&lt;/li&gt;\r\n\r\n\r\n\r\n&lt;li&gt;Šetrná ku prostrediu&lt;/li&gt;\r\n\r\n\r\n\r\n&lt;li&gt;Pohodlný oddych v kabíne znižuje riziko nehody&lt;/li&gt;\r\n\r\n\r\n\r\n&lt;li&gt;Inštálacia bez zásahu do motoru a konštrukcie vozidla&lt;/li&gt;\r\n\r\n\r\n\r\n&lt;li&gt;Operuje nezávisle od chodu motora&lt;/li&gt;\r\n\r\n\r\n\r\n&lt;/ul&gt;\r\n\r\n\r\n\r\n&lt;p&gt;&lt;br&gt;\r\nToto zariadenie je navrhnuté pre montáž na strechu kabíny nákladného vozidla. Jeho montáž je jednoduchá a rýchla, nevyžaduje žiadny zásah do kabíny vozidla. Pracuje v manuálnom alebo automatickom režime. Výhodou automatického režimu je, že sa vodič nemusí starať o reguláciu teploty, klimatizácia si toto reguluje automaticky.\r\n&lt;/p&gt;\r\n\r\n\r\n\r\n&lt;p&gt;\r\nZáruka 2 roky na všetky diely.\r\n&lt;/p&gt;                                                ', '', 'Compact 1.4', '', '', '', '', '', '', '', ''),
(60, 3, 'Integral power', '&lt;p&gt;Model green line &lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;INTEGRAL POWER&lt;/span&gt; je strešná klimatizačná jednotka určená pre použitie pri vypnutom motore ako pri nakladaní, vykladaní, odpočinku a spánku posádky vozidla a pod. Určená je pre nákladné automobily, terénne automobily, žeriavy, stavebné a pracovné stroje špeciálne vozidlá a pod. &lt;/p&gt;', '&lt;ul&gt;\r\n	&lt;li&gt;3,2kW&lt;/li&gt;\r\n	&lt;li&gt;napätie 24V DC&lt;/li&gt;\r\n	&lt;li&gt;výkon 10921 BTU&lt;/li&gt;\r\n	&lt;li&gt;výkon 2752 kcal/h&lt;/li&gt;\r\n	&lt;li&gt;spotreba el.energie 30A/h ~ 45A/h&lt;/li&gt;\r\n	&lt;li&gt;maximálny prietok vzduchu: 700m3/h&lt;/li&gt;\r\n	&lt;li&gt;5 rýchlostí ventilátora&lt;/li&gt;\r\n	&lt;li&gt;diaľkové ovládanie&lt;/li&gt;\r\n	&lt;li&gt;požadované minimum na alternátor 75A/h – 28V&lt;/li&gt;\r\n	&lt;li&gt;ľahká montáž&lt;/li&gt;\r\n	&lt;li&gt;prepínač automatický/manuálny režim&lt;/li&gt;\r\n	&lt;li&gt;digitálny teplomer v °C alebo °F&lt;/li&gt;\r\n	&lt;li&gt;diaľkové ovládanie&lt;/li&gt;\r\n	&lt;li&gt;dvojitá ochrana akumulátorov&lt;/li&gt;\r\n	&lt;li&gt;ochrana akumulátorov kompresorov&lt;/li&gt;\r\n	&lt;li&gt;elektronické ovládanie akumulátora&lt;/li&gt;\r\n	&lt;li&gt;hlavné rozmery 655 x 730 x 210mm&lt;/li&gt;\r\n	&lt;li&gt;hmotnosť 43,5kg&lt;/li&gt;\r\n&lt;/ul&gt;', '                                                                                                                                                                                                                                                                                                                                                                                                                                                ', '', 'Integral power', '', '', '', '', '', '', '', ''),
(60, 1, 'Integral power', '&lt;p&gt;Model green line &lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;INTEGRAL POWER&lt;/span&gt; je strešná klimatizačná jednotka určená pre použitie pri vypnutom motore ako pri nakladaní, vykladaní, odpočinku a spánku posádky vozidla a pod. Určená je pre nákladné automobily, terénne automobily, žeriavy, stavebné a pracovné stroje špeciálne vozidlá a pod. &lt;/p&gt;', '&lt;ul&gt;\r\n	&lt;li&gt;3,2kW&lt;/li&gt;\r\n	&lt;li&gt;napätie 24V DC&lt;/li&gt;\r\n	&lt;li&gt;výkon 10921 BTU&lt;/li&gt;\r\n	&lt;li&gt;výkon 2752 kcal/h&lt;/li&gt;\r\n	&lt;li&gt;spotreba el.energie 30A/h ~ 45A/h&lt;/li&gt;\r\n	&lt;li&gt;maximálny prietok vzduchu: 700m3/h&lt;/li&gt;\r\n	&lt;li&gt;5 rýchlostí ventilátora&lt;/li&gt;\r\n	&lt;li&gt;diaľkové ovládanie&lt;/li&gt;\r\n	&lt;li&gt;požadované minimum na alternátor 75A/h – 28V&lt;/li&gt;\r\n	&lt;li&gt;ľahká montáž&lt;/li&gt;\r\n	&lt;li&gt;prepínač automatický/manuálny režim&lt;/li&gt;\r\n	&lt;li&gt;digitálny teplomer v °C alebo °F&lt;/li&gt;\r\n	&lt;li&gt;diaľkové ovládanie&lt;/li&gt;\r\n	&lt;li&gt;dvojitá ochrana akumulátorov&lt;/li&gt;\r\n	&lt;li&gt;ochrana akumulátorov kompresorov&lt;/li&gt;\r\n	&lt;li&gt;elektronické ovládanie akumulátora&lt;/li&gt;\r\n	&lt;li&gt;hlavné rozmery 655 x 730 x 210mm&lt;/li&gt;\r\n	&lt;li&gt;hmotnosť 43,5kg&lt;/li&gt;\r\n&lt;/ul&gt;', '                                                                                                                                                                                                                                                                                                                                                                                                                                                ', '', 'Integral power', '', '', '', '', '', '', '', ''),
(61, 4, 'R-Evolution', '&lt;p&gt;Elektronická chladiaca jednotka kabíny Bycool&amp;nbsp;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;R-EVOLUTION&lt;/span&gt;&amp;nbsp;dopĺňa funkcionalitu Vášho vozidla znižovaním teploty v kabíne keď je to potrebné. Chladiaca jednotka pracuje bez ohľadu na to, či beží motor vozidla alebo nie, a preto je určená na použitie najmä pri nakladaní a vykladaní vozidla, a na prestávky, na oddych. Vďaka nízkej konštrukčnej výške nie je nutné robiť zásahy do spojleru vozidla.&lt;br&gt;&lt;/p&gt;', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '                                                                                                                                                ', '', 'R-Evolution', '', '', '', '', '', '', '', ''),
(61, 1, 'R-Evolution', '&lt;p&gt;Elektronická chladiaca jednotka kabíny Bycool&amp;nbsp;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;R-EVOLUTION&lt;/span&gt;&amp;nbsp;dopĺňa funkcionalitu Vášho vozidla znižovaním teploty v kabíne keď je to potrebné. Chladiaca jednotka pracuje bez ohľadu na to, či beží motor vozidla alebo nie, a preto je určená na použitie najmä pri nakladaní a vykladaní vozidla, a na prestávky, na oddych. Vďaka nízkej konštrukčnej výške nie je nutné robiť zásahy do spojleru vozidla.&lt;br&gt;&lt;/p&gt;', '&lt;ul&gt;\r\n	&lt;li&gt;prevedenia 12 aj 24 Volt &lt;/li&gt;\r\n	&lt;li&gt;ovládanie všetkých funkcií diaľkovým ovládačom alebo priamo na ovládacom paneli zariadenia&lt;/li&gt;\r\n	&lt;li&gt;nie je potrebné nasmerovať diaľkový ovládač na senzor, tým sa vodič vyhne zbytočnému rozptyľovaniu sa počas jazdy&lt;/li&gt;\r\n	&lt;li&gt;aerodynamický tvar&lt;/li&gt;\r\n	&lt;li&gt;dve nádrže na vodu, jedna vonkajšia nádrž s kapacitou 35 litrov a druhá zabudovaná do zariadenia s ochranou proti pretečeniu, resp. preplneniu&lt;/li&gt;\r\n	&lt;li&gt;motor:\r\n		&lt;ul&gt;\r\n			&lt;li&gt;dvojitý axiálny ventilátor&lt;/li&gt;\r\n			&lt;li&gt;nízky odber prúdu pri 24V (od 0,4A do 4A)&lt;/li&gt;\r\n			&lt;li&gt;cirkulácia vzduchu: 900 m3/hod.&lt;/li&gt;\r\n		&lt;/ul&gt;\r\n	&lt;/li&gt;\r\n	&lt;li&gt;dodáva sa aj prevedenie ADR pre prepravu nebezpečného nákladu&lt;/li&gt;\r\n	&lt;li&gt;rozmery (Š x D x V): 787 x 860 x 155 mm&lt;/li&gt;\r\n	&lt;li&gt;nehlučné vodné čerpadlo&lt;/li&gt;\r\n	&lt;li&gt;elektrická ochrana&lt;/li&gt;\r\n	&lt;li&gt;nízka spotreba vody&lt;/li&gt;\r\n	&lt;li&gt;minimálne nároky na údržbu&lt;/li&gt;\r\n	&lt;li&gt;elektronický riadiaci microprocessor\r\n		&lt;ul&gt;\r\n			&lt;li&gt;s ovládaním rýchlosti ventilátora (8 rýchlostí) &lt;/li&gt;\r\n			&lt;li&gt;s programovaním času používania&lt;/li&gt;\r\n			&lt;li&gt;s kontrolou výšky hladiny vody&lt;/li&gt;\r\n			&lt;li&gt;s indikáciou činnosti vodného čerpadla&lt;/li&gt;\r\n		&lt;/ul&gt;\r\n	&lt;/li&gt;\r\n	&lt;li&gt;vonkajší kryt z termoplastu s UVA ochranou (odolný voči mechanickému poškodeniu)&lt;/li&gt;\r\n&lt;/ul&gt;', '                                                                        &lt;ul&gt;&lt;li&gt;Plne elektrická jednotka&lt;/li&gt;&lt;li&gt;Znižuje náklady na pohonné hmoty&lt;/li&gt;&lt;li&gt;Šetrná ku prostrediu&lt;/li&gt;&lt;li&gt;Pohodlný oddych v kabíne znižuje riziko nehody&lt;/li&gt;&lt;li&gt;Inštálacia bez zásahu do motoru a konštrukcie vozidla&lt;/li&gt;&lt;li&gt;Operuje nezávisle od chodu motora&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;br&gt;Toto zariadenie je navrhnuté pre montáž na strechu kabíny nákladného vozidla. Jeho montáž je jednoduchá a rýchla, nevyžaduje žiadny zásah do kabíny vozidla. Pracuje v manuálnom alebo automatickom režime. Výhodou automatického režimu je, že sa vodič nemusí starať o reguláciu teploty, klimatizácia si toto reguluje automaticky.&lt;/p&gt;&lt;p&gt;Záruka 2 roky na všetky diely.&lt;/p&gt;                                                                                                                                                                                                                                                                                                                                                                        ', '', 'R Evolution', '', '', '', '', '', '', '', ''),
(61, 3, 'R-Evolution', '&lt;p&gt;Elektronická chladiaca jednotka kabíny Bycool&amp;nbsp;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;R-EVOLUTION&lt;/span&gt;&amp;nbsp;dopĺňa funkcionalitu Vášho vozidla znižovaním teploty v kabíne keď je to potrebné. Chladiaca jednotka pracuje bez ohľadu na to, či beží motor vozidla alebo nie, a preto je určená na použitie najmä pri nakladaní a vykladaní vozidla, a na prestávky, na oddych. Vďaka nízkej konštrukčnej výške nie je nutné robiť zásahy do spojleru vozidla.&lt;br&gt;&lt;/p&gt;', '&lt;ul&gt;\r\n	&lt;li&gt;prevedenia 12 aj 24 Volt &lt;/li&gt;\r\n	&lt;li&gt;ovládanie všetkých funkcií diaľkovým ovládačom alebo priamo na ovládacom paneli zariadenia&lt;/li&gt;\r\n	&lt;li&gt;nie je potrebné nasmerovať diaľkový ovládač na senzor, tým sa vodič vyhne zbytočnému rozptyľovaniu sa počas jazdy&lt;/li&gt;\r\n	&lt;li&gt;aerodynamický tvar&lt;/li&gt;\r\n	&lt;li&gt;dve nádrže na vodu, jedna vonkajšia nádrž s kapacitou 35 litrov a druhá zabudovaná do zariadenia s ochranou proti pretečeniu, resp. preplneniu&lt;/li&gt;\r\n	&lt;li&gt;motor:\r\n		&lt;ul&gt;\r\n			&lt;li&gt;dvojitý axiálny ventilátor&lt;/li&gt;\r\n			&lt;li&gt;nízky odber prúdu pri 24V (od 0,4A do 4A)&lt;/li&gt;\r\n			&lt;li&gt;cirkulácia vzduchu: 900 m3/hod.&lt;/li&gt;\r\n		&lt;/ul&gt;\r\n	&lt;/li&gt;\r\n	&lt;li&gt;dodáva sa aj prevedenie ADR pre prepravu nebezpečného nákladu&lt;/li&gt;\r\n	&lt;li&gt;rozmery (Š x D x V): 787 x 860 x 155 mm&lt;/li&gt;\r\n	&lt;li&gt;nehlučné vodné čerpadlo&lt;/li&gt;\r\n	&lt;li&gt;elektrická ochrana&lt;/li&gt;\r\n	&lt;li&gt;nízka spotreba vody&lt;/li&gt;\r\n	&lt;li&gt;minimálne nároky na údržbu&lt;/li&gt;\r\n	&lt;li&gt;elektronický riadiaci microprocessor\r\n		&lt;ul&gt;\r\n			&lt;li&gt;s ovládaním rýchlosti ventilátora (8 rýchlostí) &lt;/li&gt;\r\n			&lt;li&gt;s programovaním času používania&lt;/li&gt;\r\n			&lt;li&gt;s kontrolou výšky hladiny vody&lt;/li&gt;\r\n			&lt;li&gt;s indikáciou činnosti vodného čerpadla&lt;/li&gt;\r\n		&lt;/ul&gt;\r\n	&lt;/li&gt;\r\n	&lt;li&gt;vonkajší kryt z termoplastu s UVA ochranou (odolný voči mechanickému poškodeniu)&lt;/li&gt;\r\n&lt;/ul&gt;', '                                                                        &lt;ul&gt;&lt;li&gt;Plne elektrická jednotka&lt;/li&gt;&lt;li&gt;Znižuje náklady na pohonné hmoty&lt;/li&gt;&lt;li&gt;Šetrná ku prostrediu&lt;/li&gt;&lt;li&gt;Pohodlný oddych v kabíne znižuje riziko nehody&lt;/li&gt;&lt;li&gt;Inštálacia bez zásahu do motoru a konštrukcie vozidla&lt;/li&gt;&lt;li&gt;Operuje nezávisle od chodu motora&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;br&gt;Toto zariadenie je navrhnuté pre montáž na strechu kabíny nákladného vozidla. Jeho montáž je jednoduchá a rýchla, nevyžaduje žiadny zásah do kabíny vozidla. Pracuje v manuálnom alebo automatickom režime. Výhodou automatického režimu je, že sa vodič nemusí starať o reguláciu teploty, klimatizácia si toto reguluje automaticky.&lt;/p&gt;&lt;p&gt;Záruka 2 roky na všetky diely.&lt;/p&gt;                                                                                                                                                                                                                                                                                                                                                                        ', '', 'R Evolution', '', '', '', '', '', '', '', ''),
(62, 3, 'Mochila', '&lt;p&gt;&lt;span style=&quot;color: rgb(27, 27, 27); font-family: Montserrat, Helvetica, Arial, sans-serif; line-height: 20px;&quot;&gt;Elektronická chladiaca jednotka kabíny Bycool&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-family: Montserrat, Helvetica, Arial, sans-serif; line-height: 20px; color: rgb(14, 65, 122);&quot;&gt;MOCHILA&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: rgb(27, 27, 27); font-family: Montserrat, Helvetica, Arial, sans-serif; line-height: 20px;&quot;&gt;dopĺňa funkcionalitu Vášho vozidla znižovaním teploty v kabíne keď je to potrebné. Chladiaca jednotka pracuje bez ohľadu na to, či beží motor vozidla alebo nie, a preto je určená na použitie najmä pri nakladaní a vykladaní vozidla, a na prestávky, na oddych.&amp;nbsp;Vhodné pre vozidlá, kde je požadovaná montáž na zadnú stenu kabíny.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '&lt;ul&gt;	&lt;li&gt;prevedenia 12 aj 24 Volt &lt;/li&gt;	&lt;li&gt;ovládanie všetkých funkcií diaľkovým ovládačom alebo priamo na ovládacom paneli zariadenia&lt;/li&gt;	&lt;li&gt;nie je potrebné nasmerovať diaľkový ovládač na senzor, tým sa vodič vyhne zbytočnému rozptyľovaniu sa počas jazdy&lt;/li&gt;	&lt;li&gt;aerodynamický tvar&lt;/li&gt;	&lt;li&gt;dve nádrže na vodu, jedna vonkajšia nádrž s kapacitou 35 litrov a druhá zabudovaná do zariadenia s ochranou proti pretečeniu, resp. preplneniu&lt;/li&gt;	&lt;li&gt;v otvoroch nasávaného vzduchu sú osadené aktívne uhlíkové filtre, ktoré zabezpečujú, že vzduch vstupujúci do kabíny vozidla neobsahuje prach, peľ ani iné nežiaduce častice&lt;/li&gt;	&lt;li&gt;motor:		&lt;ul&gt;			&lt;li&gt;dvojitý axiálny ventilátor&lt;/li&gt;			&lt;li&gt;nízky odber prúdu pri 24V (od 0,4 A do 4 A)&lt;/li&gt;			&lt;li&gt;cirkulácia vzduchu: 900 m3/hod.&lt;/li&gt;		&lt;/ul&gt;		&lt;/li&gt;	&lt;li&gt;dodáva sa aj prevedenie ADR pre prepravu nebezpečného nákladu&lt;/li&gt;	&lt;li&gt;rozmery (Š x D x V): 150 x 832 x 496 mm &lt;/li&gt;	&lt;li&gt;nehlučné vodné čerpadlo&lt;/li&gt;	&lt;li&gt;elektrická ochrana&lt;/li&gt;	&lt;li&gt;nízka spotreba vody&lt;/li&gt;	&lt;li&gt;nenáročná údržba&lt;/li&gt;	&lt;li&gt;elektronický riadiaci mikroprocesor		&lt;ul&gt;			&lt;li&gt;s ovládaním rýchlosti ventilátora&lt;/li&gt;			&lt;li&gt;s programovaním času používania&lt;/li&gt;			&lt;li&gt;s kontrolou výšky hladiny vody&lt;/li&gt;			&lt;li&gt;s indikáciou činnosti vodného čerpadla&lt;/li&gt;			&lt;li&gt;s akustickou signalizáciou&lt;/li&gt;		&lt;/ul&gt;	&lt;/li&gt;&lt;/ul&gt;', '                                                                                                                                                                                                                                                                                                                                                ', '', 'Mochila', '', '', '', '', '', '', '', ''),
(62, 1, 'Mochila', '&lt;p&gt;&lt;span style=&quot;color: rgb(27, 27, 27); font-family: Montserrat, Helvetica, Arial, sans-serif; line-height: 20px;&quot;&gt;Elektronická chladiaca jednotka kabíny Bycool&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-family: Montserrat, Helvetica, Arial, sans-serif; line-height: 20px; color: rgb(14, 65, 122);&quot;&gt;MOCHILA&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: rgb(27, 27, 27); font-family: Montserrat, Helvetica, Arial, sans-serif; line-height: 20px;&quot;&gt;dopĺňa funkcionalitu Vášho vozidla znižovaním teploty v kabíne keď je to potrebné. Chladiaca jednotka pracuje bez ohľadu na to, či beží motor vozidla alebo nie, a preto je určená na použitie najmä pri nakladaní a vykladaní vozidla, a na prestávky, na oddych.&amp;nbsp;Vhodné pre vozidlá, kde je požadovaná montáž na zadnú stenu kabíny.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '&lt;ul&gt;&lt;li&gt;prevedenia 12 aj 24 Volt&lt;/li&gt;&lt;li&gt;ovládanie všetkých funkcií diaľkovým ovládačom alebo priamo na ovládacom paneli zariadenia&lt;/li&gt;&lt;li&gt;nie je potrebné nasmerovať diaľkový ovládač na senzor, tým sa vodič vyhne zbytočnému rozptyľovaniu sa počas jazdy&lt;/li&gt;&lt;li&gt;aerodynamický tvar&lt;/li&gt;&lt;li&gt;dve nádrže na vodu, jedna vonkajšia nádrž s kapacitou 35 litrov a druhá zabudovaná do zariadenia s ochranou proti pretečeniu, resp. preplneniu&lt;/li&gt;&lt;li&gt;v otvoroch nasávaného vzduchu sú osadené aktívne uhlíkové filtre, ktoré zabezpečujú, že vzduch vstupujúci do kabíny vozidla neobsahuje prach, peľ ani iné nežiaduce častice&lt;/li&gt;&lt;li&gt;motor:&lt;ul&gt;&lt;li&gt;dvojitý axiálny ventilátor&lt;/li&gt;&lt;li&gt;nízky odber prúdu pri 24V (od 0,4 A do 4 A)&lt;/li&gt;&lt;li&gt;cirkulácia vzduchu: 900 m3/hod.&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;dodáva sa aj prevedenie ADR pre prepravu nebezpečného nákladu&lt;/li&gt;&lt;li&gt;rozmery (Š x D x V): 150 x 832 x 496 mm&lt;/li&gt;&lt;li&gt;nehlučné vodné čerpadlo&lt;/li&gt;&lt;li&gt;elektrická ochrana&lt;/li&gt;&lt;li&gt;nízka spotreba vody&lt;/li&gt;&lt;li&gt;nenáročná údržba&lt;/li&gt;&lt;li&gt;elektronický riadiaci mikroprocesor&lt;ul&gt;&lt;li&gt;s ovládaním rýchlosti ventilátora&lt;/li&gt;&lt;li&gt;s programovaním času používania&lt;/li&gt;&lt;li&gt;s kontrolou výšky hladiny vody&lt;/li&gt;&lt;li&gt;s indikáciou činnosti vodného čerpadla&lt;/li&gt;&lt;li&gt;s akustickou signalizáciou&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;/ul&gt;', '                                                                                                                                                                                                                                                                                                                                                ', '', 'Mochila', '', '', '', '', '', '', '', ''),
(63, 1, 'Flat', '&lt;p&gt;Extra plochá strešná klimatizačná jednotka určená pre použitie na nákladných vozidlách vybavených spoilerom. Filter s aktívnym uhlím zabraňuje prenikaniu prachu, peľu a ostatných častíc do pracovného priestoru posádky vozidla. Určená je pre nákladné automobily, terénne automobily, žeriavy, stavebné a pracovné stroje&lt;br&gt;&lt;/p&gt;', '&lt;ul&gt;&lt;li&gt;pnapätie 12V alebo 24V&lt;/li&gt;&lt;li&gt;hmotnosť 14,8kg&lt;/li&gt;&lt;li&gt;hlavné rozmery 818 x 718 x 135mm&lt;/li&gt;&lt;/ul&gt;', '                                                                                                                                                                                                                                                                                                ', '', 'Flat', '', '', '', '', '', '', '', ''),
(63, 3, 'Flat', '&lt;p&gt;Extra plochá strešná klimatizačná jednotka určená pre použitie na nákladných vozidlách vybavených spoilerom. Filter s aktívnym uhlím zabraňuje prenikaniu prachu, peľu a ostatných častíc do pracovného priestoru posádky vozidla. Určená je pre nákladné automobily, terénne automobily, žeriavy, stavebné a pracovné stroje&lt;br&gt;&lt;/p&gt;', '&lt;ul&gt;&lt;li&gt;pnapätie 12V alebo 24V&lt;/li&gt;&lt;li&gt;hmotnosť 14,8kg&lt;/li&gt;&lt;li&gt;hlavné rozmery 818 x 718 x 135mm&lt;/li&gt;&lt;/ul&gt;', '                                                                                                                                                                                                                                                                                                ', '', 'Flat', '', '', '', '', '', '', '', ''),
(63, 2, 'Flat', '&lt;p&gt;Extra plochá strešná klimatizačná jednotka určená pre použitie na nákladných vozidlách vybavených spoilerom. Filter s aktívnym uhlím zabraňuje prenikaniu prachu, peľu a ostatných častíc do pracovného priestoru posádky vozidla. Určená je pre nákladné automobily, terénne automobily, žeriavy, stavebné a pracovné stroje&lt;br&gt;&lt;/p&gt;', '&lt;ul&gt;	&lt;li&gt;pnapätie 12V alebo 24V&lt;/li&gt;	&lt;li&gt;hmotnosť 14,8kg&lt;/li&gt;	&lt;li&gt;hlavné rozmery 818 x 718 x 135mm&lt;/li&gt;&lt;/ul&gt;', '                                                                                                                                                                                                                                                                                                ', '', 'Flat', '', '', '', '', '', '', '', ''),
