INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `techspecs`, `highlights`, `tag`, `meta_title`, `meta_description`, `meta_keyword`, `custom_field_1_title`, `custom_field_1_content`, `custom_field_2_title`, `custom_field_2_content`, `custom_field_3_title`, `custom_field_3_content`) VALUES
(56, 2, 'Compact 2.0kW 12V', '&lt;p&gt;Model green line &lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;COMPACT 2.0&lt;/span&gt; je ekologický nezávislý klimatizačný systém určený pre použitie v noci (so zapnutým alebo vypnutým motorom). Pracuje s dvomi kompresormi a má dva nezávislé chladice okruhy a v podstate pracuje ako dve klimatizácie v jednej. COMPACT green line ponúka nízku spotrebu, nevyžaduje údržbu a umožňuje reguláciu teploty pre pokojný spánok v noci s vypnutým motorom automobilu. Určená je pre nákladné automobily, elektrické vozidlá. sanitky, prepravu zvierat, camping, žeriavy, zametacie automobily.&lt;/p&gt;', '&lt;ul&gt;\r\n	&lt;li&gt;výkon 2,0 kW&lt;/li&gt;\r\n	&lt;li&gt;napätie: 12V&lt;/li&gt;\r\n	&lt;li&gt;2 režimy nastavenia:\r\n		&lt;ul&gt;\r\n			&lt;li&gt;manuálny – F0&lt;/li&gt;\r\n			&lt;li&gt;automatický – F4\r\n				&lt;ul&gt;\r\n					&lt;li&gt;požiadavky napájania pre automatický režim:\r\n						&lt;ul&gt;\r\n							&lt;li&gt;\r\n								12V: 22Ah min. – 62Ah. max.\r\n							&lt;/li&gt;\r\n						&lt;/ul&gt;\r\n					&lt;/li&gt;\r\n				&lt;/ul&gt;\r\n			&lt;/li&gt;\r\n		&lt;/ul&gt;	\r\n	&lt;/li&gt;\r\n	&lt;li&gt;maximálny prietok vzduchu: 800m3/h&lt;/li&gt;\r\n	&lt;li&gt;časovač programu až do 9 hodím prevádzky&lt;/li&gt;\r\n	&lt;li&gt;digitálny teplomer v °C alebo °F&lt;/li&gt;\r\n	&lt;li&gt;diaľkové ovládanie&lt;/li&gt;\r\n	&lt;li&gt;ochranná poistka systému&lt;/li&gt;\r\n	&lt;li&gt;homologizácia a certifikáty č. e9&lt;/li&gt;\r\n	&lt;li&gt;hlavné rozmery 726mm x 826mm x 203mm (d x š x v)&lt;/li&gt;\r\n	&lt;li&gt;hmotnosť 40kg&lt;/li&gt;\r\n	&lt;li&gt;dvojitá ochrana akumulátorov\r\n		&lt;/li&gt;&lt;li&gt;ochrana akumulátorov kompresorov&lt;/li&gt;\r\n		&lt;li&gt;elektronické ovládanie akumulátora&lt;/li&gt;\r\n	\r\n	&lt;li&gt;jednotka je predplnená chladiacim médiom&lt;/li&gt;\r\n	&lt;li&gt;upevnenie na strešné okno bez akýchkoľvek zmien v konštrukcii kabíny&lt;/li&gt;\r\n	&lt;li&gt;aerodynamický dizajn&lt;/li&gt;\r\n	&lt;li&gt;UV ochranný kryt&lt;/li&gt;\r\n	&lt;li&gt;jednoduchá výmena náhradných dielov&lt;/li&gt;\r\n	&lt;li&gt;rýchla montáž&lt;/li&gt;\r\n&lt;/ul&gt;', '                                                                                                                                                                                                &lt;ul&gt;\r\n\r\n\r\n&lt;li&gt;Plne elektrická jednotka&lt;/li&gt;\r\n\r\n\r\n&lt;li&gt;Znižuje náklady na pohonné hmoty&lt;/li&gt;\r\n\r\n\r\n&lt;li&gt;Šetrná ku prostrediu&lt;/li&gt;\r\n\r\n\r\n&lt;li&gt;Pohodlný oddych v kabíne znižuje riziko nehody&lt;/li&gt;\r\n\r\n\r\n&lt;li&gt;Inštálacia bez zásahu do motoru a konštrukcie vozidla&lt;/li&gt;\r\n\r\n\r\n&lt;li&gt;Operuje nezávisle od chodu motora&lt;/li&gt;\r\n\r\n\r\n&lt;/ul&gt;\r\n\r\n\r\n&lt;p&gt;&lt;br&gt;\r\nToto zariadenie je navrhnuté pre montáž na strechu kabíny nákladného vozidla. Jeho montáž je jednoduchá a rýchla, nevyžaduje žiadny zásah do kabíny vozidla. Pracuje v manuálnom alebo automatickom režime. Výhodou automatického režimu je, že sa vodič nemusí starať o reguláciu teploty, klimatizácia si toto reguluje automaticky.\r\n&lt;/p&gt;\r\n\r\n\r\n&lt;p&gt;\r\nZáruka 2 roky na všetky diely.\r\n&lt;/p&gt;                                                                                                                                                                                                ', '', 'Compact 2.0kW 12V', '', '', '', '', '', '', '', ''),
(58, 3, 'Compact 1.6kW 24V MAN', '&lt;p&gt;Model green line&amp;nbsp;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;COMPACT 1.6&lt;/span&gt;&amp;nbsp;je ekologický nezávislý klimatizačný systém určený pre použitie v noci (so zapnutým alebo vypnutým motorom). Pracuje s dvomi kompresormi a má dva nezávislé chladice okruhy a v podstate pracuje ako dve klimatizácie v jednej. COMPACT green line ponúka nízku spotrebu, nevyžaduje údržbu a umožňuje reguláciu teploty pre pokojný spánok v noci s vypnutým motorom automobilu. Určená je pre nákladné automobily a elektrické vozidlá.&lt;br&gt;&lt;/p&gt;', '&lt;ul&gt;&lt;li&gt;výkon 1,6 kW&lt;/li&gt;&lt;li&gt;napätie: 24V&lt;/li&gt;&lt;li&gt;2 režimy nastavenia:&lt;ul&gt;&lt;li&gt;manuálny – F0&lt;/li&gt;&lt;li&gt;automatický – F4&lt;ul&gt;&lt;li&gt;požiadavky napájania pre automatický režim:&lt;ul&gt;&lt;li&gt;24V: 8Ah min. – 22Ah. max.&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;maximálny prietok vzduchu: 800m3/h&lt;/li&gt;&lt;li&gt;časovač programu až do 9 hodím prevádzky&lt;/li&gt;&lt;li&gt;digitálny teplomer v °C alebo °F&lt;/li&gt;&lt;li&gt;diaľkové ovládanie&lt;/li&gt;&lt;li&gt;ochranná poistka systému&lt;/li&gt;&lt;li&gt;homologizácia a certifikáty č. e9&lt;/li&gt;&lt;li&gt;hlavné rozmery 726mm x 826mm x 203mm (d x š x v)&lt;/li&gt;&lt;li&gt;hmotnosť 28kg&lt;/li&gt;&lt;li&gt;dvojitá ochrana akumulátorov&lt;/li&gt;&lt;li&gt;ochrana akumulátorov kompresorov&lt;/li&gt;&lt;li&gt;elektronické ovládanie akumulátora&lt;/li&gt;&lt;li&gt;jednotka je predplnená chladiacim médiom&lt;/li&gt;&lt;li&gt;upevnenie na strešné okno bez akýchkoľvek zmien v konštrukcii kabíny&lt;/li&gt;&lt;li&gt;aerodynamický dizajn&lt;/li&gt;&lt;li&gt;UV ochranný kryt&lt;/li&gt;&lt;li&gt;jednoduchá výmena náhradných dielov&lt;/li&gt;&lt;li&gt;rýchla montáž&lt;/li&gt;&lt;/ul&gt;', '                                                                        &lt;ul&gt;&lt;li&gt;Plne elektrická jednotka&lt;/li&gt;&lt;li&gt;Znižuje náklady na pohonné hmoty&lt;/li&gt;&lt;li&gt;Šetrná ku prostrediu&lt;/li&gt;&lt;li&gt;Pohodlný oddych v kabíne znižuje riziko nehody&lt;/li&gt;&lt;li&gt;Inštálacia bez zásahu do motoru a konštrukcie vozidla&lt;/li&gt;&lt;li&gt;Operuje nezávisle od chodu motora&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;br&gt;Toto zariadenie je navrhnuté pre montáž na strechu kabíny nákladného vozidla. Jeho montáž je jednoduchá a rýchla, nevyžaduje žiadny zásah do kabíny vozidla. Pracuje v manuálnom alebo automatickom režime. Výhodou automatického režimu je, že sa vodič nemusí starať o reguláciu teploty, klimatizácia si toto reguluje automaticky.&lt;/p&gt;&lt;p&gt;Záruka 2 roky na všetky diely.&lt;/p&gt;                                                                                                                                                                                                                                                                                                                        ', '', 'Compact 1.6kW 24V MAN', '', '', '', '', '', '', '', ''),
