(56, 3, 'Compact 2.0kW 12V', '&lt;p&gt;Model green line &lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;COMPACT 2.0&lt;/span&gt; je ekologický nezávislý klimatizačný systém určený pre použitie v noci (so zapnutým alebo vypnutým motorom). Pracuje s dvomi kompresormi a má dva nezávislé chladice okruhy a v podstate pracuje ako dve klimatizácie v jednej. COMPACT green line ponúka nízku spotrebu, nevyžaduje údržbu a umožňuje reguláciu teploty pre pokojný spánok v noci s vypnutým motorom automobilu. Určená je pre nákladné automobily, elektrické vozidlá. sanitky, prepravu zvierat, camping, žeriavy, zametacie automobily.&lt;/p&gt;', '&lt;ul&gt;\r\n	&lt;li&gt;výkon 2,0 kW&lt;/li&gt;\r\n	&lt;li&gt;napätie: 12V&lt;/li&gt;\r\n	&lt;li&gt;2 režimy nastavenia:\r\n		&lt;ul&gt;\r\n			&lt;li&gt;manuálny – F0&lt;/li&gt;\r\n			&lt;li&gt;automatický – F4\r\n				&lt;ul&gt;\r\n					&lt;li&gt;požiadavky napájania pre automatický režim:\r\n						&lt;ul&gt;\r\n							&lt;li&gt;\r\n								12V: 22Ah min. – 62Ah. max.\r\n							&lt;/li&gt;\r\n						&lt;/ul&gt;\r\n					&lt;/li&gt;\r\n				&lt;/ul&gt;\r\n			&lt;/li&gt;\r\n		&lt;/ul&gt;	\r\n	&lt;/li&gt;\r\n	&lt;li&gt;maximálny prietok vzduchu: 800m3/h&lt;/li&gt;\r\n	&lt;li&gt;časovač programu až do 9 hodím prevádzky&lt;/li&gt;\r\n	&lt;li&gt;digitálny teplomer v °C alebo °F&lt;/li&gt;\r\n	&lt;li&gt;diaľkové ovládanie&lt;/li&gt;\r\n	&lt;li&gt;ochranná poistka systému&lt;/li&gt;\r\n	&lt;li&gt;homologizácia a certifikáty č. e9&lt;/li&gt;\r\n	&lt;li&gt;hlavné rozmery 726mm x 826mm x 203mm (d x š x v)&lt;/li&gt;\r\n	&lt;li&gt;hmotnosť 40kg&lt;/li&gt;\r\n	&lt;li&gt;dvojitá ochrana akumulátorov\r\n		&lt;/li&gt;&lt;li&gt;ochrana akumulátorov kompresorov&lt;/li&gt;\r\n		&lt;li&gt;elektronické ovládanie akumulátora&lt;/li&gt;\r\n	\r\n	&lt;li&gt;jednotka je predplnená chladiacim médiom&lt;/li&gt;\r\n	&lt;li&gt;upevnenie na strešné okno bez akýchkoľvek zmien v konštrukcii kabíny&lt;/li&gt;\r\n	&lt;li&gt;aerodynamický dizajn&lt;/li&gt;\r\n	&lt;li&gt;UV ochranný kryt&lt;/li&gt;\r\n	&lt;li&gt;jednoduchá výmena náhradných dielov&lt;/li&gt;\r\n	&lt;li&gt;rýchla montáž&lt;/li&gt;\r\n&lt;/ul&gt;', '                                                                                                                                                                                                &lt;ul&gt;\r\n\r\n\r\n&lt;li&gt;Plne elektrická jednotka&lt;/li&gt;\r\n\r\n\r\n&lt;li&gt;Znižuje náklady na pohonné hmoty&lt;/li&gt;\r\n\r\n\r\n&lt;li&gt;Šetrná ku prostrediu&lt;/li&gt;\r\n\r\n\r\n&lt;li&gt;Pohodlný oddych v kabíne znižuje riziko nehody&lt;/li&gt;\r\n\r\n\r\n&lt;li&gt;Inštálacia bez zásahu do motoru a konštrukcie vozidla&lt;/li&gt;\r\n\r\n\r\n&lt;li&gt;Operuje nezávisle od chodu motora&lt;/li&gt;\r\n\r\n\r\n&lt;/ul&gt;\r\n\r\n\r\n&lt;p&gt;&lt;br&gt;\r\nToto zariadenie je navrhnuté pre montáž na strechu kabíny nákladného vozidla. Jeho montáž je jednoduchá a rýchla, nevyžaduje žiadny zásah do kabíny vozidla. Pracuje v manuálnom alebo automatickom režime. Výhodou automatického režimu je, že sa vodič nemusí starať o reguláciu teploty, klimatizácia si toto reguluje automaticky.\r\n&lt;/p&gt;\r\n\r\n\r\n&lt;p&gt;\r\nZáruka 2 roky na všetky diely.\r\n&lt;/p&gt;                                                                                                                                                                                                ', '', 'Compact 2.0kW 12V', '', '', '', '', '', '', '', ''),
(62, 2, 'Mochila', '&lt;p&gt;&lt;span style=&quot;color: rgb(27, 27, 27); font-family: Montserrat, Helvetica, Arial, sans-serif; line-height: 20px;&quot;&gt;Elektronická chladiaca jednotka kabíny Bycool &lt;/span&gt;&lt;span style=&quot;font-family: Montserrat, Helvetica, Arial, sans-serif; line-height: 20px; color: rgb(14, 65, 122);&quot;&gt;MOCHILA&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: rgb(27, 27, 27); font-family: Montserrat, Helvetica, Arial, sans-serif; line-height: 20px;&quot;&gt;dopĺňa funkcionalitu Vášho vozidla znižovaním teploty v kabíne keď je to potrebné. Chladiaca jednotka pracuje bez ohľadu na to, či beží motor vozidla alebo nie, a preto je určená na použitie najmä pri nakladaní a vykladaní vozidla, a na prestávky, na oddych.&amp;nbsp;Vhodné pre vozidlá, kde je požadovaná montáž na zadnú stenu kabíny.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '&lt;ul&gt;&lt;li&gt;prevedenia 12 aj 24 Volt&lt;/li&gt;&lt;li&gt;ovládanie všetkých funkcií diaľkovým ovládačom alebo priamo na ovládacom paneli zariadenia&lt;/li&gt;&lt;li&gt;nie je potrebné nasmerovať diaľkový ovládač na senzor, tým sa vodič vyhne zbytočnému rozptyľovaniu sa počas jazdy&lt;/li&gt;&lt;li&gt;aerodynamický tvar&lt;/li&gt;&lt;li&gt;dve nádrže na vodu, jedna vonkajšia nádrž s kapacitou 35 litrov a druhá zabudovaná do zariadenia s ochranou proti pretečeniu, resp. preplneniu&lt;/li&gt;&lt;li&gt;v otvoroch nasávaného vzduchu sú osadené aktívne uhlíkové filtre, ktoré zabezpečujú, že vzduch vstupujúci do kabíny vozidla neobsahuje prach, peľ ani iné nežiaduce častice&lt;/li&gt;&lt;li&gt;motor:&lt;ul&gt;&lt;li&gt;dvojitý axiálny ventilátor&lt;/li&gt;&lt;li&gt;nízky odber prúdu pri 24V (od 0,4 A do 4 A)&lt;/li&gt;&lt;li&gt;cirkulácia vzduchu: 900 m3/hod.&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;dodáva sa aj prevedenie ADR pre prepravu nebezpečného nákladu&lt;/li&gt;&lt;li&gt;rozmery (Š x D x V): 150 x 832 x 496 mm&lt;/li&gt;&lt;li&gt;nehlučné vodné čerpadlo&lt;/li&gt;&lt;li&gt;elektrická ochrana&lt;/li&gt;&lt;li&gt;nízka spotreba vody&lt;/li&gt;&lt;li&gt;nenáročná údržba&lt;/li&gt;&lt;li&gt;elektronický riadiaci mikroprocesor&lt;ul&gt;&lt;li&gt;s ovládaním rýchlosti ventilátora&lt;/li&gt;&lt;li&gt;s programovaním času používania&lt;/li&gt;&lt;li&gt;s kontrolou výšky hladiny vody&lt;/li&gt;&lt;li&gt;s indikáciou činnosti vodného čerpadla&lt;/li&gt;&lt;li&gt;s akustickou signalizáciou&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;/ul&gt;', '                                                                                                                                                                                                                                                                                                                                                ', '', 'Mochila', '', '', '', '', '', '', '', ''),
(613, 1, 'SlimFIT', '&lt;p&gt;Strešná klimatizácia&amp;nbsp;&lt;span style=&quot;color: rgb(53, 123, 43);&quot;&gt;SlimFIT&lt;/span&gt;&amp;nbsp;od Dirny je najnižšia samostatná klimatizácia pre nákladnú dopravu na trhu. Poháňaná elektrickou enerigou priamo z batérie znižuje náklady na pohonné hmoty a vďaka svojmu nízkemu profilu je perfekntým riešním pre vysoké vozidlá.&lt;br&gt;&lt;/p&gt;', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '&lt;li&gt;Plne elektrická jednotka&lt;/li&gt;&lt;li&gt;Znižuje náklady na pohonné hmoty&lt;/li&gt;&lt;li&gt;Šetrná ku prostrediu&lt;/li&gt;&lt;li&gt;Pohodlný oddych v kabíne znižuje riziko nehody&lt;/li&gt;&lt;li&gt;Inštálacia bez zásahu do motoru a konštrukcie vozidla&lt;/li&gt;&lt;li&gt;Operuje nezávisle od chodu motora&lt;/li&gt;&lt;p&gt;&lt;br&gt;Toto zariadenie je navrhnuté pre montáž na strechu kabíny nákladného vozidla. Jeho montáž je jednoduchá a rýchla, nevyžaduje žiadny zásah do kabíny vozidla. Pracuje v manuálnom alebo automatickom režime. Výhodou automatického režimu je, že sa vodič nemusí starať o reguláciu teploty, klimatizácia si toto reguluje automaticky.&lt;/p&gt;&lt;p&gt;Záruka 2 roky na všetky diely.&lt;/p&gt;                                                                                                ', '', 'SlimFIT', '', '', '', '', '', '', '', ''),
(613, 2, 'SlimFIT', '&lt;p&gt;Strešná klimatizácia &lt;span style=&quot;color: rgb(53, 123, 43);&quot;&gt;SlimFIT&lt;/span&gt; od Dirny je najnižšia samostatná klimatizácia pre nákladnú dopravu na trhu. Poháňaná elektrickou enerigou priamo z batérie znižuje náklady na pohonné hmoty a vďaka svojmu nízkemu profilu je perfekntým riešním pre vysoké vozidlá.&lt;br&gt;&lt;/p&gt;', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '&lt;li&gt;Plne elektrická jednotka&lt;/li&gt;&lt;li&gt;Znižuje náklady na pohonné hmoty&lt;/li&gt;&lt;li&gt;Šetrná ku prostrediu&lt;/li&gt;&lt;li&gt;Pohodlný oddych v kabíne znižuje riziko nehody&lt;/li&gt;&lt;li&gt;Inštálacia bez zásahu do motoru a konštrukcie vozidla&lt;/li&gt;&lt;li&gt;Operuje nezávisle od chodu motora&lt;/li&gt;&lt;p&gt;&lt;br&gt;Toto zariadenie je navrhnuté pre montáž na strechu kabíny nákladného vozidla. Jeho montáž je jednoduchá a rýchla, nevyžaduje žiadny zásah do kabíny vozidla. Pracuje v manuálnom alebo automatickom režime. Výhodou automatického režimu je, že sa vodič nemusí starať o reguláciu teploty, klimatizácia si toto reguluje automaticky.&lt;/p&gt;&lt;p&gt;Záruka 2 roky na všetky diely.&lt;/p&gt;                                                                                                ', '', 'SlimFIT', '', '', '', '', '', '', '', ''),
(613, 3, 'SlimFIT', '&lt;p&gt;Strešná klimatizácia&amp;nbsp;&lt;span style=&quot;color: rgb(53, 123, 43);&quot;&gt;SlimFIT&lt;/span&gt;&amp;nbsp;od Dirny je najnižšia samostatná klimatizácia pre nákladnú dopravu na trhu. Poháňaná elektrickou enerigou priamo z batérie znižuje náklady na pohonné hmoty a vďaka svojmu nízkemu profilu je perfekntým riešním pre vysoké vozidlá.&lt;br&gt;&lt;/p&gt;', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '&lt;li&gt;Plne elektrická jednotka&lt;/li&gt;&lt;li&gt;Znižuje náklady na pohonné hmoty&lt;/li&gt;&lt;li&gt;Šetrná ku prostrediu&lt;/li&gt;&lt;li&gt;Pohodlný oddych v kabíne znižuje riziko nehody&lt;/li&gt;&lt;li&gt;Inštálacia bez zásahu do motoru a konštrukcie vozidla&lt;/li&gt;&lt;li&gt;Operuje nezávisle od chodu motora&lt;/li&gt;&lt;p&gt;&lt;br&gt;Toto zariadenie je navrhnuté pre montáž na strechu kabíny nákladného vozidla. Jeho montáž je jednoduchá a rýchla, nevyžaduje žiadny zásah do kabíny vozidla. Pracuje v manuálnom alebo automatickom režime. Výhodou automatického režimu je, že sa vodič nemusí starať o reguláciu teploty, klimatizácia si toto reguluje automaticky.&lt;/p&gt;&lt;p&gt;Záruka 2 roky na všetky diely.&lt;/p&gt;                                                                                                ', '', 'SlimFIT', '', '', '', '', '', '', '', ''),
