(56, 4, 'Compact 2.0kW 12V', '&lt;p&gt;Model green line &lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;COMPACT 2.0&lt;/span&gt; je ekologický nezávislý klimatizačný systém určený pre použitie v noci (so zapnutým alebo vypnutým motorom). Pracuje s dvomi kompresormi a má dva nezávislé chladice okruhy a v podstate pracuje ako dve klimatizácie v jednej. COMPACT green line ponúka nízku spotrebu, nevyžaduje údržbu a umožňuje reguláciu teploty pre pokojný spánok v noci s vypnutým motorom automobilu. Určená je pre nákladné automobily, elektrické vozidlá. sanitky, prepravu zvierat, camping, žeriavy, zametacie automobily.&lt;/p&gt;', '', '', '', '', '', '', '', '', '', '', '', ''),
(62, 4, 'Mochila', '&lt;p&gt;&lt;span style=&quot;color: rgb(27, 27, 27); font-family: Montserrat, Helvetica, Arial, sans-serif; line-height: 20px;&quot;&gt;Elektronická chladiaca jednotka kabíny Bycool &lt;/span&gt;&lt;span style=&quot;font-family: Montserrat, Helvetica, Arial, sans-serif; line-height: 20px; color: rgb(14, 65, 122);&quot;&gt;MOCHILA&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: rgb(27, 27, 27); font-family: Montserrat, Helvetica, Arial, sans-serif; line-height: 20px;&quot;&gt;dopĺňa funkcionalitu Vášho vozidla znižovaním teploty v kabíne keď je to potrebné. Chladiaca jednotka pracuje bez ohľadu na to, či beží motor vozidla alebo nie, a preto je určená na použitie najmä pri nakladaní a vykladaní vozidla, a na prestávky, na oddych.&amp;nbsp;Vhodné pre vozidlá, kde je požadovaná montáž na zadnú stenu kabíny.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', '', '', '', '', '', '', '', '', '', '', ''),
(613, 4, 'SlimFIT', '&lt;p&gt;Strešná klimatizácia &lt;span style=&quot;color: rgb(53, 123, 43);&quot;&gt;SlimFIT&lt;/span&gt; od Dirny je najnižšia samostatná klimatizácia pre nákladnú dopravu na trhu. Poháňaná elektrickou enerigou priamo z batérie znižuje náklady na pohonné hmoty a vďaka svojmu nízkemu profilu je perfekntým riešním pre vysoké vozidlá.&lt;br&gt;&lt;/p&gt;', '', '', '', '', '', '', '', '', '', '', '', ''),
