INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `techspecs`, `highlights`, `tag`, `meta_title`, `meta_description`, `meta_keyword`, `custom_field_1_title`, `custom_field_1_content`, `custom_field_2_title`, `custom_field_2_content`, `custom_field_3_title`, `custom_field_3_content`) VALUES
(61, 2, 'R-Evolution', '&lt;p&gt;Elektronická chladiaca jednotka kabíny Bycool&amp;nbsp;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;R-EVOLUTION&lt;/span&gt;&amp;nbsp;dopĺňa funkcionalitu Vášho vozidla znižovaním teploty v kabíne keď je to potrebné. Chladiaca jednotka pracuje bez ohľadu na to, či beží motor vozidla alebo nie, a preto je určená na použitie najmä pri nakladaní a vykladaní vozidla, a na prestávky, na oddych. Vďaka nízkej konštrukčnej výške nie je nutné robiť zásahy do spojleru vozidla.&lt;br&gt;&lt;/p&gt;', '&lt;ul&gt;\r\n	&lt;li&gt;prevedenia 12 aj 24 Volt &lt;/li&gt;\r\n	&lt;li&gt;ovládanie všetkých funkcií diaľkovým ovládačom alebo priamo na ovládacom paneli zariadenia&lt;/li&gt;\r\n	&lt;li&gt;nie je potrebné nasmerovať diaľkový ovládač na senzor, tým sa vodič vyhne zbytočnému rozptyľovaniu sa počas jazdy&lt;/li&gt;\r\n	&lt;li&gt;aerodynamický tvar&lt;/li&gt;\r\n	&lt;li&gt;dve nádrže na vodu, jedna vonkajšia nádrž s kapacitou 35 litrov a druhá zabudovaná do zariadenia s ochranou proti pretečeniu, resp. preplneniu&lt;/li&gt;\r\n	&lt;li&gt;motor:\r\n		&lt;ul&gt;\r\n			&lt;li&gt;dvojitý axiálny ventilátor&lt;/li&gt;\r\n			&lt;li&gt;nízky odber prúdu pri 24V (od 0,4A do 4A)&lt;/li&gt;\r\n			&lt;li&gt;cirkulácia vzduchu: 900 m3/hod.&lt;/li&gt;\r\n		&lt;/ul&gt;\r\n	&lt;/li&gt;\r\n	&lt;li&gt;dodáva sa aj prevedenie ADR pre prepravu nebezpečného nákladu&lt;/li&gt;\r\n	&lt;li&gt;rozmery (Š x D x V): 787 x 860 x 155 mm&lt;/li&gt;\r\n	&lt;li&gt;nehlučné vodné čerpadlo&lt;/li&gt;\r\n	&lt;li&gt;elektrická ochrana&lt;/li&gt;\r\n	&lt;li&gt;nízka spotreba vody&lt;/li&gt;\r\n	&lt;li&gt;minimálne nároky na údržbu&lt;/li&gt;\r\n	&lt;li&gt;elektronický riadiaci microprocessor\r\n		&lt;ul&gt;\r\n			&lt;li&gt;s ovládaním rýchlosti ventilátora (8 rýchlostí) &lt;/li&gt;\r\n			&lt;li&gt;s programovaním času používania&lt;/li&gt;\r\n			&lt;li&gt;s kontrolou výšky hladiny vody&lt;/li&gt;\r\n			&lt;li&gt;s indikáciou činnosti vodného čerpadla&lt;/li&gt;\r\n		&lt;/ul&gt;\r\n	&lt;/li&gt;\r\n	&lt;li&gt;vonkajší kryt z termoplastu s UVA ochranou (odolný voči mechanickému poškodeniu)&lt;/li&gt;\r\n&lt;/ul&gt;', '                                                &lt;h4&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;Elektronická chladiaca jednotka kabíny maximálny výkon - minimálna spotreba - nižšia konštrukčná výška&lt;/span&gt;&lt;/h4&gt;&lt;p&gt;	Elektronická chladiaca jednotka kabíny Bycool R-EVOLUTION dopĺňa funkcionalitu Vášho vozidla znižovaním teploty v kabíne keď je to potrebné. Chladiaca jednotka pracuje bez ohľadu na to, či beží motor vozidla alebo nie, a preto je určená na použitie najmä pri nakladaní a vykladaní vozidla, a na prestávky, na oddych. 	&lt;br&gt;&lt;br&gt;	Vďaka nízkej konštrukčnej výške nie je nutné robiť zásahy do spojleru vozidla.&lt;/p&gt;&lt;h4&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;Okamžitá úspora paliva&lt;/span&gt;&lt;/h4&gt;&lt;p&gt;	Nezávislé chladiace zariadenia odoberá iba energiu z batérií vozidla.&lt;/p&gt;&lt;h4&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;Vysokovýkonná výparníková chladiaca jednotka&lt;/span&gt;&lt;/h4&gt;&lt;ul&gt;	&lt;li&gt;Vnútorný riadiaci a distribučný panel vysokej kvality.&lt;/li&gt;	&lt;li&gt;Inštalácia bez vŕtania dier do strechy kabíny vozidla.&lt;/li&gt;	&lt;li&gt;Medzinárodná sieť technickej podpory.&lt;/li&gt;&lt;/ul&gt;&lt;h4&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;Zlepšuje pracovné prostredie vodiča a šetrí motor vozidla&lt;/span&gt;&lt;/h4&gt;&lt;p&gt;	Chladiaca jednotka pracuje pri vypnutom motore vozidla. Umožňuje Vám šoférovať a oddychovať v kabíne v príjemných tepelných podmienkach.&lt;/p&gt;&lt;ul&gt;	&lt;li&gt;Zvyšuje pracovný výkon&lt;/li&gt;	&lt;li&gt;Zlepšuje pracovný komfort&lt;/li&gt;&lt;/ul&gt;&lt;h4&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;Ekologická prevádzka&lt;/span&gt;&lt;/h4&gt;&lt;p&gt;	Zariadenie nemusí byť pripojené k vonkajšiemu zdroju energie. Spotrebuje minimálne množstvo vody.&lt;/p&gt;&lt;h4&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;Záruka 2 roky&lt;/span&gt;&lt;/h4&gt;&lt;p&gt;	Na všetky diely&lt;/p&gt;&lt;h4&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;Medzinárodná servisná sieť&lt;/span&gt;&lt;/h4&gt;&lt;!--&lt;ul&gt;&lt;li&gt;Plne elektrická jednotka&lt;/li&gt;&lt;li&gt;Znižuje náklady na pohonné hmoty&lt;/li&gt;&lt;li&gt;Šetrná ku prostrediu&lt;/li&gt;&lt;li&gt;Pohodlný oddych v kabíne znižuje riziko nehody&lt;/li&gt;&lt;li&gt;Inštálacia bez zásahu do motoru a konštrukcie vozidla&lt;/li&gt;&lt;li&gt;Operuje nezávisle od chodu motora&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;br&gt;Toto zariadenie je navrhnuté pre montáž na strechu kabíny nákladného vozidla. Jeho montáž je jednoduchá a rýchla, nevyžaduje žiadny zásah do kabíny vozidla. Pracuje v manuálnom alebo automatickom režime. Výhodou automatického režimu je, že sa vodič nemusí starať o reguláciu teploty, klimatizácia si toto reguluje automaticky.&lt;/p&gt;&lt;p&gt;Záruka 2 roky na všetky diely.&lt;/p&gt;--&gt;', '', 'R Evolution', '', '', '', '', '', '', '', ''),
(1444, 1, 'Flat 24V Standard', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '                                                                                                ', '', 'Flat 24V Standard', '', '', '', '', '', '', '', ''),
(1451, 2, 'Compact 12V 2,0kW', '&lt;p&gt;Model MiniCool COMPACT je klimatizačná jednotka určená pre použitie v noci. Pracuje s dvomi kompresormi, ďalej má dva nezávislé chladiace okruhy a funguje ako dve klimatizácie v jednej. MiniCool COMPACT ponúka nízku spotrebu, nevyžaduje údržbu a umožňuje reguláciu teploty pre pokojný spánok v noci s vypnutým motorom vozidla. Tým je zabezpečený pokojný a osviežujúci odpočinok.&lt;/p&gt;', '&lt;!-- TECH SPECS --&gt;&lt;li&gt;výkon 2,0 kW&lt;/li&gt;&lt;li&gt;napätie: 12V&lt;/li&gt;&lt;li&gt;2 režimy nastavenia:	&lt;ul&gt;		&lt;li&gt;manuálny – F0&lt;/li&gt;		&lt;li&gt;automatický – F4&lt;br&gt;			požiadavky napájania pre automatický režim:			&lt;ul&gt;					&lt;li&gt;12V: 22Ah min. – 62Ah. max.&lt;/li&gt;			&lt;/ul&gt;		&lt;/li&gt;	&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;maximálny prietok vzduchu: 800m3/h&lt;/li&gt;&lt;li&gt;časovač programu až do 9 hodím prevádzky&lt;/li&gt;&lt;li&gt;digitálny teplomer v °C alebo °F&lt;/li&gt;&lt;li&gt;diaľkové ovládanie&lt;/li&gt;&lt;li&gt;ochranná poistka systému&lt;/li&gt;&lt;li&gt;homologizácia a certifikáty č. e9&lt;/li&gt;&lt;li&gt;hlavné rozmery 726mm x 826mm x 203mm (d x š x v)&lt;/li&gt;&lt;li&gt;hmotnosť 40kg&lt;/li&gt;&lt;li&gt;dvojitá ochrana akumulátorov&lt;/li&gt;&lt;li&gt;o ochrana akumulátorov kompresorov&lt;/li&gt;&lt;li&gt;o elektronické ovládanie akumulátora&lt;/li&gt;&lt;li&gt;jednotka je predplnená chladiacim médiom&lt;/li&gt;&lt;li&gt;upevnenie na strešné okno bez akýchkoľvek zmien v konštrukcii kabíny&lt;/li&gt;&lt;li&gt;aerodynamický dizajn&lt;/li&gt;&lt;li&gt;UV ochranný kryt&lt;/li&gt;&lt;li&gt;jednoduchá výmena náhradných dielov&lt;/li&gt;&lt;li&gt;rýchla montáž&lt;/li&gt;', '                                                                        &lt;p&gt;Model MiniCool COMPACT je klimatizačná jednotka určená pre použitie v noci. Pracuje s dvomi kompresormi, ďalej má dva nezávislé chladiace okruhy a funguje ako dve klimatizácie v jednej. MiniCool COMPACT ponúka nízku spotrebu, nevyžaduje údržbu a umožňuje reguláciu teploty pre pokojný spánok v noci s vypnutým motorom vozidla. Tým je zabezpečený pokojný a osviežujúci odpočinok.&lt;/p&gt;&lt;p&gt;Toto zariadenie je navrhnuté pre montáž na strechu kabíny nákladného vozidla. Jeho montáž je jednoduchá a rýchla, nevyžaduje žiadny zásah do kabíny vozidla. Pracuje v manuálnom alebo automatickom režime. Výhodou automatického režimu je, že sa vodič nemusí starať o reguláciu teploty, klimatizácia si toto reguluje automaticky.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;ZÁRUKA 2 ROKY&lt;/h4&gt;&lt;p&gt;Na všetky diely.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;MEDZINÁRODNÁ SERVISNÁ SIEŤ&lt;/h4&gt;                                                                        ', '', 'Compact 12V 2,0kW', '', '', '', '', '', '', '', ''),
