(1460, 1, 'Split Twin 12V 2,0kW', '&lt;p&gt;Split is a range of electrical air conditioning units made up of different components. This design makes it easy to adapt to all types of cabins. Our Split Units are powered directly from the vehicle battery. The Split off-road units are equipped with a powerful moto-compressor which allows operations in extreme working conditions.&lt;/p&gt;', '&lt;h4 style=&quot;color: #0e417a&quot;&gt;TECHNICAL SPECIFICATIONS&lt;/h4&gt;&lt;ul&gt;	&lt;li&gt;power 2,0 kW&lt;/li&gt;	&lt;li&gt;voltage 12V/24V DC&lt;/li&gt;	&lt;li&gt;refrigerant R134a&lt;/li&gt;	&lt;li&gt;2 modes:		&lt;ul&gt;			&lt;li&gt;manual - F0&lt;/li&gt;			&lt;li&gt;auto - F4&lt;br&gt;		&lt;/li&gt;&lt;/ul&gt;	&lt;/li&gt;	&lt;li&gt;maximum air flow 670m3/h&lt;/li&gt;	&lt;li&gt;time scheduler&lt;/li&gt;	&lt;li&gt;digital thermometer (°C or °F)&lt;/li&gt;	&lt;li&gt;remote control&lt;/li&gt;	&lt;li&gt;protective system fuse		&lt;ul&gt;			&lt;li&gt;battery protection&lt;/li&gt;			&lt;li&gt;electronic battery control&lt;/li&gt;		&lt;/ul&gt;	&lt;/li&gt;	&lt;li&gt;easy to replace parts&lt;/li&gt;&lt;/ul&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;TECHNICAL SPECIFICATIONS - VAPORIZER&lt;/h4&gt;&lt;ul&gt;	&lt;li&gt;dimensions 410 x 270 x 125mm&lt;/li&gt;	&lt;li&gt;weight 5kg&lt;/li&gt;	&lt;li&gt;maximum air flow 670m3/h&lt;/li&gt;	&lt;li&gt;easy to install&lt;/li&gt;&lt;/ul&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;TECHNICAL SPECIFICATIONS - COMPRESSOR&lt;/h4&gt;&lt;ul&gt;	&lt;li&gt;dimensions 430 x 370 x 260mm&lt;/li&gt;	&lt;li&gt;weight 22kg&lt;/li&gt;&lt;/ul&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;TECHNICAL SPECIFICATIONS - CAPACITOR&lt;/h4&gt;&lt;ul&gt;	&lt;li&gt;dimensions 620 x 500 x 130mm&lt;/li&gt;	&lt;li&gt;weight 6,5kg&lt;/li&gt;&lt;/ul&gt;', '                        Split is a range of electrical air conditioning units made up of different components. This design makes it easy to adapt to all types of cabins. Our Split Units are powered directly from the vehicle battery. The Split off-road units are equipped with a powerful moto-compressor which allows operations in extreme working conditions.                                                                        ', '', 'Split Twin 12V 2,0kW', '', '', '', '', '', '', '', ''),
(1461, 1, 'Split Twin 24V 3,0kW', '&lt;p&gt;Split is a range of electrical air conditioning units made up of different components. This design makes it easy to adapt to all types of cabins. Our Split Units are powered directly from the vehicle battery. The Split off-road units are equipped with a powerful moto-compressor which allows operations in extreme working conditions.&lt;/p&gt;', '&lt;h4 style=&quot;color: #0e417a&quot;&gt;TECHNICAL SPECIFICATIONS&lt;/h4&gt;&lt;ul&gt;	&lt;li&gt;power 2,0 kW&lt;/li&gt;	&lt;li&gt;voltage 12V/24V DC&lt;/li&gt;	&lt;li&gt;refrigerant R134a&lt;/li&gt;	&lt;li&gt;2 modes:		&lt;ul&gt;			&lt;li&gt;manual - F0&lt;/li&gt;			&lt;li&gt;auto - F4&lt;br&gt;		&lt;/li&gt;&lt;/ul&gt;	&lt;/li&gt;	&lt;li&gt;maximum air flow 670m3/h&lt;/li&gt;	&lt;li&gt;time scheduler&lt;/li&gt;	&lt;li&gt;digital thermometer (°C or °F)&lt;/li&gt;	&lt;li&gt;remote control&lt;/li&gt;	&lt;li&gt;protective system fuse		&lt;ul&gt;			&lt;li&gt;battery protection&lt;/li&gt;			&lt;li&gt;electronic battery control&lt;/li&gt;		&lt;/ul&gt;	&lt;/li&gt;	&lt;li&gt;easy to replace parts&lt;/li&gt;&lt;/ul&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;TECHNICAL SPECIFICATIONS - VAPORIZER&lt;/h4&gt;&lt;ul&gt;	&lt;li&gt;dimensions 410 x 270 x 125mm&lt;/li&gt;	&lt;li&gt;weight 5kg&lt;/li&gt;	&lt;li&gt;maximum air flow 670m3/h&lt;/li&gt;	&lt;li&gt;easy to install&lt;/li&gt;&lt;/ul&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;TECHNICAL SPECIFICATIONS - COMPRESSOR&lt;/h4&gt;&lt;ul&gt;	&lt;li&gt;dimensions 430 x 370 x 260mm&lt;/li&gt;	&lt;li&gt;weight 22kg&lt;/li&gt;&lt;/ul&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;TECHNICAL SPECIFICATIONS - CAPACITOR&lt;/h4&gt;&lt;ul&gt;	&lt;li&gt;dimensions 620 x 500 x 130mm&lt;/li&gt;	&lt;li&gt;weight 6,5kg&lt;/li&gt;&lt;/ul&gt;', '                        Split is a range of electrical air conditioning units made up of different components. This design makes it easy to adapt to all types of cabins. Our Split Units are powered directly from the vehicle battery. The Split off-road units are equipped with a powerful moto-compressor which allows operations in extreme working conditions.                                                                        ', '', 'Split Twin 24V 3,0kW', '', '', '', '', '', '', '', ''),
(1462, 1, 'Sun 24V 1000W 250m3/h 4 speeds with a display', '&lt;p&gt;The compact electrical heating unit SUN is designed to heat the cabin of the vehicles as efficiently as possible. Independent from the engine and connected directly to the battery, maintains the cabin at favorable temperature conditions and prevents emissions of CO2 into the atmosphere.&lt;/p&gt;', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '                                                The compact electrical heating unit SUN is designed to heat the cabin of the vehicles as efficiently as possible. Independent from the engine and connected directly to the battery, maintains the cabin at favorable temperature conditions and prevents emissions of CO2 into the atmosphere.                                                                                                ', '', 'Sun 24V 1000W 250m3/h 4 speeds with a display', '', '', '', '', '', '', '', ''),
(1463, 1, 'Sun 12V 500W 100m3/h 4 speeds with a display', '&lt;p&gt;The compact electrical heating unit SUN is designed to heat the cabin of the vehicles as efficiently as possible. Independent from the engine and connected directly to the battery, maintains the cabin at favorable temperature conditions and prevents emissions of CO2 into the atmosphere.&lt;/p&gt;', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '                        The compact electrical heating unit SUN is designed to heat the cabin of the vehicles as efficiently as possible. Independent from the engine and connected directly to the battery, maintains the cabin at favorable temperature conditions and prevents emissions of CO2 into the atmosphere.                                                                        ', '', 'Sun 12V 500W 100m3/h 4 speeds with a display', '', '', '', '', '', '', '', ''),
(1464, 2, 'Sun 12V 500W 100m3/h 3 rýchlosti', '&lt;p&gt;Sun je kompaktná elektrická vykurovacia jednotka a elektronikou s diaľkovým ovládaním, určená na vykurovanie kabíny vozidla najefektívnejšie, ako je to možné. Výhrevné teleso je napojené na elektrickú sieť autiomobilu, nezávislé na bežiacom motore je pripojené priamo k akumulátoru. Je šetrné k životnému prostrediu a neprodukuje emisie CO2. Určená je pre nákladné automobily.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;ZÁRUKA 2 ROKY&lt;/h4&gt;&lt;p&gt;Na všetky diely.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;MEDZINÁRODNÁ SERVISNÁ SIEŤ&lt;/h4&gt;', '&lt;ul&gt;	&lt;li&gt;napätie 12V&lt;/li&gt;	&lt;li&gt;spotreba el. energie 22~33A (25~39A)&lt;/li&gt;	&lt;li&gt;maximálny prietok vzduchu 100m3/h&lt;/li&gt;	&lt;li&gt;hmotnosť 2,76kg (2,76kg)&lt;/li&gt;	&lt;li&gt;hlavné rozmery 300 x 240 x 139mm&lt;/li&gt;	&lt;li&gt;manuálny alebo automatický režim&lt;/li&gt;	&lt;li&gt;prepínač automatický/manuálny režim&lt;/li&gt;	&lt;li&gt;digitálny teplomer v °C alebo °F&lt;/li&gt;	&lt;li&gt;diaľkové ovládanie&lt;/li&gt;	&lt;li&gt;ochrana akumulátora&lt;/li&gt;	&lt;li&gt;ukazovateľ stavu akumulátora&lt;/li&gt;&lt;/ul&gt;', '                                                &lt;p&gt;Sun je kompaktná elektrická vykurovacia jednotka a elektronikou s diaľkovým ovládaním, určená na vykurovanie kabíny vozidla najefektívnejšie, ako je to možné. Výhrevné teleso je napojené na elektrickú sieť autiomobilu, nezávislé na bežiacom motore je pripojené priamo k akumulátoru. Je šetrné k životnému prostrediu a neprodukuje emisie CO2. Určená je pre nákladné automobily.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;ZÁRUKA 2 ROKY&lt;/h4&gt;&lt;p&gt;Na všetky diely.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;MEDZINÁRODNÁ SERVISNÁ SIEŤ&lt;/h4&gt;                                                                                                ', '', 'Sun 12V 500W 100m3/h 3 rýchlosti', '', '', '', '', '', '', '', ''),
