(1440, 3, 'R-Evolution 12V', '&lt;p&gt;Die elektronische Standkühlanlage Bycool R-EVOLUTION senkt die Lufttemperatur in der Fahrerkabine immer dann, wenn es notwendig ist. Die Kühlananlage arbeitet ohne Fahrzeugmotor, kann aber auch während der Fahrt benuzt werden.Anwendungsbereich: Be- und Entladen des Fahrzeuges, Ruhe- und Schlafpausen.&lt;br&gt;Dank der niedrigen Aufbauhöhe ist diese Anlage auf jeder Fahrerkabine einzubauen.&lt;/p&gt;', '&lt;!-- TECH SPECS --&gt;\r\n&lt;li&gt;Ausführungen: 12 und 24 Volt&lt;/li&gt;\r\n&lt;li&gt;Steuerung aller Funktionen über die Fernbedienung durch Radiofrequenz (RF) oder über das elektronische Tastenfeld&lt;/li&gt;\r\n&lt;li&gt;der Sensor muss nicht angetastet werden, somit werden Ablenkungen während der Fahrt vermieden&lt;/li&gt;\r\n&lt;li&gt;aerodynamisches Design&lt;/li&gt;\r\n&lt;li&gt;zwei Wasserbehälter, ein externer 35 Liter - Tank zur Wasserversorgung und ein zweiter auslaufgeschützt im Gerät&lt;/li&gt;\r\n&lt;li&gt;Motor:\r\n	&lt;ul&gt;\r\n		&lt;li&gt;doppelter Axiallüfter&lt;/li&gt;\r\n		&lt;li&gt;geringer Stromverbrauch bei 24V (von 0,4A bis 4A)&lt;/li&gt;\r\n		&lt;li&gt;Luftdurchsatz: 900 m3/Std.&lt;/li&gt;\r\n	&lt;/ul&gt;\r\n&lt;/li&gt;\r\n&lt;li&gt;auch in ADR-Ausführung erhältlich (für den Transport gefährlicher Güter)&lt;/li&gt;\r\n&lt;li&gt;Abmessungen (B x L x H): 787 x 860 x 155 mm&lt;/li&gt;\r\n&lt;li&gt;geräuscharme Wasserpumpe &lt;/li&gt;\r\n&lt;li&gt;Unterspannungsschutz&lt;/li&gt;\r\n&lt;li&gt;geringer Wasserverbrauch&lt;/li&gt;\r\n&lt;li&gt;minimaler Wartungsaufwand&lt;/li&gt;\r\n&lt;li&gt;Mikroprozessor zur elektronischen Gerätesteuerung mit:\r\n	&lt;ul&gt;\r\n		&lt;li&gt;Gebläsedrehzahl 8-stufig regulierbar&lt;/li&gt;\r\n		&lt;li&gt;programmierbare Zeitsteuerung&lt;/li&gt;\r\n		&lt;li&gt;Wasserstandkontrolle&lt;/li&gt;\r\n		&lt;li&gt;optische Anzeige der Wasserpumpenfunktion&lt;/li&gt;\r\n	&lt;/ul&gt;\r\n&lt;/li&gt;\r\n&lt;li&gt;externes Gehäuse in ABS mit UV-Schutz&lt;/li&gt;', '                                                                        &lt;h4 style=&quot;color: #0e417a&quot;&gt;ELEKTRONISCHE STANDKÜHLANLAGE FÜR NUTZFAHRZEUGE&lt;br&gt;MAXIMALE KÄLTELEISTUNG - MINIMALER STROMVERBRAUCH - NIEDRIGE AUFBAUHÖHE&lt;/h4&gt;\r\n&lt;p&gt;Die elektronische Standkühlanlage Bycool R-EVOLUTION senkt die Lufttemperatur in der Fahrerkabine immer dann, wenn es notwendig ist. Die Kühlananlage arbeitet ohne Fahrzeugmotor, kann aber auch während der Fahrt benuzt werden.Anwendungsbereich: Be- und Entladen des Fahrzeuges, Ruhe- und Schlafpausen.&lt;br&gt;Dank der niedrigen Aufbauhöhe ist diese Anlage auf jeder Fahrerkabine einzubauen.&lt;/p&gt;\r\n&lt;h4 style=&quot;color: #0e417a&quot;&gt;SOFORTIGE KRAFTSTOFFEINSPARUNG&lt;/h4&gt;\r\n&lt;p&gt;Dieses Standkühlgerät nimmt Energie von der Fahrzeugbatterie ab.&lt;/p&gt;\r\n&lt;h4 style=&quot;color: #0e417a&quot;&gt;ELEKTRONISCHES STANDKÜHLGERÄT MIT HOHEM LEISTUNGSVERMÖGEN&lt;/h4&gt;\r\n&lt;ul&gt;\r\n	&lt;li&gt;Innenraumblende mit verschließbaren Ausströmern und Bedienelement ist von höchster Qualität.&lt;/li&gt;\r\n	&lt;li&gt;Montage ohne das Bohren ins Dach der Fahrerkabine.&lt;/li&gt;\r\n	&lt;li&gt;Internationale technische Unterstützung.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n	&lt;h4 style=&quot;color: #0e417a&quot;&gt;ERMÖGLICHT EIN BESSERES ARBEITSKLIMA &lt;br&gt;SCHÜTZT DEN FAHRZEUGMOTOR&lt;/h4&gt;\r\n&lt;p&gt;Die Kühlanlage arbeitet bei abgestelltem Fahrzeugmotor. Sie ermöglicht das Fahren und Rasten in einer angenehm gekühlter Fahrerkabine.&lt;/p&gt;\r\n	&lt;ul&gt;\r\n	&lt;li&gt;Erhöht die Arbeitsleistung.&lt;/li&gt;\r\n	&lt;li&gt;Verbessert den Arbeitskomfort.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;h4 style=&quot;color: #0e417a&quot;&gt;UMWELTFREUNDLICH&lt;/h4&gt;\r\n&lt;p&gt;Die Anlage braucht keinen Netzanschluß. Verbraucht nur Wasser.&lt;/p&gt;\r\n	&lt;h4 style=&quot;color: #0e417a&quot;&gt;2 JAHRE GEWÄHRLEISTUNG&lt;/h4&gt;\r\n&lt;p&gt;Auf alle Bauteile.&lt;/p&gt;\r\n&lt;h4 style=&quot;color: #0e417a&quot;&gt;INTERNATIONALES SERVICENETZ&lt;/h4&gt;                                                                        ', '', 'R-Evolution 12V', '', '', '', '', '', '', '', ''),
(1453, 2, 'Compact 24V 1,4kW', '&lt;p&gt;Model green line COMPACT 1.4 je ekologická klimatizačná jednotka určená pre použitie v noci (so zapnutým alebo vypnutým motorom). Pracuje s dvomi kompresormi a má dva nezávislé chladice okruhy a v podstate pracuje ako dve klimatizácie v jednej. COMPACT green line ponúka nízku spotrebu, nevyžaduje údržbu a umožňuje reguláciu teploty pre pokojný spánok v noci s vypnutým motorom automobilu. Určená je pre nákladné automobily a elektrické vozidlá.&lt;/p&gt;&lt;p&gt;Toto zariadenie je navrhnuté pre montáž na strechu kabíny nákladného vozidla. Jeho montáž je jednoduchá a rýchla, nevyžaduje žiadny zásah do konštrukcie kabíny automobilu. Pracuje v manuálnom alebo automatickom režime. Výhodou automatického režimu je, že sa vodič nemusí starať o reguláciu teploty, klimatizácia si ju stráži automaticky.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;ZÁRUKA 2 ROKY&lt;/h4&gt;&lt;p&gt;Na všetky diely.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;MEDZINÁRODNÁ SERVISNÁ SIEŤ&lt;/h4&gt;', '&lt;li&gt;výkon 1,4 kW&lt;/li&gt;\r\n&lt;li&gt;napätie: 12V alebo 24V&lt;/li&gt;\r\n&lt;li&gt;2 režimy nastavenia:\r\n	&lt;ul&gt;\r\n		&lt;li&gt;manuálny – F0&lt;/li&gt;\r\n		&lt;li&gt;automatický – F4&lt;br&gt;\r\n	  požiadavky napájania pre automatický režim:\r\n	  	&lt;ul&gt;\r\n		    &lt;li&gt;24V: 12,2Ah min. – 17Ah. max.&lt;/li&gt;\r\n		    &lt;li&gt;12V: 18,0Ah min. – 28Ah. max.&lt;/li&gt;\r\n	    &lt;/ul&gt;\r\n    &lt;/li&gt;\r\n  &lt;/ul&gt;\r\n&lt;/li&gt;\r\n&lt;li&gt;maximálny prietok vzduchu: 800m3/h&lt;/li&gt;\r\n&lt;li&gt;časovač programu až do 9 hodím prevádzky&lt;/li&gt;\r\n&lt;li&gt;digitálny teplomer v °C alebo °F&lt;/li&gt;\r\n&lt;li&gt;diaľkové ovládanie&lt;/li&gt;\r\n&lt;li&gt;ochranná poistka systému&lt;/li&gt;\r\n&lt;li&gt;homologizácia a certifikáty č. e9&lt;/li&gt;\r\n&lt;li&gt;hlavné rozmery 726mm x 826mm x 176mm (d x š x v)&lt;/li&gt;\r\n&lt;li&gt;hmotnosť 28kg&lt;/li&gt;\r\n&lt;li&gt;dvojitá ochrana akumulátora:\r\n	&lt;ul&gt;\r\n		&lt;li&gt;ochrana akumulátora kompresorov&lt;/li&gt;\r\n		&lt;li&gt;elektronické ovládanie akumulátora&lt;/li&gt;\r\n	&lt;/ul&gt;\r\n&lt;/li&gt;\r\n&lt;li&gt;jednotka je predplnená chladiacim médiom&lt;/li&gt;\r\n&lt;li&gt;upevnenie na strešné okno bez akýchkoľvek zmien v konštrukcii kabíny&lt;/li&gt;\r\n&lt;li&gt;aerodynamický dizajn&lt;/li&gt;\r\n&lt;li&gt;UV ochranný kryt&lt;/li&gt;\r\n&lt;li&gt;jednoduchá výmena náhradných dielov&lt;/li&gt;\r\n&lt;li&gt;rýchla montáž&lt;/li&gt;', '                                                                        &lt;p&gt;Model green line COMPACT 1.4 je ekologická klimatizačná jednotka určená pre použitie v noci (so zapnutým alebo vypnutým motorom). Pracuje s dvomi kompresormi a má dva nezávislé chladice okruhy a v podstate pracuje ako dve klimatizácie v jednej. COMPACT green line ponúka nízku spotrebu, nevyžaduje údržbu a umožňuje reguláciu teploty pre pokojný spánok v noci s vypnutým motorom automobilu. Určená je pre nákladné automobily a elektrické vozidlá.&lt;/p&gt;&lt;p&gt;Toto zariadenie je navrhnuté pre montáž na strechu kabíny nákladného vozidla. Jeho montáž je jednoduchá a rýchla, nevyžaduje žiadny zásah do konštrukcie kabíny automobilu. Pracuje v manuálnom alebo automatickom režime. Výhodou automatického režimu je, že sa vodič nemusí starať o reguláciu teploty, klimatizácia si ju stráži automaticky.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;ZÁRUKA 2 ROKY&lt;/h4&gt;&lt;p&gt;Na všetky diely.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;MEDZINÁRODNÁ SERVISNÁ SIEŤ&lt;/h4&gt;                                                                        ', '', 'Compact 24V 1,4kW', '', '', '', '', '', '', '', ''),
(1440, 2, 'R-Evolution 12V', 'Elektronická chladiaca jednotka kabíny Bycool R-EVOLUTION dopĺňa funkcionalitu Vášho vozidla znižovaním teploty v kabíne keď je to potrebné. Chladiaca jednotka pracuje bez ohľadu na to, či beží motor vozidla alebo nie, a preto je určená na použitie najmä pri nakladaní a vykladaní vozidla, a na prestávky, na oddych. Vďaka nízkej konštrukčnej výške nie je nutné robiť zásahy do spojleru vozidla.', '&lt;li&gt;prevedenia 12 aj 24 Volt&lt;/li&gt;\r\n&lt;li&gt;ovládanie všetkých funkcií diaľkovým ovládačom alebo priamo na ovládacom paneli zariadenia&lt;/li&gt;\r\n&lt;li&gt;nie je potrebné nasmerovať diaľkový ovládač na senzor, tým sa vodič vyhne zbytočnému rozptyľovaniu sa počas jazdy&lt;/li&gt;\r\n&lt;li&gt;aerodynamický tvar&lt;/li&gt;\r\n&lt;li&gt;dve nádrže na vodu, jedna vonkajšia nádrž s kapacitou 35 litrov a druhá zabudovaná do zariadenia s ochranou proti pretečeniu, resp. preplneniu&lt;/li&gt;\r\n&lt;li&gt;motor:\r\n	&lt;ul&gt;\r\n		&lt;li&gt;dvojitý axiálny ventilátor&lt;/li&gt;\r\n		&lt;li&gt;nízky odber prúdu pri 24V (od 0,4A do 4A)&lt;/li&gt;\r\n		&lt;li&gt;cirkulácia vzduchu: 900 m3/hod.&lt;/li&gt;\r\n	&lt;/ul&gt;\r\n&lt;/li&gt;\r\n&lt;li&gt;dodáva sa aj prevedenie ADR pre prepravu nebezpečného nákladu&lt;/li&gt;\r\n&lt;li&gt;rozmery (Š x D x V): 787 x 860 x 155 mm&lt;/li&gt;\r\n&lt;li&gt;nehlučné vodné čerpadlo&lt;/li&gt;\r\n&lt;li&gt;elektrická ochrana&lt;/li&gt;\r\n&lt;li&gt;nízka spotreba vody&lt;/li&gt;\r\n&lt;li&gt;minimálne nároky na údržbu&lt;/li&gt;\r\n&lt;li&gt;elektronický riadiaci microprocessor\r\n	&lt;ul&gt;\r\n		&lt;li&gt;s ovládaním rýchlosti ventilátora (8 rýchlostí)&lt;/li&gt;\r\n		&lt;li&gt;s programovaním času používania&lt;/li&gt;\r\n		&lt;li&gt;s kontrolou výšky hladiny vody&lt;/li&gt;\r\n		&lt;li&gt;s indikáciou činnosti vodného čerpadla&lt;/li&gt;\r\n	&lt;/ul&gt;\r\n&lt;/li&gt;\r\n&lt;li&gt;vonkajší kryt z termoplastu s UVA ochranou (odolný voči mechanickému poškodeniu)&lt;/li&gt;', '                                                                                                                                                                        &lt;h4&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;ELEKTRONICKÁ CHLADIACA JEDNOTKA KABÍNY&lt;br&gt;MAXIMÁLNY VÝKON - MINIMÁLNA SPOTREBA - NIŽŠIA KONŠTRUKČNÁ VÝŠKA&lt;/span&gt;&lt;/h4&gt;\r\nElektronická chladiaca jednotka kabíny Bycool R-EVOLUTION dopĺňa funkcionalitu Vášho vozidla znižovaním teploty v kabíne keď je to potrebné. Chladiaca jednotka pracuje bez ohľadu na to, či beží motor vozidla alebo nie, a preto je určená na použitie najmä pri nakladaní a vykladaní vozidla, a na prestávky, na oddych. &lt;br&gt;Vďaka nízkej konštrukčnej výške nie je nutné robiť zásahy do spojleru vozidla. &lt;h4&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;OKAMŽITÁ ÚSPORA PALIVA&lt;/span&gt;&lt;/h4&gt;\r\nNezávislé chladiace zariadenia odoberá iba energiu z batérií vozidla. &lt;h4&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;VYSOKOVÝKONNÁ VÝPARNÍKOVÁ CHLADIACA JEDNOTKA&lt;/span&gt;&lt;/h4&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Vnútorný riadiaci a distribučný panel vysokej kvality.&lt;/li&gt;\r\n&lt;li&gt;Inštalácia bez vŕtania dier do strechy kabíny vozidla.&lt;/li&gt;\r\n&lt;li&gt;Medzinárodná sieť technickej podpory.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n &lt;h4&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;ZLEPŠUJE PRACOVNÉ PROSTREDIE VODIČA&lt;br&gt;ŠETRÍ MOTOR VOZIDLA&lt;/span&gt;&lt;/h4&gt;\r\nChladiaca jednotka pracuje pri vypnutom motore vozidla. Umožňuje Vám šoférovať a oddychovať v kabíne v príjemných tepelných podmienkach.&lt;ul&gt;\r\n&lt;li&gt;Zvyšuje pracovný výkon.&lt;/li&gt;\r\n&lt;li&gt;Zlepšuje pracovný komfort.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n &lt;h4&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;EKOLOGICKÁ PREVÁDZKA&lt;/span&gt;&lt;/h4&gt;\r\nZariadenie nemusí byť pripojené k vonkajšiemu zdroju energie. Spotrebuje minimálne množstvo vody. &lt;h4&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;ZÁRUKA 2 ROKY&lt;/span&gt;&lt;/h4&gt;\r\nNa všetky diely. &lt;h4&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;MEDZINÁRODNÁ SERVISNÁ SIEŤ&lt;/span&gt;&lt;/h4&gt;                                                                                                                                                                        ', '', 'R-Evolution 12V', '', '', '', '', '', '', '', ''),
(1437, 2, 'R-Evolution 12V ADR', '&lt;p&gt;Elektronická chladiaca jednotka kabíny Bycool R-EVOLUTION dopĺňa funkcionalitu Vášho vozidla znižovaním teploty v kabíne keď je to potrebné. Chladiaca jednotka pracuje bez ohľadu na to, či beží motor vozidla alebo nie, a preto je určená na použitie najmä pri nakladaní a vykladaní vozidla, a na prestávky, na oddych. Vďaka nízkej konštrukčnej výške nie je nutné robiť zásahy do spojleru vozidla.&lt;br&gt;&lt;/p&gt;', '&lt;li&gt;prevedenia 12 aj 24 Volt&lt;/li&gt;&lt;li&gt;ovládanie všetkých funkcií diaľkovým ovládačom alebo priamo na ovládacom paneli zariadenia&lt;/li&gt;&lt;li&gt;nie je potrebné nasmerovať diaľkový ovládač na senzor, tým sa vodič vyhne zbytočnému rozptyľovaniu sa počas jazdy&lt;/li&gt;&lt;li&gt;aerodynamický tvar&lt;/li&gt;&lt;li&gt;dve nádrže na vodu, jedna vonkajšia nádrž s kapacitou 35 litrov a druhá zabudovaná do zariadenia s ochranou proti pretečeniu, resp. preplneniu&lt;/li&gt;&lt;li&gt;motor:&lt;ul&gt;&lt;li&gt;dvojitý axiálny ventilátor&lt;/li&gt;&lt;li&gt;nízky odber prúdu pri 24V (od 0,4A do 4A)&lt;/li&gt;&lt;li&gt;cirkulácia vzduchu: 900 m3/hod.&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;dodáva sa aj prevedenie ADR pre prepravu nebezpečného nákladu&lt;/li&gt;&lt;li&gt;rozmery (Š x D x V): 787 x 860 x 155 mm&lt;/li&gt;&lt;li&gt;nehlučné vodné čerpadlo&lt;/li&gt;&lt;li&gt;elektrická ochrana&lt;/li&gt;&lt;li&gt;nízka spotreba vody&lt;/li&gt;&lt;li&gt;minimálne nároky na údržbu&lt;/li&gt;&lt;li&gt;elektronický riadiaci microprocessor&lt;ul&gt;&lt;li&gt;s ovládaním rýchlosti ventilátora (8 rýchlostí)&lt;/li&gt;&lt;li&gt;s programovaním času používania&lt;/li&gt;&lt;li&gt;s kontrolou výšky hladiny vody&lt;/li&gt;&lt;li&gt;s indikáciou činnosti vodného čerpadla&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;vonkajší kryt z termoplastu s UVA ochranou (odolný voči mechanickému poškodeniu)&lt;/li&gt;', '                                                &lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;ELEKTRONICKÁ CHLADIACA JEDNOTKA KABÍNY&lt;br&gt;MAXIMÁLNY VÝKON - MINIMÁLNA SPOTREBA - NIŽŠIA KONŠTRUKČNÁ VÝŠKA&lt;/span&gt;&lt;/h4&gt;Elektronická chladiaca jednotka kabíny Bycool R-EVOLUTION dopĺňa funkcionalitu Vášho vozidla znižovaním teploty v kabíne keď je to potrebné. Chladiaca jednotka pracuje bez ohľadu na to, či beží motor vozidla alebo nie, a preto je určená na použitie najmä pri nakladaní a vykladaní vozidla, a na prestávky, na oddych.&amp;nbsp;&lt;br&gt;Vďaka nízkej konštrukčnej výške nie je nutné robiť zásahy do spojleru vozidla.&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;OKAMŽITÁ ÚSPORA PALIVA&lt;/span&gt;&lt;/h4&gt;Nezávislé chladiace zariadenia odoberá iba energiu z batérií vozidla.&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;VYSOKOVÝKONNÁ VÝPARNÍKOVÁ CHLADIACA JEDNOTKA&lt;/span&gt;&lt;/h4&gt;&lt;ul&gt;&lt;li&gt;Vnútorný riadiaci a distribučný panel vysokej kvality.&lt;/li&gt;&lt;li&gt;Inštalácia bez vŕtania dier do strechy kabíny vozidla.&lt;/li&gt;&lt;li&gt;Medzinárodná sieť technickej podpory.&lt;/li&gt;&lt;/ul&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;ZLEPŠUJE PRACOVNÉ PROSTREDIE VODIČA&lt;br&gt;ŠETRÍ MOTOR VOZIDLA&lt;/span&gt;&lt;/h4&gt;Chladiaca jednotka pracuje pri vypnutom motore vozidla. Umožňuje Vám šoférovať a oddychovať v kabíne v príjemných tepelných podmienkach.&lt;ul&gt;&lt;li&gt;Zvyšuje pracovný výkon.&lt;/li&gt;&lt;li&gt;Zlepšuje pracovný komfort.&lt;/li&gt;&lt;/ul&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;EKOLOGICKÁ PREVÁDZKA&lt;/span&gt;&lt;/h4&gt;Zariadenie nemusí byť pripojené k vonkajšiemu zdroju energie. Spotrebuje minimálne množstvo vody.&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;ZÁRUKA 2 ROKY&lt;/span&gt;&lt;/h4&gt;Na všetky diely.&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;MEDZINÁRODNÁ SERVISNÁ SIEŤ&lt;/span&gt;&lt;/h4&gt;                                                                                                ', '', 'R-Evolution 12V ADR', '', '', '', '', '', '', '', ''),
(1437, 1, 'R-Evolution 12V ADR', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '                                                                                                                                                ', '', 'R-Evolution 12V ADR', '', '', '', '', '', '', '', ''),
(1437, 3, 'R-Evolution 12V ADR', '&lt;p&gt;Die elektronische Standkühlanlage Bycool R-EVOLUTION senkt die Lufttemperatur in der Fahrerkabine immer dann, wenn es notwendig ist. Die Kühlananlage arbeitet ohne Fahrzeugmotor, kann aber auch während der Fahrt benuzt werden.Anwendungsbereich: Be- und Entladen des Fahrzeuges, Ruhe- und Schlafpausen.&lt;br&gt;Dank der niedrigen Aufbauhöhe ist diese Anlage auf jeder Fahrerkabine einzubauen.&lt;br&gt;&lt;/p&gt;', '&lt;li&gt;Ausführungen: 12 und 24 Volt&lt;/li&gt;&lt;li&gt;Steuerung aller Funktionen über die Fernbedienung durch Radiofrequenz (RF) oder über das elektronische Tastenfeld&lt;/li&gt;&lt;li&gt;der Sensor muss nicht angetastet werden, somit werden Ablenkungen während der Fahrt vermieden&lt;/li&gt;&lt;li&gt;aerodynamisches Design&lt;/li&gt;&lt;li&gt;zwei Wasserbehälter, ein externer 35 Liter - Tank zur Wasserversorgung und ein zweiter auslaufgeschützt im Gerät&lt;/li&gt;&lt;li&gt;Motor:&lt;ul&gt;&lt;li&gt;doppelter Axiallüfter&lt;/li&gt;&lt;li&gt;geringer Stromverbrauch bei 24V (von 0,4A bis 4A)&lt;/li&gt;&lt;li&gt;Luftdurchsatz: 900 m3/Std.&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;auch in ADR-Ausführung erhältlich (für den Transport gefährlicher Güter)&lt;/li&gt;&lt;li&gt;Abmessungen (B x L x H): 787 x 860 x 155 mm&lt;/li&gt;&lt;li&gt;geräuscharme Wasserpumpe&lt;/li&gt;&lt;li&gt;Unterspannungsschutz&lt;/li&gt;&lt;li&gt;geringer Wasserverbrauch&lt;/li&gt;&lt;li&gt;minimaler Wartungsaufwand&lt;/li&gt;&lt;li&gt;Mikroprozessor zur elektronischen Gerätesteuerung mit:&lt;ul&gt;&lt;li&gt;Gebläsedrehzahl 8-stufig regulierbar&lt;/li&gt;&lt;li&gt;programmierbare Zeitsteuerung&lt;/li&gt;&lt;li&gt;Wasserstandkontrolle&lt;/li&gt;&lt;li&gt;optische Anzeige der Wasserpumpenfunktion&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;externes Gehäuse in ABS mit UV-Schutz&lt;/li&gt;', '                                                &lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;ELEKTRONISCHE STANDKÜHLANLAGE FÜR NUTZFAHRZEUGE&lt;br&gt;MAXIMALE KÄLTELEISTUNG - MINIMALER STROMVERBRAUCH - NIEDRIGE AUFBAUHÖHE&lt;/h4&gt;&lt;p&gt;Die elektronische Standkühlanlage Bycool R-EVOLUTION senkt die Lufttemperatur in der Fahrerkabine immer dann, wenn es notwendig ist. Die Kühlananlage arbeitet ohne Fahrzeugmotor, kann aber auch während der Fahrt benuzt werden.Anwendungsbereich: Be- und Entladen des Fahrzeuges, Ruhe- und Schlafpausen.&lt;br&gt;Dank der niedrigen Aufbauhöhe ist diese Anlage auf jeder Fahrerkabine einzubauen.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;SOFORTIGE KRAFTSTOFFEINSPARUNG&lt;/h4&gt;&lt;p&gt;Dieses Standkühlgerät nimmt Energie von der Fahrzeugbatterie ab.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;ELEKTRONISCHES STANDKÜHLGERÄT MIT HOHEM LEISTUNGSVERMÖGEN&lt;/h4&gt;&lt;ul&gt;&lt;li&gt;Innenraumblende mit verschließbaren Ausströmern und Bedienelement ist von höchster Qualität.&lt;/li&gt;&lt;li&gt;Montage ohne das Bohren ins Dach der Fahrerkabine.&lt;/li&gt;&lt;li&gt;Internationale technische Unterstützung.&lt;/li&gt;&lt;/ul&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;ERMÖGLICHT EIN BESSERES ARBEITSKLIMA&amp;nbsp;&lt;br&gt;SCHÜTZT DEN FAHRZEUGMOTOR&lt;/h4&gt;&lt;p&gt;Die Kühlanlage arbeitet bei abgestelltem Fahrzeugmotor. Sie ermöglicht das Fahren und Rasten in einer angenehm gekühlter Fahrerkabine.&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Erhöht die Arbeitsleistung.&lt;/li&gt;&lt;li&gt;Verbessert den Arbeitskomfort.&lt;/li&gt;&lt;/ul&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;UMWELTFREUNDLICH&lt;/h4&gt;&lt;p&gt;Die Anlage braucht keinen Netzanschluß. Verbraucht nur Wasser.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;2 JAHRE GEWÄHRLEISTUNG&lt;/h4&gt;&lt;p&gt;Auf alle Bauteile.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;INTERNATIONALES SERVICENETZ&lt;/h4&gt;                                                                                                ', '', 'R-Evolution 12V ADR', '', '', '', '', '', '', '', ''),
(1437, 4, 'R-Evolution 12V ADR', '&lt;p&gt;A fülkére szerelhető Bycool R-EVOLUTION elektronikus hűtőegység kiegészíti az Ön járművének funkcionalitását a hőmérséklet csökkentésével a fülkében, ha ez szükséges. Tekintet nélkül arra, hogy jár-e a gépjármű motorja vagy sem, a hűtőegység dolgozik, és ezért főleg a kocsi ki és berakodása alkalmával lehet hasznos, vagy a szünetekben és a pihenőidőben.&lt;br&gt;Alacsony szerkezeti magasságának köszönhetően nem szükséges módosításokat végezni a gépjármű légterelőjén.&lt;br&gt;&lt;/p&gt;', '&lt;li&gt;12 és 24 Voltos kivitelben is&lt;/li&gt;&lt;li&gt;az összes funkció távirányítóval vezérelhető vagy egyenesen a berendezés vezérlőpaneljéről&lt;/li&gt;&lt;li&gt;a távirányítót nem kell a szenzorra irányítani, ezzel a sofőr elkerüli a vezetés közbeni felesleges figyelemmegosztást&lt;/li&gt;&lt;li&gt;aerodinamikus forma&lt;/li&gt;&lt;li&gt;két víztartály, egy külső tartály 35 liter kapacitással és egy beépítve a berendezésbe, túlcsordulás, illetve túltelítődés elleni védelemmel&lt;/li&gt;&lt;li&gt;motor:&lt;ul&gt;&lt;li&gt;kettős axiális ventilátor&lt;/li&gt;&lt;li&gt;24 V mellett alacsony elektromos fogyasztás (0,4 A-tól 4 A-ig)&lt;/li&gt;&lt;li&gt;légcirkuláció: 900 m3/óra&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;kapható ADR kivitelben is, veszélyes anyagok szállításához&lt;/li&gt;&lt;li&gt;méretek (SZ x H x M): 787 x 860 x 155 mm&lt;/li&gt;&lt;li&gt;csendes vízszivattyú&lt;/li&gt;&lt;li&gt;elektromos védelem&lt;/li&gt;&lt;li&gt;alacsony vízfogyasztás&lt;/li&gt;&lt;li&gt;minimális karbantartási igény&lt;/li&gt;&lt;li&gt;elektronikus, mikroprocesszoros irányítás&lt;ul&gt;&lt;li&gt;a ventilátor sebességének irányítására (8 sebesség)&lt;/li&gt;&lt;li&gt;a használati idő beprogramozására&lt;/li&gt;&lt;li&gt;a vízszint magasságának ellenőrzésére&lt;/li&gt;&lt;li&gt;a vízszivattyú működésének kijelzésére&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;a külső burkolat hőálló, UVA védelemmel ellátott műanyagból készült (ellenálló a mechanikus károsodásokkal szemben)&lt;/li&gt;', '                                                &lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;VEZETŐFÜLKÉK ELEKTRONIKUS HŰTŐEGYSÉGE&amp;nbsp;&lt;br&gt;MAXIMÁLIS TELJESÍTMÉNY - MINIMÁLIS FOGYASZTÁS – ALACSONYABB SZERKEZETI MAGASSÁG&lt;/h4&gt;&lt;p&gt;A fülkére szerelhető Bycool R-EVOLUTION elektronikus hűtőegység kiegészíti az Ön járművének funkcionalitását a hőmérséklet csökkentésével a fülkében, ha ez szükséges. Tekintet nélkül arra, hogy jár-e a gépjármű motorja vagy sem, a hűtőegység dolgozik, és ezért főleg a kocsi ki és berakodása alkalmával lehet hasznos, vagy a szünetekben és a pihenőidőben.&lt;br&gt;Alacsony szerkezeti magasságának köszönhetően nem szükséges módosításokat végezni a gépjármű légterelőjén.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;AZONNALI ÜZEMANYAG MEGTAKARÍTÁS&lt;/h4&gt;&lt;p&gt;NA független hűtőberendezés csak a jármű akkumulátorát használja energiaforrásként.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;NAGYTELJESÍTMÉNYŰ PÁROLOGTATÓS HŰTŐEGYSÉG&lt;/h4&gt;&lt;ul&gt;Kiváló minőségű belső irányító és elosztópanel. Felszerelés a jármű fülkéjének tetejének átfúrása nélkül. Nemzetközi műszaki támogatási hálózat.&lt;/ul&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;JAVÍTJA A SOFŐR MUNKAKÖRNYEZETÉT&amp;nbsp;&lt;br&gt;KÍMÉLI A JÁRMŰ MOTORJÁT&lt;/h4&gt;&lt;p&gt;A hűtőegység gépjármű leállított motorja mellett is dolgozik. Lehetővé teszi, hogy Ön kellemes hőmérsékleti viszonyok között vezessen vagy pihenjen a fülkében.&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Emeli a munkateljesítményt.&lt;/li&gt;&lt;li&gt;Javítja a munkakörülményeket.&lt;/li&gt;&lt;/ul&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;KÖRNYEZETBARÁT ÜZEMELÉS&lt;/h4&gt;&lt;p&gt;A berendezésnek nem kell külső energiaforráshoz kapcsolódnia. Csak minimális mennyiségű vizet fogyaszt.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;2 ÉV GARANCIA&lt;/h4&gt;&lt;p&gt;Az összes alkatrészre.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;NEMZETKÖZI SZERVIZHÁLÓZAT&lt;/h4&gt;                                                                                                ', '', 'R-Evolution 12V ADR', '', '', '', '', '', '', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `techspecs`, `highlights`, `tag`, `meta_title`, `meta_description`, `meta_keyword`, `custom_field_1_title`, `custom_field_1_content`, `custom_field_2_title`, `custom_field_2_content`, `custom_field_3_title`, `custom_field_3_content`) VALUES
(1436, 2, 'R-Evolution 12V s nádržou na Camper', '&lt;p&gt;Elektronická chladiaca jednotka kabíny Bycool R-EVOLUTION dopĺňa funkcionalitu Vášho vozidla znižovaním teploty v kabíne keď je to potrebné. Chladiaca jednotka pracuje bez ohľadu na to, či beží motor vozidla alebo nie, a preto je určená na použitie najmä pri nakladaní a vykladaní vozidla, a na prestávky, na oddych. Vďaka nízkej konštrukčnej výške nie je nutné robiť zásahy do spojleru vozidla.&lt;br&gt;&lt;/p&gt;', '&lt;li&gt;prevedenia 12 aj 24 Volt&lt;/li&gt;&lt;li&gt;ovládanie všetkých funkcií diaľkovým ovládačom alebo priamo na ovládacom paneli zariadenia&lt;/li&gt;&lt;li&gt;nie je potrebné nasmerovať diaľkový ovládač na senzor, tým sa vodič vyhne zbytočnému rozptyľovaniu sa počas jazdy&lt;/li&gt;&lt;li&gt;aerodynamický tvar&lt;/li&gt;&lt;li&gt;dve nádrže na vodu, jedna vonkajšia nádrž s kapacitou 35 litrov a druhá zabudovaná do zariadenia s ochranou proti pretečeniu, resp. preplneniu&lt;/li&gt;&lt;li&gt;motor:&lt;ul&gt;&lt;li&gt;dvojitý axiálny ventilátor&lt;/li&gt;&lt;li&gt;nízky odber prúdu pri 24V (od 0,4A do 4A)&lt;/li&gt;&lt;li&gt;cirkulácia vzduchu: 900 m3/hod.&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;dodáva sa aj prevedenie ADR pre prepravu nebezpečného nákladu&lt;/li&gt;&lt;li&gt;rozmery (Š x D x V): 787 x 860 x 155 mm&lt;/li&gt;&lt;li&gt;nehlučné vodné čerpadlo&lt;/li&gt;&lt;li&gt;elektrická ochrana&lt;/li&gt;&lt;li&gt;nízka spotreba vody&lt;/li&gt;&lt;li&gt;minimálne nároky na údržbu&lt;/li&gt;&lt;li&gt;elektronický riadiaci microprocessor&lt;ul&gt;&lt;li&gt;s ovládaním rýchlosti ventilátora (8 rýchlostí)&lt;/li&gt;&lt;li&gt;s programovaním času používania&lt;/li&gt;&lt;li&gt;s kontrolou výšky hladiny vody&lt;/li&gt;&lt;li&gt;s indikáciou činnosti vodného čerpadla&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;vonkajší kryt z termoplastu s UVA ochranou (odolný voči mechanickému poškodeniu)&lt;/li&gt;', '                                                &lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;ELEKTRONICKÁ CHLADIACA JEDNOTKA KABÍNY&lt;br&gt;MAXIMÁLNY VÝKON - MINIMÁLNA SPOTREBA - NIŽŠIA KONŠTRUKČNÁ VÝŠKA&lt;/span&gt;&lt;/h4&gt;Elektronická chladiaca jednotka kabíny Bycool R-EVOLUTION dopĺňa funkcionalitu Vášho vozidla znižovaním teploty v kabíne keď je to potrebné. Chladiaca jednotka pracuje bez ohľadu na to, či beží motor vozidla alebo nie, a preto je určená na použitie najmä pri nakladaní a vykladaní vozidla, a na prestávky, na oddych.&amp;nbsp;&lt;br&gt;Vďaka nízkej konštrukčnej výške nie je nutné robiť zásahy do spojleru vozidla.&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;OKAMŽITÁ ÚSPORA PALIVA&lt;/span&gt;&lt;/h4&gt;Nezávislé chladiace zariadenia odoberá iba energiu z batérií vozidla.&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;VYSOKOVÝKONNÁ VÝPARNÍKOVÁ CHLADIACA JEDNOTKA&lt;/span&gt;&lt;/h4&gt;&lt;ul&gt;&lt;li&gt;Vnútorný riadiaci a distribučný panel vysokej kvality.&lt;/li&gt;&lt;li&gt;Inštalácia bez vŕtania dier do strechy kabíny vozidla.&lt;/li&gt;&lt;li&gt;Medzinárodná sieť technickej podpory.&lt;/li&gt;&lt;/ul&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;ZLEPŠUJE PRACOVNÉ PROSTREDIE VODIČA&lt;br&gt;ŠETRÍ MOTOR VOZIDLA&lt;/span&gt;&lt;/h4&gt;Chladiaca jednotka pracuje pri vypnutom motore vozidla. Umožňuje Vám šoférovať a oddychovať v kabíne v príjemných tepelných podmienkach.&lt;ul&gt;&lt;li&gt;Zvyšuje pracovný výkon.&lt;/li&gt;&lt;li&gt;Zlepšuje pracovný komfort.&lt;/li&gt;&lt;/ul&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;EKOLOGICKÁ PREVÁDZKA&lt;/span&gt;&lt;/h4&gt;Zariadenie nemusí byť pripojené k vonkajšiemu zdroju energie. Spotrebuje minimálne množstvo vody.&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;ZÁRUKA 2 ROKY&lt;/span&gt;&lt;/h4&gt;Na všetky diely.&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;MEDZINÁRODNÁ SERVISNÁ SIEŤ&lt;/span&gt;&lt;/h4&gt;                                                                                                ', '', 'R-Evolution 12V s nádržou na Camper', '', '', '', '', '', '', '', ''),
(1436, 1, 'R-Evolution 12V with Camper water tank', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '                                                                                                                                                ', '', 'R-Evolution 12V with Camper water tank', '', '', '', '', '', '', '', ''),
(1436, 3, 'R-Evolution 12V mit Camper Wassertank', '&lt;p&gt;Die elektronische Standkühlanlage Bycool R-EVOLUTION senkt die Lufttemperatur in der Fahrerkabine immer dann, wenn es notwendig ist. Die Kühlananlage arbeitet ohne Fahrzeugmotor, kann aber auch während der Fahrt benuzt werden.Anwendungsbereich: Be- und Entladen des Fahrzeuges, Ruhe- und Schlafpausen.&lt;br&gt;Dank der niedrigen Aufbauhöhe ist diese Anlage auf jeder Fahrerkabine einzubauen.&lt;br&gt;&lt;/p&gt;', '&lt;li&gt;Ausführungen: 12 und 24 Volt&lt;/li&gt;&lt;li&gt;Steuerung aller Funktionen über die Fernbedienung durch Radiofrequenz (RF) oder über das elektronische Tastenfeld&lt;/li&gt;&lt;li&gt;der Sensor muss nicht angetastet werden, somit werden Ablenkungen während der Fahrt vermieden&lt;/li&gt;&lt;li&gt;aerodynamisches Design&lt;/li&gt;&lt;li&gt;zwei Wasserbehälter, ein externer 35 Liter - Tank zur Wasserversorgung und ein zweiter auslaufgeschützt im Gerät&lt;/li&gt;&lt;li&gt;Motor:&lt;ul&gt;&lt;li&gt;doppelter Axiallüfter&lt;/li&gt;&lt;li&gt;geringer Stromverbrauch bei 24V (von 0,4A bis 4A)&lt;/li&gt;&lt;li&gt;Luftdurchsatz: 900 m3/Std.&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;auch in ADR-Ausführung erhältlich (für den Transport gefährlicher Güter)&lt;/li&gt;&lt;li&gt;Abmessungen (B x L x H): 787 x 860 x 155 mm&lt;/li&gt;&lt;li&gt;geräuscharme Wasserpumpe&lt;/li&gt;&lt;li&gt;Unterspannungsschutz&lt;/li&gt;&lt;li&gt;geringer Wasserverbrauch&lt;/li&gt;&lt;li&gt;minimaler Wartungsaufwand&lt;/li&gt;&lt;li&gt;Mikroprozessor zur elektronischen Gerätesteuerung mit:&lt;ul&gt;&lt;li&gt;Gebläsedrehzahl 8-stufig regulierbar&lt;/li&gt;&lt;li&gt;programmierbare Zeitsteuerung&lt;/li&gt;&lt;li&gt;Wasserstandkontrolle&lt;/li&gt;&lt;li&gt;optische Anzeige der Wasserpumpenfunktion&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;externes Gehäuse in ABS mit UV-Schutz&lt;/li&gt;', '                                                &lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;ELEKTRONISCHE STANDKÜHLANLAGE FÜR NUTZFAHRZEUGE&lt;br&gt;MAXIMALE KÄLTELEISTUNG - MINIMALER STROMVERBRAUCH - NIEDRIGE AUFBAUHÖHE&lt;/h4&gt;&lt;p&gt;Die elektronische Standkühlanlage Bycool R-EVOLUTION senkt die Lufttemperatur in der Fahrerkabine immer dann, wenn es notwendig ist. Die Kühlananlage arbeitet ohne Fahrzeugmotor, kann aber auch während der Fahrt benuzt werden.Anwendungsbereich: Be- und Entladen des Fahrzeuges, Ruhe- und Schlafpausen.&lt;br&gt;Dank der niedrigen Aufbauhöhe ist diese Anlage auf jeder Fahrerkabine einzubauen.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;SOFORTIGE KRAFTSTOFFEINSPARUNG&lt;/h4&gt;&lt;p&gt;Dieses Standkühlgerät nimmt Energie von der Fahrzeugbatterie ab.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;ELEKTRONISCHES STANDKÜHLGERÄT MIT HOHEM LEISTUNGSVERMÖGEN&lt;/h4&gt;&lt;ul&gt;&lt;li&gt;Innenraumblende mit verschließbaren Ausströmern und Bedienelement ist von höchster Qualität.&lt;/li&gt;&lt;li&gt;Montage ohne das Bohren ins Dach der Fahrerkabine.&lt;/li&gt;&lt;li&gt;Internationale technische Unterstützung.&lt;/li&gt;&lt;/ul&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;ERMÖGLICHT EIN BESSERES ARBEITSKLIMA&amp;nbsp;&lt;br&gt;SCHÜTZT DEN FAHRZEUGMOTOR&lt;/h4&gt;&lt;p&gt;Die Kühlanlage arbeitet bei abgestelltem Fahrzeugmotor. Sie ermöglicht das Fahren und Rasten in einer angenehm gekühlter Fahrerkabine.&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Erhöht die Arbeitsleistung.&lt;/li&gt;&lt;li&gt;Verbessert den Arbeitskomfort.&lt;/li&gt;&lt;/ul&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;UMWELTFREUNDLICH&lt;/h4&gt;&lt;p&gt;Die Anlage braucht keinen Netzanschluß. Verbraucht nur Wasser.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;2 JAHRE GEWÄHRLEISTUNG&lt;/h4&gt;&lt;p&gt;Auf alle Bauteile.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;INTERNATIONALES SERVICENETZ&lt;/h4&gt;                                                                                                ', '', 'R-Evolution 12V mit Camper Wassertank', '', '', '', '', '', '', '', ''),
(1436, 4, 'R-Evolution 12V a Camper víztartály', '&lt;p&gt;A fülkére szerelhető Bycool R-EVOLUTION elektronikus hűtőegység kiegészíti az Ön járművének funkcionalitását a hőmérséklet csökkentésével a fülkében, ha ez szükséges. Tekintet nélkül arra, hogy jár-e a gépjármű motorja vagy sem, a hűtőegység dolgozik, és ezért főleg a kocsi ki és berakodása alkalmával lehet hasznos, vagy a szünetekben és a pihenőidőben.&lt;br&gt;Alacsony szerkezeti magasságának köszönhetően nem szükséges módosításokat végezni a gépjármű légterelőjén.&lt;br&gt;&lt;/p&gt;', '&lt;li&gt;12 és 24 Voltos kivitelben is&lt;/li&gt;&lt;li&gt;az összes funkció távirányítóval vezérelhető vagy egyenesen a berendezés vezérlőpaneljéről&lt;/li&gt;&lt;li&gt;a távirányítót nem kell a szenzorra irányítani, ezzel a sofőr elkerüli a vezetés közbeni felesleges figyelemmegosztást&lt;/li&gt;&lt;li&gt;aerodinamikus forma&lt;/li&gt;&lt;li&gt;két víztartály, egy külső tartály 35 liter kapacitással és egy beépítve a berendezésbe, túlcsordulás, illetve túltelítődés elleni védelemmel&lt;/li&gt;&lt;li&gt;motor:&lt;ul&gt;&lt;li&gt;kettős axiális ventilátor&lt;/li&gt;&lt;li&gt;24 V mellett alacsony elektromos fogyasztás (0,4 A-tól 4 A-ig)&lt;/li&gt;&lt;li&gt;légcirkuláció: 900 m3/óra&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;kapható ADR kivitelben is, veszélyes anyagok szállításához&lt;/li&gt;&lt;li&gt;méretek (SZ x H x M): 787 x 860 x 155 mm&lt;/li&gt;&lt;li&gt;csendes vízszivattyú&lt;/li&gt;&lt;li&gt;elektromos védelem&lt;/li&gt;&lt;li&gt;alacsony vízfogyasztás&lt;/li&gt;&lt;li&gt;minimális karbantartási igény&lt;/li&gt;&lt;li&gt;elektronikus, mikroprocesszoros irányítás&lt;ul&gt;&lt;li&gt;a ventilátor sebességének irányítására (8 sebesség)&lt;/li&gt;&lt;li&gt;a használati idő beprogramozására&lt;/li&gt;&lt;li&gt;a vízszint magasságának ellenőrzésére&lt;/li&gt;&lt;li&gt;a vízszivattyú működésének kijelzésére&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;a külső burkolat hőálló, UVA védelemmel ellátott műanyagból készült (ellenálló a mechanikus károsodásokkal szemben)&lt;/li&gt;', '                                                &lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;VEZETŐFÜLKÉK ELEKTRONIKUS HŰTŐEGYSÉGE&amp;nbsp;&lt;br&gt;MAXIMÁLIS TELJESÍTMÉNY - MINIMÁLIS FOGYASZTÁS – ALACSONYABB SZERKEZETI MAGASSÁG&lt;/h4&gt;&lt;p&gt;A fülkére szerelhető Bycool R-EVOLUTION elektronikus hűtőegység kiegészíti az Ön járművének funkcionalitását a hőmérséklet csökkentésével a fülkében, ha ez szükséges. Tekintet nélkül arra, hogy jár-e a gépjármű motorja vagy sem, a hűtőegység dolgozik, és ezért főleg a kocsi ki és berakodása alkalmával lehet hasznos, vagy a szünetekben és a pihenőidőben.&lt;br&gt;Alacsony szerkezeti magasságának köszönhetően nem szükséges módosításokat végezni a gépjármű légterelőjén.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;AZONNALI ÜZEMANYAG MEGTAKARÍTÁS&lt;/h4&gt;&lt;p&gt;NA független hűtőberendezés csak a jármű akkumulátorát használja energiaforrásként.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;NAGYTELJESÍTMÉNYŰ PÁROLOGTATÓS HŰTŐEGYSÉG&lt;/h4&gt;&lt;ul&gt;Kiváló minőségű belső irányító és elosztópanel. Felszerelés a jármű fülkéjének tetejének átfúrása nélkül. Nemzetközi műszaki támogatási hálózat.&lt;/ul&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;JAVÍTJA A SOFŐR MUNKAKÖRNYEZETÉT&amp;nbsp;&lt;br&gt;KÍMÉLI A JÁRMŰ MOTORJÁT&lt;/h4&gt;&lt;p&gt;A hűtőegység gépjármű leállított motorja mellett is dolgozik. Lehetővé teszi, hogy Ön kellemes hőmérsékleti viszonyok között vezessen vagy pihenjen a fülkében.&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Emeli a munkateljesítményt.&lt;/li&gt;&lt;li&gt;Javítja a munkakörülményeket.&lt;/li&gt;&lt;/ul&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;KÖRNYEZETBARÁT ÜZEMELÉS&lt;/h4&gt;&lt;p&gt;A berendezésnek nem kell külső energiaforráshoz kapcsolódnia. Csak minimális mennyiségű vizet fogyaszt.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;2 ÉV GARANCIA&lt;/h4&gt;&lt;p&gt;Az összes alkatrészre.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;NEMZETKÖZI SZERVIZHÁLÓZAT&lt;/h4&gt;                                                                                                ', '', 'R-Evolution 12V a Camper víztartály', '', '', '', '', '', '', '', ''),
(1438, 2, 'R-Evolution 24V', '&lt;p&gt;Elektronická chladiaca jednotka kabíny Bycool R-EVOLUTION dopĺňa funkcionalitu Vášho vozidla znižovaním teploty v kabíne keď je to potrebné. Chladiaca jednotka pracuje bez ohľadu na to, či beží motor vozidla alebo nie, a preto je určená na použitie najmä pri nakladaní a vykladaní vozidla, a na prestávky, na oddych. Vďaka nízkej konštrukčnej výške nie je nutné robiť zásahy do spojleru vozidla.&lt;br&gt;&lt;/p&gt;', '&lt;li&gt;prevedenia 12 aj 24 Volt&lt;/li&gt;&lt;li&gt;ovládanie všetkých funkcií diaľkovým ovládačom alebo priamo na ovládacom paneli zariadenia&lt;/li&gt;&lt;li&gt;nie je potrebné nasmerovať diaľkový ovládač na senzor, tým sa vodič vyhne zbytočnému rozptyľovaniu sa počas jazdy&lt;/li&gt;&lt;li&gt;aerodynamický tvar&lt;/li&gt;&lt;li&gt;dve nádrže na vodu, jedna vonkajšia nádrž s kapacitou 35 litrov a druhá zabudovaná do zariadenia s ochranou proti pretečeniu, resp. preplneniu&lt;/li&gt;&lt;li&gt;motor:&lt;ul&gt;&lt;li&gt;dvojitý axiálny ventilátor&lt;/li&gt;&lt;li&gt;nízky odber prúdu pri 24V (od 0,4A do 4A)&lt;/li&gt;&lt;li&gt;cirkulácia vzduchu: 900 m3/hod.&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;dodáva sa aj prevedenie ADR pre prepravu nebezpečného nákladu&lt;/li&gt;&lt;li&gt;rozmery (Š x D x V): 787 x 860 x 155 mm&lt;/li&gt;&lt;li&gt;nehlučné vodné čerpadlo&lt;/li&gt;&lt;li&gt;elektrická ochrana&lt;/li&gt;&lt;li&gt;nízka spotreba vody&lt;/li&gt;&lt;li&gt;minimálne nároky na údržbu&lt;/li&gt;&lt;li&gt;elektronický riadiaci microprocessor&lt;ul&gt;&lt;li&gt;s ovládaním rýchlosti ventilátora (8 rýchlostí)&lt;/li&gt;&lt;li&gt;s programovaním času používania&lt;/li&gt;&lt;li&gt;s kontrolou výšky hladiny vody&lt;/li&gt;&lt;li&gt;s indikáciou činnosti vodného čerpadla&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;vonkajší kryt z termoplastu s UVA ochranou (odolný voči mechanickému poškodeniu)&lt;/li&gt;', '                                                &lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;ELEKTRONICKÁ CHLADIACA JEDNOTKA KABÍNY&lt;br&gt;MAXIMÁLNY VÝKON - MINIMÁLNA SPOTREBA - NIŽŠIA KONŠTRUKČNÁ VÝŠKA&lt;/span&gt;&lt;/h4&gt;Elektronická chladiaca jednotka kabíny Bycool R-EVOLUTION dopĺňa funkcionalitu Vášho vozidla znižovaním teploty v kabíne keď je to potrebné. Chladiaca jednotka pracuje bez ohľadu na to, či beží motor vozidla alebo nie, a preto je určená na použitie najmä pri nakladaní a vykladaní vozidla, a na prestávky, na oddych.&amp;nbsp;&lt;br&gt;Vďaka nízkej konštrukčnej výške nie je nutné robiť zásahy do spojleru vozidla.&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;OKAMŽITÁ ÚSPORA PALIVA&lt;/span&gt;&lt;/h4&gt;Nezávislé chladiace zariadenia odoberá iba energiu z batérií vozidla.&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;VYSOKOVÝKONNÁ VÝPARNÍKOVÁ CHLADIACA JEDNOTKA&lt;/span&gt;&lt;/h4&gt;&lt;ul&gt;&lt;li&gt;Vnútorný riadiaci a distribučný panel vysokej kvality.&lt;/li&gt;&lt;li&gt;Inštalácia bez vŕtania dier do strechy kabíny vozidla.&lt;/li&gt;&lt;li&gt;Medzinárodná sieť technickej podpory.&lt;/li&gt;&lt;/ul&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;ZLEPŠUJE PRACOVNÉ PROSTREDIE VODIČA&lt;br&gt;ŠETRÍ MOTOR VOZIDLA&lt;/span&gt;&lt;/h4&gt;Chladiaca jednotka pracuje pri vypnutom motore vozidla. Umožňuje Vám šoférovať a oddychovať v kabíne v príjemných tepelných podmienkach.&lt;ul&gt;&lt;li&gt;Zvyšuje pracovný výkon.&lt;/li&gt;&lt;li&gt;Zlepšuje pracovný komfort.&lt;/li&gt;&lt;/ul&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;EKOLOGICKÁ PREVÁDZKA&lt;/span&gt;&lt;/h4&gt;Zariadenie nemusí byť pripojené k vonkajšiemu zdroju energie. Spotrebuje minimálne množstvo vody.&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;ZÁRUKA 2 ROKY&lt;/span&gt;&lt;/h4&gt;Na všetky diely.&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;MEDZINÁRODNÁ SERVISNÁ SIEŤ&lt;/span&gt;&lt;/h4&gt;                                                                                                ', '', 'R-Evolution 24V', '', '', '', '', '', '', '', ''),
(1438, 1, 'R-Evolution 24V', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '                                                                                                                                                ', '', 'R-Evolution 24V', '', '', '', '', '', '', '', ''),
(1438, 3, 'R-Evolution 24V', '&lt;p&gt;Die elektronische Standkühlanlage Bycool R-EVOLUTION senkt die Lufttemperatur in der Fahrerkabine immer dann, wenn es notwendig ist. Die Kühlananlage arbeitet ohne Fahrzeugmotor, kann aber auch während der Fahrt benuzt werden.Anwendungsbereich: Be- und Entladen des Fahrzeuges, Ruhe- und Schlafpausen.&lt;br&gt;Dank der niedrigen Aufbauhöhe ist diese Anlage auf jeder Fahrerkabine einzubauen.&lt;br&gt;&lt;/p&gt;', '&lt;li&gt;Ausführungen: 12 und 24 Volt&lt;/li&gt;&lt;li&gt;Steuerung aller Funktionen über die Fernbedienung durch Radiofrequenz (RF) oder über das elektronische Tastenfeld&lt;/li&gt;&lt;li&gt;der Sensor muss nicht angetastet werden, somit werden Ablenkungen während der Fahrt vermieden&lt;/li&gt;&lt;li&gt;aerodynamisches Design&lt;/li&gt;&lt;li&gt;zwei Wasserbehälter, ein externer 35 Liter - Tank zur Wasserversorgung und ein zweiter auslaufgeschützt im Gerät&lt;/li&gt;&lt;li&gt;Motor:&lt;ul&gt;&lt;li&gt;doppelter Axiallüfter&lt;/li&gt;&lt;li&gt;geringer Stromverbrauch bei 24V (von 0,4A bis 4A)&lt;/li&gt;&lt;li&gt;Luftdurchsatz: 900 m3/Std.&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;auch in ADR-Ausführung erhältlich (für den Transport gefährlicher Güter)&lt;/li&gt;&lt;li&gt;Abmessungen (B x L x H): 787 x 860 x 155 mm&lt;/li&gt;&lt;li&gt;geräuscharme Wasserpumpe&lt;/li&gt;&lt;li&gt;Unterspannungsschutz&lt;/li&gt;&lt;li&gt;geringer Wasserverbrauch&lt;/li&gt;&lt;li&gt;minimaler Wartungsaufwand&lt;/li&gt;&lt;li&gt;Mikroprozessor zur elektronischen Gerätesteuerung mit:&lt;ul&gt;&lt;li&gt;Gebläsedrehzahl 8-stufig regulierbar&lt;/li&gt;&lt;li&gt;programmierbare Zeitsteuerung&lt;/li&gt;&lt;li&gt;Wasserstandkontrolle&lt;/li&gt;&lt;li&gt;optische Anzeige der Wasserpumpenfunktion&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;externes Gehäuse in ABS mit UV-Schutz&lt;/li&gt;', '                                                &lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;ELEKTRONISCHE STANDKÜHLANLAGE FÜR NUTZFAHRZEUGE&lt;br&gt;MAXIMALE KÄLTELEISTUNG - MINIMALER STROMVERBRAUCH - NIEDRIGE AUFBAUHÖHE&lt;/h4&gt;&lt;p&gt;Die elektronische Standkühlanlage Bycool R-EVOLUTION senkt die Lufttemperatur in der Fahrerkabine immer dann, wenn es notwendig ist. Die Kühlananlage arbeitet ohne Fahrzeugmotor, kann aber auch während der Fahrt benuzt werden.Anwendungsbereich: Be- und Entladen des Fahrzeuges, Ruhe- und Schlafpausen.&lt;br&gt;Dank der niedrigen Aufbauhöhe ist diese Anlage auf jeder Fahrerkabine einzubauen.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;SOFORTIGE KRAFTSTOFFEINSPARUNG&lt;/h4&gt;&lt;p&gt;Dieses Standkühlgerät nimmt Energie von der Fahrzeugbatterie ab.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;ELEKTRONISCHES STANDKÜHLGERÄT MIT HOHEM LEISTUNGSVERMÖGEN&lt;/h4&gt;&lt;ul&gt;&lt;li&gt;Innenraumblende mit verschließbaren Ausströmern und Bedienelement ist von höchster Qualität.&lt;/li&gt;&lt;li&gt;Montage ohne das Bohren ins Dach der Fahrerkabine.&lt;/li&gt;&lt;li&gt;Internationale technische Unterstützung.&lt;/li&gt;&lt;/ul&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;ERMÖGLICHT EIN BESSERES ARBEITSKLIMA&amp;nbsp;&lt;br&gt;SCHÜTZT DEN FAHRZEUGMOTOR&lt;/h4&gt;&lt;p&gt;Die Kühlanlage arbeitet bei abgestelltem Fahrzeugmotor. Sie ermöglicht das Fahren und Rasten in einer angenehm gekühlter Fahrerkabine.&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Erhöht die Arbeitsleistung.&lt;/li&gt;&lt;li&gt;Verbessert den Arbeitskomfort.&lt;/li&gt;&lt;/ul&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;UMWELTFREUNDLICH&lt;/h4&gt;&lt;p&gt;Die Anlage braucht keinen Netzanschluß. Verbraucht nur Wasser.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;2 JAHRE GEWÄHRLEISTUNG&lt;/h4&gt;&lt;p&gt;Auf alle Bauteile.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;INTERNATIONALES SERVICENETZ&lt;/h4&gt;                                                                                                ', '', 'R-Evolution 24V', '', '', '', '', '', '', '', ''),
(1438, 4, 'R-Evolution 24V', '&lt;p&gt;A fülkére szerelhető Bycool R-EVOLUTION elektronikus hűtőegység kiegészíti az Ön járművének funkcionalitását a hőmérséklet csökkentésével a fülkében, ha ez szükséges. Tekintet nélkül arra, hogy jár-e a gépjármű motorja vagy sem, a hűtőegység dolgozik, és ezért főleg a kocsi ki és berakodása alkalmával lehet hasznos, vagy a szünetekben és a pihenőidőben.&lt;br&gt;Alacsony szerkezeti magasságának köszönhetően nem szükséges módosításokat végezni a gépjármű légterelőjén.&lt;br&gt;&lt;/p&gt;', '&lt;li&gt;12 és 24 Voltos kivitelben is&lt;/li&gt;&lt;li&gt;az összes funkció távirányítóval vezérelhető vagy egyenesen a berendezés vezérlőpaneljéről&lt;/li&gt;&lt;li&gt;a távirányítót nem kell a szenzorra irányítani, ezzel a sofőr elkerüli a vezetés közbeni felesleges figyelemmegosztást&lt;/li&gt;&lt;li&gt;aerodinamikus forma&lt;/li&gt;&lt;li&gt;két víztartály, egy külső tartály 35 liter kapacitással és egy beépítve a berendezésbe, túlcsordulás, illetve túltelítődés elleni védelemmel&lt;/li&gt;&lt;li&gt;motor:&lt;ul&gt;&lt;li&gt;kettős axiális ventilátor&lt;/li&gt;&lt;li&gt;24 V mellett alacsony elektromos fogyasztás (0,4 A-tól 4 A-ig)&lt;/li&gt;&lt;li&gt;légcirkuláció: 900 m3/óra&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;kapható ADR kivitelben is, veszélyes anyagok szállításához&lt;/li&gt;&lt;li&gt;méretek (SZ x H x M): 787 x 860 x 155 mm&lt;/li&gt;&lt;li&gt;csendes vízszivattyú&lt;/li&gt;&lt;li&gt;elektromos védelem&lt;/li&gt;&lt;li&gt;alacsony vízfogyasztás&lt;/li&gt;&lt;li&gt;minimális karbantartási igény&lt;/li&gt;&lt;li&gt;elektronikus, mikroprocesszoros irányítás&lt;ul&gt;&lt;li&gt;a ventilátor sebességének irányítására (8 sebesség)&lt;/li&gt;&lt;li&gt;a használati idő beprogramozására&lt;/li&gt;&lt;li&gt;a vízszint magasságának ellenőrzésére&lt;/li&gt;&lt;li&gt;a vízszivattyú működésének kijelzésére&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;a külső burkolat hőálló, UVA védelemmel ellátott műanyagból készült (ellenálló a mechanikus károsodásokkal szemben)&lt;/li&gt;', '                                                &lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;VEZETŐFÜLKÉK ELEKTRONIKUS HŰTŐEGYSÉGE&amp;nbsp;&lt;br&gt;MAXIMÁLIS TELJESÍTMÉNY - MINIMÁLIS FOGYASZTÁS – ALACSONYABB SZERKEZETI MAGASSÁG&lt;/h4&gt;&lt;p&gt;A fülkére szerelhető Bycool R-EVOLUTION elektronikus hűtőegység kiegészíti az Ön járművének funkcionalitását a hőmérséklet csökkentésével a fülkében, ha ez szükséges. Tekintet nélkül arra, hogy jár-e a gépjármű motorja vagy sem, a hűtőegység dolgozik, és ezért főleg a kocsi ki és berakodása alkalmával lehet hasznos, vagy a szünetekben és a pihenőidőben.&lt;br&gt;Alacsony szerkezeti magasságának köszönhetően nem szükséges módosításokat végezni a gépjármű légterelőjén.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;AZONNALI ÜZEMANYAG MEGTAKARÍTÁS&lt;/h4&gt;&lt;p&gt;NA független hűtőberendezés csak a jármű akkumulátorát használja energiaforrásként.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;NAGYTELJESÍTMÉNYŰ PÁROLOGTATÓS HŰTŐEGYSÉG&lt;/h4&gt;&lt;ul&gt;Kiváló minőségű belső irányító és elosztópanel. Felszerelés a jármű fülkéjének tetejének átfúrása nélkül. Nemzetközi műszaki támogatási hálózat.&lt;/ul&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;JAVÍTJA A SOFŐR MUNKAKÖRNYEZETÉT&amp;nbsp;&lt;br&gt;KÍMÉLI A JÁRMŰ MOTORJÁT&lt;/h4&gt;&lt;p&gt;A hűtőegység gépjármű leállított motorja mellett is dolgozik. Lehetővé teszi, hogy Ön kellemes hőmérsékleti viszonyok között vezessen vagy pihenjen a fülkében.&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Emeli a munkateljesítményt.&lt;/li&gt;&lt;li&gt;Javítja a munkakörülményeket.&lt;/li&gt;&lt;/ul&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;KÖRNYEZETBARÁT ÜZEMELÉS&lt;/h4&gt;&lt;p&gt;A berendezésnek nem kell külső energiaforráshoz kapcsolódnia. Csak minimális mennyiségű vizet fogyaszt.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;2 ÉV GARANCIA&lt;/h4&gt;&lt;p&gt;Az összes alkatrészre.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;NEMZETKÖZI SZERVIZHÁLÓZAT&lt;/h4&gt;                                                                                                ', '', 'R-Evolution 24V', '', '', '', '', '', '', '', ''),
(1439, 2, 'R-Evolution 24V ADR', '&lt;p&gt;Elektronická chladiaca jednotka kabíny Bycool R-EVOLUTION dopĺňa funkcionalitu Vášho vozidla znižovaním teploty v kabíne keď je to potrebné. Chladiaca jednotka pracuje bez ohľadu na to, či beží motor vozidla alebo nie, a preto je určená na použitie najmä pri nakladaní a vykladaní vozidla, a na prestávky, na oddych. Vďaka nízkej konštrukčnej výške nie je nutné robiť zásahy do spojleru vozidla.&lt;br&gt;&lt;/p&gt;', '&lt;li&gt;prevedenia 12 aj 24 Volt&lt;/li&gt;&lt;li&gt;ovládanie všetkých funkcií diaľkovým ovládačom alebo priamo na ovládacom paneli zariadenia&lt;/li&gt;&lt;li&gt;nie je potrebné nasmerovať diaľkový ovládač na senzor, tým sa vodič vyhne zbytočnému rozptyľovaniu sa počas jazdy&lt;/li&gt;&lt;li&gt;aerodynamický tvar&lt;/li&gt;&lt;li&gt;dve nádrže na vodu, jedna vonkajšia nádrž s kapacitou 35 litrov a druhá zabudovaná do zariadenia s ochranou proti pretečeniu, resp. preplneniu&lt;/li&gt;&lt;li&gt;motor:&lt;ul&gt;&lt;li&gt;dvojitý axiálny ventilátor&lt;/li&gt;&lt;li&gt;nízky odber prúdu pri 24V (od 0,4A do 4A)&lt;/li&gt;&lt;li&gt;cirkulácia vzduchu: 900 m3/hod.&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;dodáva sa aj prevedenie ADR pre prepravu nebezpečného nákladu&lt;/li&gt;&lt;li&gt;rozmery (Š x D x V): 787 x 860 x 155 mm&lt;/li&gt;&lt;li&gt;nehlučné vodné čerpadlo&lt;/li&gt;&lt;li&gt;elektrická ochrana&lt;/li&gt;&lt;li&gt;nízka spotreba vody&lt;/li&gt;&lt;li&gt;minimálne nároky na údržbu&lt;/li&gt;&lt;li&gt;elektronický riadiaci microprocessor&lt;ul&gt;&lt;li&gt;s ovládaním rýchlosti ventilátora (8 rýchlostí)&lt;/li&gt;&lt;li&gt;s programovaním času používania&lt;/li&gt;&lt;li&gt;s kontrolou výšky hladiny vody&lt;/li&gt;&lt;li&gt;s indikáciou činnosti vodného čerpadla&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;vonkajší kryt z termoplastu s UVA ochranou (odolný voči mechanickému poškodeniu)&lt;/li&gt;', '                                                                        &lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;ELEKTRONICKÁ CHLADIACA JEDNOTKA KABÍNY&lt;br&gt;MAXIMÁLNY VÝKON - MINIMÁLNA SPOTREBA - NIŽŠIA KONŠTRUKČNÁ VÝŠKA&lt;/span&gt;&lt;/h4&gt;Elektronická chladiaca jednotka kabíny Bycool R-EVOLUTION dopĺňa funkcionalitu Vášho vozidla znižovaním teploty v kabíne keď je to potrebné. Chladiaca jednotka pracuje bez ohľadu na to, či beží motor vozidla alebo nie, a preto je určená na použitie najmä pri nakladaní a vykladaní vozidla, a na prestávky, na oddych.&amp;nbsp;&lt;br&gt;Vďaka nízkej konštrukčnej výške nie je nutné robiť zásahy do spojleru vozidla.&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;OKAMŽITÁ ÚSPORA PALIVA&lt;/span&gt;&lt;/h4&gt;Nezávislé chladiace zariadenia odoberá iba energiu z batérií vozidla.&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;VYSOKOVÝKONNÁ VÝPARNÍKOVÁ CHLADIACA JEDNOTKA&lt;/span&gt;&lt;/h4&gt;&lt;ul&gt;&lt;li&gt;Vnútorný riadiaci a distribučný panel vysokej kvality.&lt;/li&gt;&lt;li&gt;Inštalácia bez vŕtania dier do strechy kabíny vozidla.&lt;/li&gt;&lt;li&gt;Medzinárodná sieť technickej podpory.&lt;/li&gt;&lt;/ul&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;ZLEPŠUJE PRACOVNÉ PROSTREDIE VODIČA&lt;br&gt;ŠETRÍ MOTOR VOZIDLA&lt;/span&gt;&lt;/h4&gt;Chladiaca jednotka pracuje pri vypnutom motore vozidla. Umožňuje Vám šoférovať a oddychovať v kabíne v príjemných tepelných podmienkach.&lt;ul&gt;&lt;li&gt;Zvyšuje pracovný výkon.&lt;/li&gt;&lt;li&gt;Zlepšuje pracovný komfort.&lt;/li&gt;&lt;/ul&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;EKOLOGICKÁ PREVÁDZKA&lt;/span&gt;&lt;/h4&gt;Zariadenie nemusí byť pripojené k vonkajšiemu zdroju energie. Spotrebuje minimálne množstvo vody.&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;ZÁRUKA 2 ROKY&lt;/span&gt;&lt;/h4&gt;Na všetky diely.&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;MEDZINÁRODNÁ SERVISNÁ SIEŤ&lt;/span&gt;&lt;/h4&gt;                                                                                                                        ', '', 'R-Evolution 24V ADR', '', '', '', '', '', '', '', ''),
(1439, 1, 'R-Evolution 24V ADR', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '                                                                                                                                                                                                ', '', 'R-Evolution 24V ADR', '', '', '', '', '', '', '', ''),
(1439, 3, 'R-Evolution 24V ADR', '&lt;p&gt;Die elektronische Standkühlanlage Bycool R-EVOLUTION senkt die Lufttemperatur in der Fahrerkabine immer dann, wenn es notwendig ist. Die Kühlananlage arbeitet ohne Fahrzeugmotor, kann aber auch während der Fahrt benuzt werden.Anwendungsbereich: Be- und Entladen des Fahrzeuges, Ruhe- und Schlafpausen.&lt;br&gt;Dank der niedrigen Aufbauhöhe ist diese Anlage auf jeder Fahrerkabine einzubauen.&lt;br&gt;&lt;/p&gt;', '&lt;li&gt;Ausführungen: 12 und 24 Volt&lt;/li&gt;&lt;li&gt;Steuerung aller Funktionen über die Fernbedienung durch Radiofrequenz (RF) oder über das elektronische Tastenfeld&lt;/li&gt;&lt;li&gt;der Sensor muss nicht angetastet werden, somit werden Ablenkungen während der Fahrt vermieden&lt;/li&gt;&lt;li&gt;aerodynamisches Design&lt;/li&gt;&lt;li&gt;zwei Wasserbehälter, ein externer 35 Liter - Tank zur Wasserversorgung und ein zweiter auslaufgeschützt im Gerät&lt;/li&gt;&lt;li&gt;Motor:&lt;ul&gt;&lt;li&gt;doppelter Axiallüfter&lt;/li&gt;&lt;li&gt;geringer Stromverbrauch bei 24V (von 0,4A bis 4A)&lt;/li&gt;&lt;li&gt;Luftdurchsatz: 900 m3/Std.&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;auch in ADR-Ausführung erhältlich (für den Transport gefährlicher Güter)&lt;/li&gt;&lt;li&gt;Abmessungen (B x L x H): 787 x 860 x 155 mm&lt;/li&gt;&lt;li&gt;geräuscharme Wasserpumpe&lt;/li&gt;&lt;li&gt;Unterspannungsschutz&lt;/li&gt;&lt;li&gt;geringer Wasserverbrauch&lt;/li&gt;&lt;li&gt;minimaler Wartungsaufwand&lt;/li&gt;&lt;li&gt;Mikroprozessor zur elektronischen Gerätesteuerung mit:&lt;ul&gt;&lt;li&gt;Gebläsedrehzahl 8-stufig regulierbar&lt;/li&gt;&lt;li&gt;programmierbare Zeitsteuerung&lt;/li&gt;&lt;li&gt;Wasserstandkontrolle&lt;/li&gt;&lt;li&gt;optische Anzeige der Wasserpumpenfunktion&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;externes Gehäuse in ABS mit UV-Schutz&lt;/li&gt;', '                                                                        &lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;ELEKTRONISCHE STANDKÜHLANLAGE FÜR NUTZFAHRZEUGE&lt;br&gt;MAXIMALE KÄLTELEISTUNG - MINIMALER STROMVERBRAUCH - NIEDRIGE AUFBAUHÖHE&lt;/h4&gt;&lt;p&gt;Die elektronische Standkühlanlage Bycool R-EVOLUTION senkt die Lufttemperatur in der Fahrerkabine immer dann, wenn es notwendig ist. Die Kühlananlage arbeitet ohne Fahrzeugmotor, kann aber auch während der Fahrt benuzt werden.Anwendungsbereich: Be- und Entladen des Fahrzeuges, Ruhe- und Schlafpausen.&lt;br&gt;Dank der niedrigen Aufbauhöhe ist diese Anlage auf jeder Fahrerkabine einzubauen.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;SOFORTIGE KRAFTSTOFFEINSPARUNG&lt;/h4&gt;&lt;p&gt;Dieses Standkühlgerät nimmt Energie von der Fahrzeugbatterie ab.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;ELEKTRONISCHES STANDKÜHLGERÄT MIT HOHEM LEISTUNGSVERMÖGEN&lt;/h4&gt;&lt;ul&gt;&lt;li&gt;Innenraumblende mit verschließbaren Ausströmern und Bedienelement ist von höchster Qualität.&lt;/li&gt;&lt;li&gt;Montage ohne das Bohren ins Dach der Fahrerkabine.&lt;/li&gt;&lt;li&gt;Internationale technische Unterstützung.&lt;/li&gt;&lt;/ul&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;ERMÖGLICHT EIN BESSERES ARBEITSKLIMA&amp;nbsp;&lt;br&gt;SCHÜTZT DEN FAHRZEUGMOTOR&lt;/h4&gt;&lt;p&gt;Die Kühlanlage arbeitet bei abgestelltem Fahrzeugmotor. Sie ermöglicht das Fahren und Rasten in einer angenehm gekühlter Fahrerkabine.&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Erhöht die Arbeitsleistung.&lt;/li&gt;&lt;li&gt;Verbessert den Arbeitskomfort.&lt;/li&gt;&lt;/ul&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;UMWELTFREUNDLICH&lt;/h4&gt;&lt;p&gt;Die Anlage braucht keinen Netzanschluß. Verbraucht nur Wasser.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;2 JAHRE GEWÄHRLEISTUNG&lt;/h4&gt;&lt;p&gt;Auf alle Bauteile.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;INTERNATIONALES SERVICENETZ&lt;/h4&gt;                                                                                                                        ', '', 'R-Evolution 24V ADR', '', '', '', '', '', '', '', ''),
(1439, 4, 'R-Evolution 24V ADR', '&lt;p&gt;A fülkére szerelhető Bycool R-EVOLUTION elektronikus hűtőegység kiegészíti az Ön járművének funkcionalitását a hőmérséklet csökkentésével a fülkében, ha ez szükséges. Tekintet nélkül arra, hogy jár-e a gépjármű motorja vagy sem, a hűtőegység dolgozik, és ezért főleg a kocsi ki és berakodása alkalmával lehet hasznos, vagy a szünetekben és a pihenőidőben.&lt;br&gt;Alacsony szerkezeti magasságának köszönhetően nem szükséges módosításokat végezni a gépjármű légterelőjén.&lt;br&gt;&lt;/p&gt;', '&lt;li&gt;12 és 24 Voltos kivitelben is&lt;/li&gt;&lt;li&gt;az összes funkció távirányítóval vezérelhető vagy egyenesen a berendezés vezérlőpaneljéről&lt;/li&gt;&lt;li&gt;a távirányítót nem kell a szenzorra irányítani, ezzel a sofőr elkerüli a vezetés közbeni felesleges figyelemmegosztást&lt;/li&gt;&lt;li&gt;aerodinamikus forma&lt;/li&gt;&lt;li&gt;két víztartály, egy külső tartály 35 liter kapacitással és egy beépítve a berendezésbe, túlcsordulás, illetve túltelítődés elleni védelemmel&lt;/li&gt;&lt;li&gt;motor:&lt;ul&gt;&lt;li&gt;kettős axiális ventilátor&lt;/li&gt;&lt;li&gt;24 V mellett alacsony elektromos fogyasztás (0,4 A-tól 4 A-ig)&lt;/li&gt;&lt;li&gt;légcirkuláció: 900 m3/óra&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;kapható ADR kivitelben is, veszélyes anyagok szállításához&lt;/li&gt;&lt;li&gt;méretek (SZ x H x M): 787 x 860 x 155 mm&lt;/li&gt;&lt;li&gt;csendes vízszivattyú&lt;/li&gt;&lt;li&gt;elektromos védelem&lt;/li&gt;&lt;li&gt;alacsony vízfogyasztás&lt;/li&gt;&lt;li&gt;minimális karbantartási igény&lt;/li&gt;&lt;li&gt;elektronikus, mikroprocesszoros irányítás&lt;ul&gt;&lt;li&gt;a ventilátor sebességének irányítására (8 sebesség)&lt;/li&gt;&lt;li&gt;a használati idő beprogramozására&lt;/li&gt;&lt;li&gt;a vízszint magasságának ellenőrzésére&lt;/li&gt;&lt;li&gt;a vízszivattyú működésének kijelzésére&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;a külső burkolat hőálló, UVA védelemmel ellátott műanyagból készült (ellenálló a mechanikus károsodásokkal szemben)&lt;/li&gt;', '                                                &lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;VEZETŐFÜLKÉK ELEKTRONIKUS HŰTŐEGYSÉGE&amp;nbsp;&lt;br&gt;MAXIMÁLIS TELJESÍTMÉNY - MINIMÁLIS FOGYASZTÁS – ALACSONYABB SZERKEZETI MAGASSÁG&lt;/h4&gt;&lt;p&gt;A fülkére szerelhető Bycool R-EVOLUTION elektronikus hűtőegység kiegészíti az Ön járművének funkcionalitását a hőmérséklet csökkentésével a fülkében, ha ez szükséges. Tekintet nélkül arra, hogy jár-e a gépjármű motorja vagy sem, a hűtőegység dolgozik, és ezért főleg a kocsi ki és berakodása alkalmával lehet hasznos, vagy a szünetekben és a pihenőidőben.&lt;br&gt;Alacsony szerkezeti magasságának köszönhetően nem szükséges módosításokat végezni a gépjármű légterelőjén.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;AZONNALI ÜZEMANYAG MEGTAKARÍTÁS&lt;/h4&gt;&lt;p&gt;NA független hűtőberendezés csak a jármű akkumulátorát használja energiaforrásként.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;NAGYTELJESÍTMÉNYŰ PÁROLOGTATÓS HŰTŐEGYSÉG&lt;/h4&gt;&lt;ul&gt;Kiváló minőségű belső irányító és elosztópanel. Felszerelés a jármű fülkéjének tetejének átfúrása nélkül. Nemzetközi műszaki támogatási hálózat.&lt;/ul&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;JAVÍTJA A SOFŐR MUNKAKÖRNYEZETÉT&amp;nbsp;&lt;br&gt;KÍMÉLI A JÁRMŰ MOTORJÁT&lt;/h4&gt;&lt;p&gt;A hűtőegység gépjármű leállított motorja mellett is dolgozik. Lehetővé teszi, hogy Ön kellemes hőmérsékleti viszonyok között vezessen vagy pihenjen a fülkében.&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Emeli a munkateljesítményt.&lt;/li&gt;&lt;li&gt;Javítja a munkakörülményeket.&lt;/li&gt;&lt;/ul&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;KÖRNYEZETBARÁT ÜZEMELÉS&lt;/h4&gt;&lt;p&gt;A berendezésnek nem kell külső energiaforráshoz kapcsolódnia. Csak minimális mennyiségű vizet fogyaszt.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;2 ÉV GARANCIA&lt;/h4&gt;&lt;p&gt;Az összes alkatrészre.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;NEMZETKÖZI SZERVIZHÁLÓZAT&lt;/h4&gt;                                                                                                                                                ', '', 'R-Evolution 24V ADR', '', '', '', '', '', '', '', ''),
(1440, 4, 'R-Evolution 12V', '&lt;p&gt;A fülkére szerelhető Bycool R-EVOLUTION elektronikus hűtőegység kiegészíti az Ön járművének funkcionalitását a hőmérséklet csökkentésével a fülkében, ha ez szükséges. Tekintet nélkül arra, hogy jár-e a gépjármű motorja vagy sem, a hűtőegység dolgozik, és ezért főleg a kocsi ki és berakodása alkalmával lehet hasznos, vagy a szünetekben és a pihenőidőben.&lt;br&gt;Alacsony szerkezeti magasságának köszönhetően nem szükséges módosításokat végezni a gépjármű légterelőjén.&lt;/p&gt;', '&lt;!-- TECH SPECS --&gt;\r\n&lt;li&gt;12 és 24 Voltos kivitelben is&lt;/li&gt;\r\n&lt;li&gt;az összes funkció távirányítóval vezérelhető vagy egyenesen a berendezés vezérlőpaneljéről&lt;/li&gt;\r\n&lt;li&gt;a távirányítót nem kell a szenzorra irányítani, ezzel a sofőr elkerüli a vezetés közbeni felesleges figyelemmegosztást&lt;/li&gt;\r\n&lt;li&gt;aerodinamikus forma&lt;/li&gt;\r\n&lt;li&gt;két víztartály, egy külső tartály 35 liter kapacitással és egy beépítve a berendezésbe, túlcsordulás, illetve túltelítődés elleni védelemmel&lt;/li&gt;\r\n&lt;li&gt;motor:\r\n	&lt;ul&gt;\r\n		&lt;li&gt;kettős axiális ventilátor&lt;/li&gt;\r\n		&lt;li&gt;24 V mellett alacsony elektromos fogyasztás (0,4 A-tól 4 A-ig)&lt;/li&gt;\r\n		&lt;li&gt;légcirkuláció: 900 m3/óra&lt;/li&gt;\r\n	&lt;/ul&gt;\r\n&lt;/li&gt;\r\n&lt;li&gt;kapható ADR kivitelben is, veszélyes anyagok szállításához&lt;/li&gt;\r\n&lt;li&gt;méretek (SZ x H x M): 787 x 860 x 155 mm&lt;/li&gt;\r\n&lt;li&gt;csendes vízszivattyú&lt;/li&gt;\r\n&lt;li&gt;elektromos védelem&lt;/li&gt;\r\n&lt;li&gt;alacsony vízfogyasztás&lt;/li&gt;\r\n&lt;li&gt;minimális karbantartási igény&lt;/li&gt;\r\n&lt;li&gt;elektronikus, mikroprocesszoros irányítás\r\n	&lt;ul&gt;\r\n		&lt;li&gt;a ventilátor sebességének irányítására (8 sebesség)&lt;/li&gt;\r\n		&lt;li&gt;a használati idő beprogramozására&lt;/li&gt;\r\n		&lt;li&gt;a vízszint magasságának ellenőrzésére&lt;/li&gt;\r\n		&lt;li&gt;a vízszivattyú működésének kijelzésére&lt;/li&gt;\r\n	&lt;/ul&gt;\r\n&lt;/li&gt;\r\n&lt;li&gt;a külső burkolat hőálló, UVA védelemmel ellátott műanyagból készült (ellenálló a mechanikus károsodásokkal szemben)&lt;/li&gt;', '                                                                        &lt;h4 style=&quot;color: #0e417a&quot;&gt;VEZETŐFÜLKÉK ELEKTRONIKUS HŰTŐEGYSÉGE &lt;br&gt;MAXIMÁLIS TELJESÍTMÉNY - MINIMÁLIS FOGYASZTÁS – ALACSONYABB SZERKEZETI MAGASSÁG&lt;/h4&gt;	\r\n&lt;p&gt;A fülkére szerelhető Bycool R-EVOLUTION elektronikus hűtőegység kiegészíti az Ön járművének funkcionalitását a hőmérséklet csökkentésével a fülkében, ha ez szükséges. Tekintet nélkül arra, hogy jár-e a gépjármű motorja vagy sem, a hűtőegység dolgozik, és ezért főleg a kocsi ki és berakodása alkalmával lehet hasznos, vagy a szünetekben és a pihenőidőben.&lt;br&gt;Alacsony szerkezeti magasságának köszönhetően nem szükséges módosításokat végezni a gépjármű légterelőjén.&lt;/p&gt;\r\n&lt;h4 style=&quot;color: #0e417a&quot;&gt;AZONNALI ÜZEMANYAG MEGTAKARÍTÁS&lt;/h4&gt;\r\n&lt;p&gt;NA független hűtőberendezés csak a jármű akkumulátorát használja energiaforrásként.&lt;/p&gt;\r\n&lt;h4 style=&quot;color: #0e417a&quot;&gt;NAGYTELJESÍTMÉNYŰ PÁROLOGTATÓS HŰTŐEGYSÉG&lt;/h4&gt;\r\n&lt;ul&gt;\r\n	Kiváló minőségű belső irányító és elosztópanel.\r\n	Felszerelés a jármű fülkéjének tetejének átfúrása nélkül.\r\n	Nemzetközi műszaki támogatási hálózat.\r\n&lt;/ul&gt;\r\n&lt;h4 style=&quot;color: #0e417a&quot;&gt;JAVÍTJA A SOFŐR MUNKAKÖRNYEZETÉT &lt;br&gt;KÍMÉLI A JÁRMŰ MOTORJÁT&lt;/h4&gt;\r\n&lt;p&gt;A hűtőegység gépjármű leállított motorja mellett is dolgozik. Lehetővé teszi, hogy Ön kellemes hőmérsékleti viszonyok között vezessen vagy pihenjen a fülkében.&lt;/p&gt;\r\n&lt;ul&gt;\r\n	&lt;li&gt;Emeli a munkateljesítményt.&lt;/li&gt;\r\n	&lt;li&gt;Javítja a munkakörülményeket.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;h4 style=&quot;color: #0e417a&quot;&gt;KÖRNYEZETBARÁT ÜZEMELÉS&lt;/h4&gt;\r\n&lt;p&gt;A berendezésnek nem kell külső energiaforráshoz kapcsolódnia. Csak minimális mennyiségű vizet fogyaszt.&lt;/p&gt;\r\n&lt;h4 style=&quot;color: #0e417a&quot;&gt;2 ÉV GARANCIA&lt;/h4&gt;\r\n&lt;p&gt;Az összes alkatrészre.&lt;/p&gt;\r\n&lt;h4 style=&quot;color: #0e417a&quot;&gt;NEMZETKÖZI SZERVIZHÁLÓZAT&lt;/h4&gt;                                                                        ', '', 'R-Evolution 12V', '', '', '', '', '', '', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `techspecs`, `highlights`, `tag`, `meta_title`, `meta_description`, `meta_keyword`, `custom_field_1_title`, `custom_field_1_content`, `custom_field_2_title`, `custom_field_2_content`, `custom_field_3_title`, `custom_field_3_content`) VALUES
(1442, 2, 'R-Evolution 24V špeciálna - upravená pre autobusy Karosa; DPP (nádrž Camper)', '&lt;p&gt;Elektronická chladiaca jednotka kabíny Bycool R-EVOLUTION dopĺňa funkcionalitu Vášho vozidla znižovaním teploty v kabíne keď je to potrebné. Chladiaca jednotka pracuje bez ohľadu na to, či beží motor vozidla alebo nie, a preto je určená na použitie najmä pri nakladaní a vykladaní vozidla, a na prestávky, na oddych. Vďaka nízkej konštrukčnej výške nie je nutné robiť zásahy do spojleru vozidla.&lt;br&gt;&lt;/p&gt;', '&lt;li&gt;prevedenia 12 aj 24 Volt&lt;/li&gt;&lt;li&gt;ovládanie všetkých funkcií diaľkovým ovládačom alebo priamo na ovládacom paneli zariadenia&lt;/li&gt;&lt;li&gt;nie je potrebné nasmerovať diaľkový ovládač na senzor, tým sa vodič vyhne zbytočnému rozptyľovaniu sa počas jazdy&lt;/li&gt;&lt;li&gt;aerodynamický tvar&lt;/li&gt;&lt;li&gt;dve nádrže na vodu, jedna vonkajšia nádrž s kapacitou 35 litrov a druhá zabudovaná do zariadenia s ochranou proti pretečeniu, resp. preplneniu&lt;/li&gt;&lt;li&gt;motor:&lt;ul&gt;&lt;li&gt;dvojitý axiálny ventilátor&lt;/li&gt;&lt;li&gt;nízky odber prúdu pri 24V (od 0,4A do 4A)&lt;/li&gt;&lt;li&gt;cirkulácia vzduchu: 900 m3/hod.&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;dodáva sa aj prevedenie ADR pre prepravu nebezpečného nákladu&lt;/li&gt;&lt;li&gt;rozmery (Š x D x V): 787 x 860 x 155 mm&lt;/li&gt;&lt;li&gt;nehlučné vodné čerpadlo&lt;/li&gt;&lt;li&gt;elektrická ochrana&lt;/li&gt;&lt;li&gt;nízka spotreba vody&lt;/li&gt;&lt;li&gt;minimálne nároky na údržbu&lt;/li&gt;&lt;li&gt;elektronický riadiaci microprocessor&lt;ul&gt;&lt;li&gt;s ovládaním rýchlosti ventilátora (8 rýchlostí)&lt;/li&gt;&lt;li&gt;s programovaním času používania&lt;/li&gt;&lt;li&gt;s kontrolou výšky hladiny vody&lt;/li&gt;&lt;li&gt;s indikáciou činnosti vodného čerpadla&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;vonkajší kryt z termoplastu s UVA ochranou (odolný voči mechanickému poškodeniu)&lt;/li&gt;', '                                                &lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;ELEKTRONICKÁ CHLADIACA JEDNOTKA KABÍNY&lt;br&gt;MAXIMÁLNY VÝKON - MINIMÁLNA SPOTREBA - NIŽŠIA KONŠTRUKČNÁ VÝŠKA&lt;/span&gt;&lt;/h4&gt;Elektronická chladiaca jednotka kabíny Bycool R-EVOLUTION dopĺňa funkcionalitu Vášho vozidla znižovaním teploty v kabíne keď je to potrebné. Chladiaca jednotka pracuje bez ohľadu na to, či beží motor vozidla alebo nie, a preto je určená na použitie najmä pri nakladaní a vykladaní vozidla, a na prestávky, na oddych.&amp;nbsp;&lt;br&gt;Vďaka nízkej konštrukčnej výške nie je nutné robiť zásahy do spojleru vozidla.&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;OKAMŽITÁ ÚSPORA PALIVA&lt;/span&gt;&lt;/h4&gt;Nezávislé chladiace zariadenia odoberá iba energiu z batérií vozidla.&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;VYSOKOVÝKONNÁ VÝPARNÍKOVÁ CHLADIACA JEDNOTKA&lt;/span&gt;&lt;/h4&gt;&lt;ul&gt;&lt;li&gt;Vnútorný riadiaci a distribučný panel vysokej kvality.&lt;/li&gt;&lt;li&gt;Inštalácia bez vŕtania dier do strechy kabíny vozidla.&lt;/li&gt;&lt;li&gt;Medzinárodná sieť technickej podpory.&lt;/li&gt;&lt;/ul&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;ZLEPŠUJE PRACOVNÉ PROSTREDIE VODIČA&lt;br&gt;ŠETRÍ MOTOR VOZIDLA&lt;/span&gt;&lt;/h4&gt;Chladiaca jednotka pracuje pri vypnutom motore vozidla. Umožňuje Vám šoférovať a oddychovať v kabíne v príjemných tepelných podmienkach.&lt;ul&gt;&lt;li&gt;Zvyšuje pracovný výkon.&lt;/li&gt;&lt;li&gt;Zlepšuje pracovný komfort.&lt;/li&gt;&lt;/ul&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;EKOLOGICKÁ PREVÁDZKA&lt;/span&gt;&lt;/h4&gt;Zariadenie nemusí byť pripojené k vonkajšiemu zdroju energie. Spotrebuje minimálne množstvo vody.&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;ZÁRUKA 2 ROKY&lt;/span&gt;&lt;/h4&gt;Na všetky diely.&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;MEDZINÁRODNÁ SERVISNÁ SIEŤ&lt;/span&gt;&lt;/h4&gt;                                                                                                                                                ', '', 'R-Evolution 24V špeciálna - upravená pre autobusy Karosa; DPP (nádrž Camper)', '', '', '', '', '', '', '', ''),
(1442, 1, 'R-Evolution 24V special - modified for KAROSA buses; DPP (with Camper water tank)', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '                                                                                                                                                                                                ', '', 'R-Evolution 24V special - modified for KAROSA buses; DPP (with Camper water tank)', '', '', '', '', '', '', '', ''),
(1442, 3, 'R-Evolution 24V special - für KAROSA-Busse modifiziert (mit Camper Wasserbehälter)', '&lt;p&gt;Die elektronische Standkühlanlage Bycool R-EVOLUTION senkt die Lufttemperatur in der Fahrerkabine immer dann, wenn es notwendig ist. Die Kühlananlage arbeitet ohne Fahrzeugmotor, kann aber auch während der Fahrt benuzt werden.Anwendungsbereich: Be- und Entladen des Fahrzeuges, Ruhe- und Schlafpausen.&lt;br&gt;Dank der niedrigen Aufbauhöhe ist diese Anlage auf jeder Fahrerkabine einzubauen.&lt;br&gt;&lt;/p&gt;', '&lt;li&gt;Ausführungen: 12 und 24 Volt&lt;/li&gt;&lt;li&gt;Steuerung aller Funktionen über die Fernbedienung durch Radiofrequenz (RF) oder über das elektronische Tastenfeld&lt;/li&gt;&lt;li&gt;der Sensor muss nicht angetastet werden, somit werden Ablenkungen während der Fahrt vermieden&lt;/li&gt;&lt;li&gt;aerodynamisches Design&lt;/li&gt;&lt;li&gt;zwei Wasserbehälter, ein externer 35 Liter - Tank zur Wasserversorgung und ein zweiter auslaufgeschützt im Gerät&lt;/li&gt;&lt;li&gt;Motor:&lt;ul&gt;&lt;li&gt;doppelter Axiallüfter&lt;/li&gt;&lt;li&gt;geringer Stromverbrauch bei 24V (von 0,4A bis 4A)&lt;/li&gt;&lt;li&gt;Luftdurchsatz: 900 m3/Std.&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;auch in ADR-Ausführung erhältlich (für den Transport gefährlicher Güter)&lt;/li&gt;&lt;li&gt;Abmessungen (B x L x H): 787 x 860 x 155 mm&lt;/li&gt;&lt;li&gt;geräuscharme Wasserpumpe&lt;/li&gt;&lt;li&gt;Unterspannungsschutz&lt;/li&gt;&lt;li&gt;geringer Wasserverbrauch&lt;/li&gt;&lt;li&gt;minimaler Wartungsaufwand&lt;/li&gt;&lt;li&gt;Mikroprozessor zur elektronischen Gerätesteuerung mit:&lt;ul&gt;&lt;li&gt;Gebläsedrehzahl 8-stufig regulierbar&lt;/li&gt;&lt;li&gt;programmierbare Zeitsteuerung&lt;/li&gt;&lt;li&gt;Wasserstandkontrolle&lt;/li&gt;&lt;li&gt;optische Anzeige der Wasserpumpenfunktion&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;externes Gehäuse in ABS mit UV-Schutz&lt;/li&gt;', '                                                &lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;ELEKTRONISCHE STANDKÜHLANLAGE FÜR NUTZFAHRZEUGE&lt;br&gt;MAXIMALE KÄLTELEISTUNG - MINIMALER STROMVERBRAUCH - NIEDRIGE AUFBAUHÖHE&lt;/h4&gt;&lt;p&gt;Die elektronische Standkühlanlage Bycool R-EVOLUTION senkt die Lufttemperatur in der Fahrerkabine immer dann, wenn es notwendig ist. Die Kühlananlage arbeitet ohne Fahrzeugmotor, kann aber auch während der Fahrt benuzt werden.Anwendungsbereich: Be- und Entladen des Fahrzeuges, Ruhe- und Schlafpausen.&lt;br&gt;Dank der niedrigen Aufbauhöhe ist diese Anlage auf jeder Fahrerkabine einzubauen.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;SOFORTIGE KRAFTSTOFFEINSPARUNG&lt;/h4&gt;&lt;p&gt;Dieses Standkühlgerät nimmt Energie von der Fahrzeugbatterie ab.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;ELEKTRONISCHES STANDKÜHLGERÄT MIT HOHEM LEISTUNGSVERMÖGEN&lt;/h4&gt;&lt;ul&gt;&lt;li&gt;Innenraumblende mit verschließbaren Ausströmern und Bedienelement ist von höchster Qualität.&lt;/li&gt;&lt;li&gt;Montage ohne das Bohren ins Dach der Fahrerkabine.&lt;/li&gt;&lt;li&gt;Internationale technische Unterstützung.&lt;/li&gt;&lt;/ul&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;ERMÖGLICHT EIN BESSERES ARBEITSKLIMA&amp;nbsp;&lt;br&gt;SCHÜTZT DEN FAHRZEUGMOTOR&lt;/h4&gt;&lt;p&gt;Die Kühlanlage arbeitet bei abgestelltem Fahrzeugmotor. Sie ermöglicht das Fahren und Rasten in einer angenehm gekühlter Fahrerkabine.&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Erhöht die Arbeitsleistung.&lt;/li&gt;&lt;li&gt;Verbessert den Arbeitskomfort.&lt;/li&gt;&lt;/ul&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;UMWELTFREUNDLICH&lt;/h4&gt;&lt;p&gt;Die Anlage braucht keinen Netzanschluß. Verbraucht nur Wasser.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;2 JAHRE GEWÄHRLEISTUNG&lt;/h4&gt;&lt;p&gt;Auf alle Bauteile.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;INTERNATIONALES SERVICENETZ&lt;/h4&gt;                                                                                                                                                ', '', 'R-Evolution 24V special - für KAROSA-Busse modifiziert (mit Camper Wasserbehälter)', '', '', '', '', '', '', '', ''),
(1442, 4, 'R-Evolution 24v speciális - átalakított KAROSA buszok (Camper víztartály)', '&lt;p&gt;A fülkére szerelhető Bycool R-EVOLUTION elektronikus hűtőegység kiegészíti az Ön járművének funkcionalitását a hőmérséklet csökkentésével a fülkében, ha ez szükséges. Tekintet nélkül arra, hogy jár-e a gépjármű motorja vagy sem, a hűtőegység dolgozik, és ezért főleg a kocsi ki és berakodása alkalmával lehet hasznos, vagy a szünetekben és a pihenőidőben.&lt;br&gt;Alacsony szerkezeti magasságának köszönhetően nem szükséges módosításokat végezni a gépjármű légterelőjén.&lt;br&gt;&lt;/p&gt;', '&lt;li&gt;12 és 24 Voltos kivitelben is&lt;/li&gt;&lt;li&gt;az összes funkció távirányítóval vezérelhető vagy egyenesen a berendezés vezérlőpaneljéről&lt;/li&gt;&lt;li&gt;a távirányítót nem kell a szenzorra irányítani, ezzel a sofőr elkerüli a vezetés közbeni felesleges figyelemmegosztást&lt;/li&gt;&lt;li&gt;aerodinamikus forma&lt;/li&gt;&lt;li&gt;két víztartály, egy külső tartály 35 liter kapacitással és egy beépítve a berendezésbe, túlcsordulás, illetve túltelítődés elleni védelemmel&lt;/li&gt;&lt;li&gt;motor:&lt;ul&gt;&lt;li&gt;kettős axiális ventilátor&lt;/li&gt;&lt;li&gt;24 V mellett alacsony elektromos fogyasztás (0,4 A-tól 4 A-ig)&lt;/li&gt;&lt;li&gt;légcirkuláció: 900 m3/óra&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;kapható ADR kivitelben is, veszélyes anyagok szállításához&lt;/li&gt;&lt;li&gt;méretek (SZ x H x M): 787 x 860 x 155 mm&lt;/li&gt;&lt;li&gt;csendes vízszivattyú&lt;/li&gt;&lt;li&gt;elektromos védelem&lt;/li&gt;&lt;li&gt;alacsony vízfogyasztás&lt;/li&gt;&lt;li&gt;minimális karbantartási igény&lt;/li&gt;&lt;li&gt;elektronikus, mikroprocesszoros irányítás&lt;ul&gt;&lt;li&gt;a ventilátor sebességének irányítására (8 sebesség)&lt;/li&gt;&lt;li&gt;a használati idő beprogramozására&lt;/li&gt;&lt;li&gt;a vízszint magasságának ellenőrzésére&lt;/li&gt;&lt;li&gt;a vízszivattyú működésének kijelzésére&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;a külső burkolat hőálló, UVA védelemmel ellátott műanyagból készült (ellenálló a mechanikus károsodásokkal szemben)&lt;/li&gt;', '                                                &lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;VEZETŐFÜLKÉK ELEKTRONIKUS HŰTŐEGYSÉGE&amp;nbsp;&lt;br&gt;MAXIMÁLIS TELJESÍTMÉNY - MINIMÁLIS FOGYASZTÁS – ALACSONYABB SZERKEZETI MAGASSÁG&lt;/h4&gt;&lt;p&gt;A fülkére szerelhető Bycool R-EVOLUTION elektronikus hűtőegység kiegészíti az Ön járművének funkcionalitását a hőmérséklet csökkentésével a fülkében, ha ez szükséges. Tekintet nélkül arra, hogy jár-e a gépjármű motorja vagy sem, a hűtőegység dolgozik, és ezért főleg a kocsi ki és berakodása alkalmával lehet hasznos, vagy a szünetekben és a pihenőidőben.&lt;br&gt;Alacsony szerkezeti magasságának köszönhetően nem szükséges módosításokat végezni a gépjármű légterelőjén.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;AZONNALI ÜZEMANYAG MEGTAKARÍTÁS&lt;/h4&gt;&lt;p&gt;NA független hűtőberendezés csak a jármű akkumulátorát használja energiaforrásként.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;NAGYTELJESÍTMÉNYŰ PÁROLOGTATÓS HŰTŐEGYSÉG&lt;/h4&gt;&lt;ul&gt;Kiváló minőségű belső irányító és elosztópanel. Felszerelés a jármű fülkéjének tetejének átfúrása nélkül. Nemzetközi műszaki támogatási hálózat.&lt;/ul&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;JAVÍTJA A SOFŐR MUNKAKÖRNYEZETÉT&amp;nbsp;&lt;br&gt;KÍMÉLI A JÁRMŰ MOTORJÁT&lt;/h4&gt;&lt;p&gt;A hűtőegység gépjármű leállított motorja mellett is dolgozik. Lehetővé teszi, hogy Ön kellemes hőmérsékleti viszonyok között vezessen vagy pihenjen a fülkében.&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Emeli a munkateljesítményt.&lt;/li&gt;&lt;li&gt;Javítja a munkakörülményeket.&lt;/li&gt;&lt;/ul&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;KÖRNYEZETBARÁT ÜZEMELÉS&lt;/h4&gt;&lt;p&gt;A berendezésnek nem kell külső energiaforráshoz kapcsolódnia. Csak minimális mennyiségű vizet fogyaszt.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;2 ÉV GARANCIA&lt;/h4&gt;&lt;p&gt;Az összes alkatrészre.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;NEMZETKÖZI SZERVIZHÁLÓZAT&lt;/h4&gt;                                                                                                                                                ', '', 'R-Evolution 24v speciális - átalakított KAROSA buszok (Camper víztartály)', '', '', '', '', '', '', '', ''),
(1441, 2, 'R-Evolution 24V špeciálna - upravená pre autobusy SOR (nádrž hranatá)', '&lt;p&gt;Elektronická chladiaca jednotka kabíny Bycool R-EVOLUTION dopĺňa funkcionalitu Vášho vozidla znižovaním teploty v kabíne keď je to potrebné. Chladiaca jednotka pracuje bez ohľadu na to, či beží motor vozidla alebo nie, a preto je určená na použitie najmä pri nakladaní a vykladaní vozidla, a na prestávky, na oddych. Vďaka nízkej konštrukčnej výške nie je nutné robiť zásahy do spojleru vozidla.&lt;br&gt;&lt;/p&gt;', '&lt;li&gt;prevedenia 12 aj 24 Volt&lt;/li&gt;&lt;li&gt;ovládanie všetkých funkcií diaľkovým ovládačom alebo priamo na ovládacom paneli zariadenia&lt;/li&gt;&lt;li&gt;nie je potrebné nasmerovať diaľkový ovládač na senzor, tým sa vodič vyhne zbytočnému rozptyľovaniu sa počas jazdy&lt;/li&gt;&lt;li&gt;aerodynamický tvar&lt;/li&gt;&lt;li&gt;dve nádrže na vodu, jedna vonkajšia nádrž s kapacitou 35 litrov a druhá zabudovaná do zariadenia s ochranou proti pretečeniu, resp. preplneniu&lt;/li&gt;&lt;li&gt;motor:&lt;ul&gt;&lt;li&gt;dvojitý axiálny ventilátor&lt;/li&gt;&lt;li&gt;nízky odber prúdu pri 24V (od 0,4A do 4A)&lt;/li&gt;&lt;li&gt;cirkulácia vzduchu: 900 m3/hod.&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;dodáva sa aj prevedenie ADR pre prepravu nebezpečného nákladu&lt;/li&gt;&lt;li&gt;rozmery (Š x D x V): 787 x 860 x 155 mm&lt;/li&gt;&lt;li&gt;nehlučné vodné čerpadlo&lt;/li&gt;&lt;li&gt;elektrická ochrana&lt;/li&gt;&lt;li&gt;nízka spotreba vody&lt;/li&gt;&lt;li&gt;minimálne nároky na údržbu&lt;/li&gt;&lt;li&gt;elektronický riadiaci microprocessor&lt;ul&gt;&lt;li&gt;s ovládaním rýchlosti ventilátora (8 rýchlostí)&lt;/li&gt;&lt;li&gt;s programovaním času používania&lt;/li&gt;&lt;li&gt;s kontrolou výšky hladiny vody&lt;/li&gt;&lt;li&gt;s indikáciou činnosti vodného čerpadla&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;vonkajší kryt z termoplastu s UVA ochranou (odolný voči mechanickému poškodeniu)&lt;/li&gt;', '                                                &lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;ELEKTRONICKÁ CHLADIACA JEDNOTKA KABÍNY&lt;br&gt;MAXIMÁLNY VÝKON - MINIMÁLNA SPOTREBA - NIŽŠIA KONŠTRUKČNÁ VÝŠKA&lt;/span&gt;&lt;/h4&gt;Elektronická chladiaca jednotka kabíny Bycool R-EVOLUTION dopĺňa funkcionalitu Vášho vozidla znižovaním teploty v kabíne keď je to potrebné. Chladiaca jednotka pracuje bez ohľadu na to, či beží motor vozidla alebo nie, a preto je určená na použitie najmä pri nakladaní a vykladaní vozidla, a na prestávky, na oddych.&amp;nbsp;&lt;br&gt;Vďaka nízkej konštrukčnej výške nie je nutné robiť zásahy do spojleru vozidla.&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;OKAMŽITÁ ÚSPORA PALIVA&lt;/span&gt;&lt;/h4&gt;Nezávislé chladiace zariadenia odoberá iba energiu z batérií vozidla.&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;VYSOKOVÝKONNÁ VÝPARNÍKOVÁ CHLADIACA JEDNOTKA&lt;/span&gt;&lt;/h4&gt;&lt;ul&gt;&lt;li&gt;Vnútorný riadiaci a distribučný panel vysokej kvality.&lt;/li&gt;&lt;li&gt;Inštalácia bez vŕtania dier do strechy kabíny vozidla.&lt;/li&gt;&lt;li&gt;Medzinárodná sieť technickej podpory.&lt;/li&gt;&lt;/ul&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;ZLEPŠUJE PRACOVNÉ PROSTREDIE VODIČA&lt;br&gt;ŠETRÍ MOTOR VOZIDLA&lt;/span&gt;&lt;/h4&gt;Chladiaca jednotka pracuje pri vypnutom motore vozidla. Umožňuje Vám šoférovať a oddychovať v kabíne v príjemných tepelných podmienkach.&lt;ul&gt;&lt;li&gt;Zvyšuje pracovný výkon.&lt;/li&gt;&lt;li&gt;Zlepšuje pracovný komfort.&lt;/li&gt;&lt;/ul&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;EKOLOGICKÁ PREVÁDZKA&lt;/span&gt;&lt;/h4&gt;Zariadenie nemusí byť pripojené k vonkajšiemu zdroju energie. Spotrebuje minimálne množstvo vody.&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;ZÁRUKA 2 ROKY&lt;/span&gt;&lt;/h4&gt;Na všetky diely.&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;MEDZINÁRODNÁ SERVISNÁ SIEŤ&lt;/span&gt;&lt;/h4&gt;                                                                                                ', '', 'R-Evolution 24V špeciálna - upravená pre autobusy SOR (nádrž hranatá)', '', '', '', '', '', '', '', ''),
(1441, 1, 'R-Evolution 24V special - modified for SOR buses (with square water tank)', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '                                                                                                                                                ', '', 'R-Evolution 24V special - modified for SOR buses (with square water tank)', '', '', '', '', '', '', '', ''),
(1441, 3, 'R-Evolution 24V special - für SOR-Busse modifiziert (mit quadratischen Wasserbehälter)', '&lt;p&gt;Die elektronische Standkühlanlage Bycool R-EVOLUTION senkt die Lufttemperatur in der Fahrerkabine immer dann, wenn es notwendig ist. Die Kühlananlage arbeitet ohne Fahrzeugmotor, kann aber auch während der Fahrt benuzt werden.Anwendungsbereich: Be- und Entladen des Fahrzeuges, Ruhe- und Schlafpausen.&lt;br&gt;Dank der niedrigen Aufbauhöhe ist diese Anlage auf jeder Fahrerkabine einzubauen.&lt;br&gt;&lt;/p&gt;', '&lt;li&gt;Ausführungen: 12 und 24 Volt&lt;/li&gt;&lt;li&gt;Steuerung aller Funktionen über die Fernbedienung durch Radiofrequenz (RF) oder über das elektronische Tastenfeld&lt;/li&gt;&lt;li&gt;der Sensor muss nicht angetastet werden, somit werden Ablenkungen während der Fahrt vermieden&lt;/li&gt;&lt;li&gt;aerodynamisches Design&lt;/li&gt;&lt;li&gt;zwei Wasserbehälter, ein externer 35 Liter - Tank zur Wasserversorgung und ein zweiter auslaufgeschützt im Gerät&lt;/li&gt;&lt;li&gt;Motor:&lt;ul&gt;&lt;li&gt;doppelter Axiallüfter&lt;/li&gt;&lt;li&gt;geringer Stromverbrauch bei 24V (von 0,4A bis 4A)&lt;/li&gt;&lt;li&gt;Luftdurchsatz: 900 m3/Std.&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;auch in ADR-Ausführung erhältlich (für den Transport gefährlicher Güter)&lt;/li&gt;&lt;li&gt;Abmessungen (B x L x H): 787 x 860 x 155 mm&lt;/li&gt;&lt;li&gt;geräuscharme Wasserpumpe&lt;/li&gt;&lt;li&gt;Unterspannungsschutz&lt;/li&gt;&lt;li&gt;geringer Wasserverbrauch&lt;/li&gt;&lt;li&gt;minimaler Wartungsaufwand&lt;/li&gt;&lt;li&gt;Mikroprozessor zur elektronischen Gerätesteuerung mit:&lt;ul&gt;&lt;li&gt;Gebläsedrehzahl 8-stufig regulierbar&lt;/li&gt;&lt;li&gt;programmierbare Zeitsteuerung&lt;/li&gt;&lt;li&gt;Wasserstandkontrolle&lt;/li&gt;&lt;li&gt;optische Anzeige der Wasserpumpenfunktion&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;externes Gehäuse in ABS mit UV-Schutz&lt;/li&gt;', '                                                &lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;ELEKTRONISCHE STANDKÜHLANLAGE FÜR NUTZFAHRZEUGE&lt;br&gt;MAXIMALE KÄLTELEISTUNG - MINIMALER STROMVERBRAUCH - NIEDRIGE AUFBAUHÖHE&lt;/h4&gt;&lt;p&gt;Die elektronische Standkühlanlage Bycool R-EVOLUTION senkt die Lufttemperatur in der Fahrerkabine immer dann, wenn es notwendig ist. Die Kühlananlage arbeitet ohne Fahrzeugmotor, kann aber auch während der Fahrt benuzt werden.Anwendungsbereich: Be- und Entladen des Fahrzeuges, Ruhe- und Schlafpausen.&lt;br&gt;Dank der niedrigen Aufbauhöhe ist diese Anlage auf jeder Fahrerkabine einzubauen.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;SOFORTIGE KRAFTSTOFFEINSPARUNG&lt;/h4&gt;&lt;p&gt;Dieses Standkühlgerät nimmt Energie von der Fahrzeugbatterie ab.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;ELEKTRONISCHES STANDKÜHLGERÄT MIT HOHEM LEISTUNGSVERMÖGEN&lt;/h4&gt;&lt;ul&gt;&lt;li&gt;Innenraumblende mit verschließbaren Ausströmern und Bedienelement ist von höchster Qualität.&lt;/li&gt;&lt;li&gt;Montage ohne das Bohren ins Dach der Fahrerkabine.&lt;/li&gt;&lt;li&gt;Internationale technische Unterstützung.&lt;/li&gt;&lt;/ul&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;ERMÖGLICHT EIN BESSERES ARBEITSKLIMA&amp;nbsp;&lt;br&gt;SCHÜTZT DEN FAHRZEUGMOTOR&lt;/h4&gt;&lt;p&gt;Die Kühlanlage arbeitet bei abgestelltem Fahrzeugmotor. Sie ermöglicht das Fahren und Rasten in einer angenehm gekühlter Fahrerkabine.&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Erhöht die Arbeitsleistung.&lt;/li&gt;&lt;li&gt;Verbessert den Arbeitskomfort.&lt;/li&gt;&lt;/ul&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;UMWELTFREUNDLICH&lt;/h4&gt;&lt;p&gt;Die Anlage braucht keinen Netzanschluß. Verbraucht nur Wasser.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;2 JAHRE GEWÄHRLEISTUNG&lt;/h4&gt;&lt;p&gt;Auf alle Bauteile.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;INTERNATIONALES SERVICENETZ&lt;/h4&gt;                                                                                                ', '', 'R-Evolution 24V special - für SOR-Busse modifiziert (mit quadratischen Wasserbehälter)', '', '', '', '', '', '', '', ''),
(1441, 4, 'R-Evolution 24v speciális - átalakított SOR buszok (négyzet alakú víztartály)', '&lt;p&gt;A fülkére szerelhető Bycool R-EVOLUTION elektronikus hűtőegység kiegészíti az Ön járművének funkcionalitását a hőmérséklet csökkentésével a fülkében, ha ez szükséges. Tekintet nélkül arra, hogy jár-e a gépjármű motorja vagy sem, a hűtőegység dolgozik, és ezért főleg a kocsi ki és berakodása alkalmával lehet hasznos, vagy a szünetekben és a pihenőidőben.&lt;br&gt;Alacsony szerkezeti magasságának köszönhetően nem szükséges módosításokat végezni a gépjármű légterelőjén.&lt;br&gt;&lt;/p&gt;', '&lt;li&gt;12 és 24 Voltos kivitelben is&lt;/li&gt;&lt;li&gt;az összes funkció távirányítóval vezérelhető vagy egyenesen a berendezés vezérlőpaneljéről&lt;/li&gt;&lt;li&gt;a távirányítót nem kell a szenzorra irányítani, ezzel a sofőr elkerüli a vezetés közbeni felesleges figyelemmegosztást&lt;/li&gt;&lt;li&gt;aerodinamikus forma&lt;/li&gt;&lt;li&gt;két víztartály, egy külső tartály 35 liter kapacitással és egy beépítve a berendezésbe, túlcsordulás, illetve túltelítődés elleni védelemmel&lt;/li&gt;&lt;li&gt;motor:&lt;ul&gt;&lt;li&gt;kettős axiális ventilátor&lt;/li&gt;&lt;li&gt;24 V mellett alacsony elektromos fogyasztás (0,4 A-tól 4 A-ig)&lt;/li&gt;&lt;li&gt;légcirkuláció: 900 m3/óra&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;kapható ADR kivitelben is, veszélyes anyagok szállításához&lt;/li&gt;&lt;li&gt;méretek (SZ x H x M): 787 x 860 x 155 mm&lt;/li&gt;&lt;li&gt;csendes vízszivattyú&lt;/li&gt;&lt;li&gt;elektromos védelem&lt;/li&gt;&lt;li&gt;alacsony vízfogyasztás&lt;/li&gt;&lt;li&gt;minimális karbantartási igény&lt;/li&gt;&lt;li&gt;elektronikus, mikroprocesszoros irányítás&lt;ul&gt;&lt;li&gt;a ventilátor sebességének irányítására (8 sebesség)&lt;/li&gt;&lt;li&gt;a használati idő beprogramozására&lt;/li&gt;&lt;li&gt;a vízszint magasságának ellenőrzésére&lt;/li&gt;&lt;li&gt;a vízszivattyú működésének kijelzésére&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;a külső burkolat hőálló, UVA védelemmel ellátott műanyagból készült (ellenálló a mechanikus károsodásokkal szemben)&lt;/li&gt;', '                                                &lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;VEZETŐFÜLKÉK ELEKTRONIKUS HŰTŐEGYSÉGE&amp;nbsp;&lt;br&gt;MAXIMÁLIS TELJESÍTMÉNY - MINIMÁLIS FOGYASZTÁS – ALACSONYABB SZERKEZETI MAGASSÁG&lt;/h4&gt;&lt;p&gt;A fülkére szerelhető Bycool R-EVOLUTION elektronikus hűtőegység kiegészíti az Ön járművének funkcionalitását a hőmérséklet csökkentésével a fülkében, ha ez szükséges. Tekintet nélkül arra, hogy jár-e a gépjármű motorja vagy sem, a hűtőegység dolgozik, és ezért főleg a kocsi ki és berakodása alkalmával lehet hasznos, vagy a szünetekben és a pihenőidőben.&lt;br&gt;Alacsony szerkezeti magasságának köszönhetően nem szükséges módosításokat végezni a gépjármű légterelőjén.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;AZONNALI ÜZEMANYAG MEGTAKARÍTÁS&lt;/h4&gt;&lt;p&gt;NA független hűtőberendezés csak a jármű akkumulátorát használja energiaforrásként.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;NAGYTELJESÍTMÉNYŰ PÁROLOGTATÓS HŰTŐEGYSÉG&lt;/h4&gt;&lt;ul&gt;Kiváló minőségű belső irányító és elosztópanel. Felszerelés a jármű fülkéjének tetejének átfúrása nélkül. Nemzetközi műszaki támogatási hálózat.&lt;/ul&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;JAVÍTJA A SOFŐR MUNKAKÖRNYEZETÉT&amp;nbsp;&lt;br&gt;KÍMÉLI A JÁRMŰ MOTORJÁT&lt;/h4&gt;&lt;p&gt;A hűtőegység gépjármű leállított motorja mellett is dolgozik. Lehetővé teszi, hogy Ön kellemes hőmérsékleti viszonyok között vezessen vagy pihenjen a fülkében.&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Emeli a munkateljesítményt.&lt;/li&gt;&lt;li&gt;Javítja a munkakörülményeket.&lt;/li&gt;&lt;/ul&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;KÖRNYEZETBARÁT ÜZEMELÉS&lt;/h4&gt;&lt;p&gt;A berendezésnek nem kell külső energiaforráshoz kapcsolódnia. Csak minimális mennyiségű vizet fogyaszt.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;2 ÉV GARANCIA&lt;/h4&gt;&lt;p&gt;Az összes alkatrészre.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;NEMZETKÖZI SZERVIZHÁLÓZAT&lt;/h4&gt;                                                                                                ', '', 'R-Evolution 24v speciális - átalakított SOR buszok (négyzet alakú víztartály)', '', '', '', '', '', '', '', ''),
