(1443, 2, 'Flat 12V Standard', '&lt;p&gt;Extra plochá strešná klimatizačná jednotka určená pre použitie na nákladných vozidlách vybavených spoilerom. Filter s aktívnym uhlím zabraňuje prenikaniu prachu, peľu a ostatných častíc do pracovného priestoru posádky vozidla. Určená je pre nákladné automobily, terénne automobily, žeriavy, stavebné a pracovné stroje.&lt;/p&gt;', '&lt;ul&gt;\r\n	&lt;li&gt;napätie 12V alebo 24V&lt;/li&gt;\r\n	&lt;li&gt;hmotnosť 14,8kg&lt;/li&gt;\r\n	&lt;li&gt;hlavné rozmery 818 x 718 x 135mm&lt;/li&gt;\r\n&lt;/ul&gt;', '                                                &lt;h4 style=&quot;color: #0e417a&quot;&gt;ELEKTRONICKÁ CHLADIACA JEDNOTKA KABÍNY&lt;/h4&gt;\r\n&lt;p&gt;Extra plochá strešná klimatizačná jednotka určená pre použitie na nákladných vozidlách vybavených spoilerom. Filter s aktívnym uhlím zabraňuje prenikaniu prachu, peľu a ostatných častíc do pracovného priestoru posádky vozidla. Určená je pre nákladné automobily, terénne automobily, žeriavy, stavebné a pracovné stroje.&lt;/p&gt;\r\n&lt;h4 style=&quot;color: #0e417a&quot;&gt;ZÁRUKA 2 ROKY&lt;/h4&gt;\r\n&lt;p&gt;Na všetky diely.&lt;/p&gt;\r\n&lt;h4 style=&quot;color: #0e417a&quot;&gt;MEDZINÁRODNÁ SERVISNÁ SIEŤ&lt;/h4&gt;                                                ', '', 'Flat 12V Standard', '', '', '', '', '', '', '', ''),
