(1444, 2, 'Flat 24V Standard', '&lt;p&gt;Extra plochá strešná klimatizačná jednotka určená pre použitie na nákladných vozidlách vybavených spoilerom. Filter s aktívnym uhlím zabraňuje prenikaniu prachu, peľu a ostatných častíc do pracovného priestoru posádky vozidla. Určená je pre nákladné automobily, terénne automobily, žeriavy, stavebné a pracovné stroje.&lt;br&gt;&lt;/p&gt;', '&lt;ul&gt;&lt;li&gt;napätie 12V alebo 24V&lt;/li&gt;&lt;li&gt;hmotnosť 14,8kg&lt;/li&gt;&lt;li&gt;hlavné rozmery 818 x 718 x 135mm&lt;/li&gt;&lt;/ul&gt;', '                        &lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;ELEKTRONICKÁ CHLADIACA JEDNOTKA KABÍNY&lt;/h4&gt;&lt;p&gt;Extra plochá strešná klimatizačná jednotka určená pre použitie na nákladných vozidlách vybavených spoilerom. Filter s aktívnym uhlím zabraňuje prenikaniu prachu, peľu a ostatných častíc do pracovného priestoru posádky vozidla. Určená je pre nákladné automobily, terénne automobily, žeriavy, stavebné a pracovné stroje.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;ZÁRUKA 2 ROKY&lt;/h4&gt;&lt;p&gt;Na všetky diely.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;MEDZINÁRODNÁ SERVISNÁ SIEŤ&lt;/h4&gt;                                                                        ', '', 'Flat 24V Standard', '', '', '', '', '', '', '', ''),
(1446, 2, 'Mochila 12V', '&lt;p&gt;Mochila je výparníková klimatizáčná jednotka určená pre montáž na zadnú stenu kabíny vozidla. Ideálna je najmä pre ochladzovanie kabíny počas oddychu a manipulácie s nákladom.&lt;/p&gt;', '&lt;li&gt;prevedenia 12 aj 24 Volt&lt;/li&gt;\r\n&lt;li&gt;ovládanie všetkých funkcií diaľkovým ovládačom alebo priamo na ovládacom paneli zariadenia&lt;/li&gt;\r\n&lt;li&gt;nie je potrebné nasmerovať diaľkový ovládač na senzor, tým sa vodič vyhne zbytočnému rozptyľovaniu sa počas jazdy&lt;/li&gt;\r\n&lt;li&gt;aerodynamický tvar&lt;/li&gt;\r\n&lt;li&gt;dve nádrže na vodu, jedna vonkajšia nádrž s kapacitou 35 litrov a druhá zabudovaná do zariadenia s ochranou proti pretečeniu, resp. preplneniu&lt;/li&gt;\r\n&lt;li&gt;v otvoroch nasávaného vzduchu sú osadené aktívne uhlíkové filtre, ktoré zabezpečujú, že vzduch vstupujúci do kabíny vozidla neobsahuje prach, peľ ani iné nežiaduce častice&lt;/li&gt;\r\n&lt;li&gt;motor:\r\n	&lt;ul&gt;\r\n		&lt;li&gt;dvojitý axiálny ventilátor&lt;/li&gt;\r\n		&lt;li&gt;nízky odber prúdu pri 24V (od 0,4 A do 4 A)&lt;/li&gt;\r\n		&lt;li&gt;cirkulácia vzduchu: 900 m3/hod.&lt;/li&gt;\r\n	&lt;/ul&gt;\r\n&lt;/li&gt;\r\n&lt;li&gt;dodáva sa aj prevedenie ADR pre prepravu nebezpečného nákladu&lt;/li&gt;\r\n&lt;li&gt;rozmery (Š x D x V): 150 x 832 x 496 mm &lt;/li&gt;\r\n&lt;li&gt;nehlučné vodné čerpadlo&lt;/li&gt;\r\n&lt;li&gt;elektrická ochrana&lt;/li&gt;\r\n&lt;li&gt;nízka spotreba vody&lt;/li&gt;\r\n&lt;li&gt;nenáročná údržba&lt;/li&gt;\r\n&lt;li&gt;elektronický riadiaci mikroprocesor\r\n	&lt;ul&gt;\r\n		&lt;li&gt;s ovládaním rýchlosti ventilátora&lt;/li&gt;\r\n		&lt;li&gt;s programovaním času používania&lt;/li&gt;\r\n		&lt;li&gt;s kontrolou výšky hladiny vody&lt;/li&gt;\r\n		&lt;li&gt;s indikáciou činnosti vodného čerpadla&lt;/li&gt;\r\n		&lt;li&gt;s akustickou signalizáciou&lt;/li&gt;\r\n	&lt;/ul&gt;\r\n&lt;/li&gt;', '                        &lt;p&gt;Mochila je výparníková klimatizáčná jednotka určená pre montáž na zadnú stenu kabíny vozidla. Ideálna je najmä pre ochladzovanie kabíny počas oddychu a manipulácie s nákladom.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;ZLEPŠUJE PRACOVNÉ PROSTREDIE VODIČA&lt;/h4&gt;&lt;p&gt;Aktívne uhlíkové filtre zabezpečujú, že vzduch vstupujúci do kabíny neobsahuje prach, peľ a iné nežiaduce častice.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;ŠETRÍ MOTOR VOZIDLA&lt;/h4&gt;&lt;p&gt;Chladiaca jednotka pracuje pri vypnutom motore vozidla. Umožňuje Vám šoférovať a oddychovať v kabíne v príjemných tepelných podmienkach.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;EKOLOGICKÁ PREVÁDZK&lt;/h4&gt;&lt;p&gt;Spotrebuje minimálne množstvo vody. Ohľaduplné k životnému prostrediu.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;VYSOKOVÝKONNÉ VÝPARNÍKOVÉ CHLADENIE&lt;/h4&gt;&lt;p&gt;Vhodné pre vozidlá, kde je požadovaná montáž na zadnú stenu kabíny. Úplné ovládanie všetkých funkcií diaľkovým ovládačom alebo priamo na ovládacom paneli zariadenia.&amp;nbsp;Vnútorný ovládací a distribučný panel veľmi vysokej kvality.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;ZÁRUKA 2 ROKY&lt;/h4&gt;&lt;p&gt;Na všetky diely.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;MEDZINÁRODNÁ SERVISNÁ SIEŤ&lt;/h4&gt;                        ', '', 'Mochila 12V', '', '', '', '', '', '', '', ''),
(1446, 1, 'Mochila 12V', '&lt;p&gt;Mochila is an evaporative cab cooler with maximum efficiency designed for vehicles that require a rear wall installation. It is ideal for cooling the cabin while resting or loading and unloading operations.&lt;/p&gt;', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '                        Mochila is an evaporative cab cooler with maximum efficiency designed for vehicles that require a rear wall installation. It is ideal for cooling the cabin while resting or loading and unloading operations.                                                                                                                        ', '', 'Mochila 12V', '', '', '', '', '', '', '', ''),
(1446, 3, 'Mochila 12V', '&lt;p&gt;Mochila ist ein leistungsstarkes Verdunstersystem zur Installation an der Rückwand der Kabine. Es ist ideal, um die Kabine während der Ruhezeiten oder bei Be- und Entladetätigkeiten zu kühlen.&lt;/p&gt;', '&lt;li&gt;Ausführungen: 12 und 24 Volt &lt;/li&gt;&lt;li&gt;Steuerung aller Funktionen über die Fernbedienung oder über das elektronische Tastenfeld&lt;/li&gt;&lt;li&gt;der Sensor muss nicht angetastet werden, somit werden Ablenkungen während der Fahrt vermieden&lt;/li&gt;&lt;li&gt;aerodynamisches Design&lt;/li&gt;&lt;li&gt;zwei Wasserbehälter, ein externer 35 Liter-Tank zur Wasserversrgung und ein zweiter auslaufgeschützt im Gerät&lt;/li&gt;&lt;li&gt;der Lufteintritt ist mit Aktivkohlefiltern ausgerüstet, der Arbeitsplatz bleibt frei von Schwebeteilchen wie Staub und Pollen&lt;/li&gt;&lt;li&gt;Motor:	&lt;ul&gt;		&lt;li&gt;doppelter Axiallüfter&lt;/li&gt;		&lt;li&gt;geringer Stromverbrauch bei 24V (von 0,4 A bis 4 A)&lt;/li&gt;		&lt;li&gt;Luftdurchsatz: 900 m3/Std.&lt;/li&gt;	&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;auch in ADR-Ausführung erhältlich (für den Transport gefährlicher Güter)&lt;/li&gt;&lt;li&gt;Abmessungen (B x L x H): 150 x 832 x 496 mm &lt;/li&gt;&lt;li&gt;geräuscharme Wasserpumpe&lt;/li&gt;&lt;li&gt;Unterspannungsschutz&lt;/li&gt;&lt;li&gt;geringer Wasserverbrauch&lt;/li&gt;&lt;li&gt;minimaler Wartungsaufwand&lt;/li&gt;&lt;li&gt;Mikroprozessor zur elektronischen Gerätesteuerung mit	&lt;ul&gt;		&lt;li&gt;Gebläsedrehzahl regulierbar&lt;/li&gt;		&lt;li&gt;programmierbare Zeitsteuerung&lt;/li&gt;		&lt;li&gt;Wasserstandkontrolle&lt;/li&gt;		&lt;li&gt;optische Anzeige der Wasserpumpenfunktion&lt;/li&gt;		&lt;li&gt;akkustischeAnzeige&lt;/li&gt;	&lt;/ul&gt;&lt;/li&gt;', '                        &lt;p&gt;Mochila ist ein leistungsstarkes Verdunstersystem zur Installation an der Rückwand der Kabine. Es ist ideal, um die Kabine während der Ruhezeiten oder bei Be- und Entladetätigkeiten zu kühlen.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;VERBESSERT DAS ARBEITSKLIMA&lt;/h4&gt;&lt;p&gt;Aktivkohlefilter rinigen die ins Fahrerhaus kommende Luft. Der Arbeitsplatz bleibt frei von Schwebeteilchen wie Staub und Pollen.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;SCHÜTZT DEN FAHRZEUGMOTOR&lt;/h4&gt;&lt;p&gt;Die Kühlanlage arbeitet bei abgestelltem Fahrzeugmotor. Sie ermöglicht das Fahren und Rasten in angenehm gekühlter Fahrerkabine.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;ÖKOLOGISCH&lt;/h4&gt;&lt;p&gt;Verbraucht nur Wasser. Umweltfreundlich.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;HOCHLEISTUNGSVERDAMPFERANALGE&lt;/h4&gt;&lt;p&gt;Für Fahrzeuge mit extrem hohen Fahrerhäusern und für Baumaschinen. Montage an die Kabinenrückwand. Alle Funktionen werden über die Fernbedienung oder die elektronische Tastatur gesteuert. Bedien- und Luftverteilungsarmatur sind in hoher Qualität gefertigt.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;2 JAHRE GEWÄHRLEISTUNG&lt;/h4&gt;&lt;p&gt;Auf alle Bauteile.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;INTERNATIONALES SERVICENETZ&lt;/h4&gt;                        ', '', 'Mochila 12V', '', '', '', '', '', '', '', ''),
(1446, 4, 'Mochila 12V', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '&lt;li&gt;12 és 24 Voltos kivitelben is&lt;/li&gt;&lt;li&gt;Az összes funkció távirányítóval vezérelhető vagy egyenesen a berendezés vezérlőpaneljéről&lt;/li&gt;&lt;li&gt;a távirányítót nem kell a szenzorra irányítani, ezzel a sofőr elkerüli a vezetés közbeni felesleges figyelemmegosztást&lt;/li&gt;&lt;li&gt;aerodinamikus forma&lt;/li&gt;&lt;li&gt;két víztartály, egy külső tartály 35 liter kapacitással és egy beépítve a berendezésbe, túlcsordulás, illetve túltelítődés elleni védelemmel&lt;/li&gt;&lt;li&gt;a légbeszívó nyílásokban aktívszenes szűrők találhatók, amelyek biztosítják, hogy a gépjármű fülkéjébe kerülő levegő ne tartalmazzon port, virágport vagy egyéb nem kívánatos részecskéket&lt;/li&gt;&lt;li&gt;motor:	&lt;ul&gt;		&lt;li&gt;kettős axiális ventilátor&lt;/li&gt;		&lt;li&gt;24 V mellett alacsony elektromos fogyasztás (0,4 A-tól 4 A-ig)&lt;/li&gt;		&lt;li&gt;légcirkuláció: 900 m3/óra&lt;/li&gt;	&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;kapható ADR kivitelben is, veszélyes anyagok szállításához&lt;/li&gt;&lt;li&gt;méretek (SZ x H x M): 150 x 832 x 496 mm&lt;/li&gt;&lt;li&gt;csendes vízszivattyú&lt;/li&gt;&lt;li&gt;elektromos védelem&lt;/li&gt;&lt;li&gt;alacsony vízfogyasztás&lt;/li&gt;&lt;li&gt;minimális karbantartási igény&lt;/li&gt;&lt;li&gt;elektronikus, mikroprocesszoros irányítás	&lt;ul&gt;		&lt;li&gt;a ventilátor sebességének irányítására&lt;/li&gt;		&lt;li&gt;a használati idő beprogramozására&lt;/li&gt;		&lt;li&gt;a vízszint magasságának ellenőrzésére&lt;/li&gt;		&lt;li&gt;a vízszivattyú működésének kijelzésére&lt;/li&gt;		&lt;li&gt;az akusztikai jelzőrendszer irányítására&lt;/li&gt;	&lt;/ul&gt;&lt;/li&gt;', '                                                &lt;h4 style=&quot;color: #0e417a&quot;&gt;JAVÍTJA A SOFŐR MUNKAKÖRNYEZETÉT&lt;/h4&gt;&lt;p&gt;Az aktív szénfilterek biztosítják, hogy a fülkébe kerülő levegő nem tartalmaz port, virágport és egyéb nemkívánatos részecskéket.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;KÍMÉLI A JÁRMŰ MOTORJÁT &lt;/h4&gt;&lt;p&gt;A hűtőegység gépjármű leállított motorja mellett is dolgozik. Lehetővé teszi, hogy Ön kellemes hőmérsékleti viszonyok között vezessen vagy pihenjen a fülkében.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;KÖRNYEZETBARÁT ÜZEMELÉS&lt;/h4&gt;&lt;p&gt;Csupán minimális mennyiségű vizet fogyaszt. Környezetbarát.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;NAGYTELJESÍTMÉNYŰ PÁROLOGTATÓS HŰTÉS&lt;/h4&gt;&lt;p&gt;Használható olyan gépjárműveken, melyek felépítése megköveteli a fülke hátsó oldalára történő felszerelést. Az összes funkció távirányítóval vezérelhető vagy egyenesen a berendezés vezérlőpaneljéről. Csúcsminőségű belső irányító és elosztópanel.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;2 ÉV GARANCIA&lt;/h4&gt;&lt;p&gt;Az összes alkatrészre.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;NEMZETKÖZI SZERVIZHÁLÓZAT&lt;/h4&gt;                                                ', '', 'Mochila 12V', '', '', '', '', '', '', '', ''),
(1445, 3, 'Mochila 24V', '&lt;p&gt;Mochila ist ein leistungsstarkes Verdunstersystem zur Installation an der Rückwand der Kabine. Es ist ideal, um die Kabine während der Ruhezeiten oder bei Be- und Entladetätigkeiten zu kühlen.&lt;/p&gt;', '&lt;li&gt;Ausführungen: 12 und 24 Volt&lt;/li&gt;&lt;li&gt;Steuerung aller Funktionen über die Fernbedienung oder über das elektronische Tastenfeld&lt;/li&gt;&lt;li&gt;der Sensor muss nicht angetastet werden, somit werden Ablenkungen während der Fahrt vermieden&lt;/li&gt;&lt;li&gt;aerodynamisches Design&lt;/li&gt;&lt;li&gt;zwei Wasserbehälter, ein externer 35 Liter-Tank zur Wasserversrgung und ein zweiter auslaufgeschützt im Gerät&lt;/li&gt;&lt;li&gt;der Lufteintritt ist mit Aktivkohlefiltern ausgerüstet, der Arbeitsplatz bleibt frei von Schwebeteilchen wie Staub und Pollen&lt;/li&gt;&lt;li&gt;Motor:&lt;ul&gt;&lt;li&gt;doppelter Axiallüfter&lt;/li&gt;&lt;li&gt;geringer Stromverbrauch bei 24V (von 0,4 A bis 4 A)&lt;/li&gt;&lt;li&gt;Luftdurchsatz: 900 m3/Std.&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;auch in ADR-Ausführung erhältlich (für den Transport gefährlicher Güter)&lt;/li&gt;&lt;li&gt;Abmessungen (B x L x H): 150 x 832 x 496 mm&lt;/li&gt;&lt;li&gt;geräuscharme Wasserpumpe&lt;/li&gt;&lt;li&gt;Unterspannungsschutz&lt;/li&gt;&lt;li&gt;geringer Wasserverbrauch&lt;/li&gt;&lt;li&gt;minimaler Wartungsaufwand&lt;/li&gt;&lt;li&gt;Mikroprozessor zur elektronischen Gerätesteuerung mit&lt;ul&gt;&lt;li&gt;Gebläsedrehzahl regulierbar&lt;/li&gt;&lt;li&gt;programmierbare Zeitsteuerung&lt;/li&gt;&lt;li&gt;Wasserstandkontrolle&lt;/li&gt;&lt;li&gt;optische Anzeige der Wasserpumpenfunktion&lt;/li&gt;&lt;li&gt;akkustischeAnzeige&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;', '                        &lt;p&gt;Mochila ist ein leistungsstarkes Verdunstersystem zur Installation an der Rückwand der Kabine. Es ist ideal, um die Kabine während der Ruhezeiten oder bei Be- und Entladetätigkeiten zu kühlen.&lt;/p&gt;\r\n&lt;h4 style=&quot;color: rgb(14, 65, 122);&quot;&gt;VERBESSERT DAS ARBEITSKLIMA&lt;/h4&gt;\r\n&lt;p&gt;Aktivkohlefilter rinigen die ins Fahrerhaus kommende Luft. Der Arbeitsplatz bleibt frei von Schwebeteilchen wie Staub und Pollen.&lt;/p&gt;\r\n&lt;h4 style=&quot;color: rgb(14, 65, 122);&quot;&gt;SCHÜTZT DEN FAHRZEUGMOTOR&lt;/h4&gt;\r\n&lt;p&gt;Die Kühlanlage arbeitet bei abgestelltem Fahrzeugmotor. Sie ermöglicht das Fahren und Rasten in angenehm gekühlter Fahrerkabine.&lt;/p&gt;\r\n&lt;h4 style=&quot;color: rgb(14, 65, 122);&quot;&gt;ÖKOLOGISCH&lt;/h4&gt;\r\n&lt;p&gt;Verbraucht nur Wasser. Umweltfreundlich.&lt;/p&gt;\r\n&lt;h4 style=&quot;color: rgb(14, 65, 122);&quot;&gt;HOCHLEISTUNGSVERDAMPFERANALGE&lt;/h4&gt;\r\n&lt;p&gt;Für Fahrzeuge mit extrem hohen Fahrerhäusern und für Baumaschinen. Montage an die Kabinenrückwand. Alle Funktionen werden über die Fernbedienung oder die elektronische Tastatur gesteuert. Bedien- und Luftverteilungsarmatur sind in hoher Qualität gefertigt.&lt;/p&gt;\r\n&lt;h4 style=&quot;color: rgb(14, 65, 122);&quot;&gt;2 JAHRE GEWÄHRLEISTUNG&lt;/h4&gt;\r\n&lt;p&gt;Auf alle Bauteile.&lt;/p&gt;\r\n&lt;h4 style=&quot;color: rgb(14, 65, 122);&quot;&gt;INTERNATIONALES SERVICENETZ&lt;/h4&gt;                        ', '', 'Mochila 24V', '', '', '', '', '', '', '', ''),
(1445, 2, 'Mochila 24V', '&lt;p&gt;Mochila je výparníková klimatizáčná jednotka určená pre montáž na zadnú stenu kabíny vozidla. Ideálna je najmä pre ochladzovanie kabíny počas oddychu a manipulácie s nákladom.&lt;/p&gt;', '&lt;li&gt;prevedenia 12 aj 24 Volt&lt;/li&gt;&lt;li&gt;ovládanie všetkých funkcií diaľkovým ovládačom alebo priamo na ovládacom paneli zariadenia&lt;/li&gt;&lt;li&gt;nie je potrebné nasmerovať diaľkový ovládač na senzor, tým sa vodič vyhne zbytočnému rozptyľovaniu sa počas jazdy&lt;/li&gt;&lt;li&gt;aerodynamický tvar&lt;/li&gt;&lt;li&gt;dve nádrže na vodu, jedna vonkajšia nádrž s kapacitou 35 litrov a druhá zabudovaná do zariadenia s ochranou proti pretečeniu, resp. preplneniu&lt;/li&gt;&lt;li&gt;v otvoroch nasávaného vzduchu sú osadené aktívne uhlíkové filtre, ktoré zabezpečujú, že vzduch vstupujúci do kabíny vozidla neobsahuje prach, peľ ani iné nežiaduce častice&lt;/li&gt;&lt;li&gt;motor:&lt;ul&gt;&lt;li&gt;dvojitý axiálny ventilátor&lt;/li&gt;&lt;li&gt;nízky odber prúdu pri 24V (od 0,4 A do 4 A)&lt;/li&gt;&lt;li&gt;cirkulácia vzduchu: 900 m3/hod.&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;dodáva sa aj prevedenie ADR pre prepravu nebezpečného nákladu&lt;/li&gt;&lt;li&gt;rozmery (Š x D x V): 150 x 832 x 496 mm&lt;/li&gt;&lt;li&gt;nehlučné vodné čerpadlo&lt;/li&gt;&lt;li&gt;elektrická ochrana&lt;/li&gt;&lt;li&gt;nízka spotreba vody&lt;/li&gt;&lt;li&gt;nenáročná údržba&lt;/li&gt;&lt;li&gt;elektronický riadiaci mikroprocesor&lt;ul&gt;&lt;li&gt;s ovládaním rýchlosti ventilátora&lt;/li&gt;&lt;li&gt;s programovaním času používania&lt;/li&gt;&lt;li&gt;s kontrolou výšky hladiny vody&lt;/li&gt;&lt;li&gt;s indikáciou činnosti vodného čerpadla&lt;/li&gt;&lt;li&gt;s akustickou signalizáciou&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;', '                        Mochila je výparníková klimatizáčná jednotka určená pre montáž na zadnú stenu kabíny vozidla. Ideálna je najmä pre ochladzovanie kabíny počas oddychu a manipulácie s nákladom.&lt;h4 style=&quot;color: rgb(14, 65, 122);&quot;&gt;ZLEPŠUJE PRACOVNÉ PROSTREDIE VODIČA&lt;/h4&gt;&lt;p&gt;Aktívne uhlíkové filtre zabezpečujú, že vzduch vstupujúci do kabíny neobsahuje prach, peľ a iné nežiaduce častice.&lt;/p&gt;&lt;h4 style=&quot;color: rgb(14, 65, 122);&quot;&gt;ŠETRÍ MOTOR VOZIDLA&lt;/h4&gt;&lt;p&gt;Chladiaca jednotka pracuje pri vypnutom motore vozidla. Umožňuje Vám šoférovať a oddychovať v kabíne v príjemných tepelných podmienkach.&lt;/p&gt;&lt;h4 style=&quot;color: rgb(14, 65, 122);&quot;&gt;EKOLOGICKÁ PREVÁDZK&lt;/h4&gt;&lt;p&gt;Spotrebuje minimálne množstvo vody. Ohľaduplné k životnému prostrediu.&lt;/p&gt;&lt;h4 style=&quot;color: rgb(14, 65, 122);&quot;&gt;VYSOKOVÝKONNÉ VÝPARNÍKOVÉ CHLADENIE&lt;/h4&gt;&lt;p&gt;Vhodné pre vozidlá, kde je požadovaná montáž na zadnú stenu kabíny. Úplné ovládanie všetkých funkcií diaľkovým ovládačom alebo priamo na ovládacom paneli zariadenia.&amp;nbsp;Vnútorný ovládací a distribučný panel veľmi vysokej kvality.&lt;/p&gt;&lt;h4 style=&quot;color: rgb(14, 65, 122);&quot;&gt;ZÁRUKA 2 ROKY&lt;/h4&gt;&lt;p&gt;Na všetky diely.&lt;/p&gt;&lt;h4 style=&quot;color: rgb(14, 65, 122);&quot;&gt;MEDZINÁRODNÁ SERVISNÁ SIEŤ&lt;/h4&gt;                        ', '', 'Mochila 24V', '', '', '', '', '', '', '', ''),
(1445, 1, 'Mochila 24V', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '                                                                                                                                                                                                                                                ', '', 'Mochila 24V', '', '', '', '', '', '', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `techspecs`, `highlights`, `tag`, `meta_title`, `meta_description`, `meta_keyword`, `custom_field_1_title`, `custom_field_1_content`, `custom_field_2_title`, `custom_field_2_content`, `custom_field_3_title`, `custom_field_3_content`) VALUES
(1448, 4, 'Camper 12V', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '&lt;li&gt;12 és 24 Voltos kivitelben is&lt;/li&gt;&lt;li&gt;Az összes funkció távirányítóval vezérelhető vagy egyenesen a berendezés vezérlőpaneljéről&lt;/li&gt;&lt;li&gt;a távirányítót nem kell a szenzorra irányítani, ezzel a sofőr elkerüli a vezetés közbeni felesleges figyelemmegosztást&lt;/li&gt;&lt;li&gt;aerodinamikus forma&lt;/li&gt;&lt;li&gt;két víztartály, egyik beépítve a berendezésbe, ellátva túlcsordulás, illetve túltelítődés elleni védelemmel és egy másik, 20 l kapacitással, elrejtve a burkolat mögött, összekötve a gépjármű központi víztartályával&lt;/li&gt;&lt;li&gt;motor:	&lt;ul&gt;		&lt;li&gt;kettős axiális ventilátor&lt;/li&gt;		&lt;li&gt;alacsony elektromos fogyasztás 12V (0,8 A-tól 8 A-ig)&lt;/li&gt;		&lt;li&gt;légcirkuláció: 900m3 /óra&lt;/li&gt;	&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;méretek (SZ x H x M): 790 x 860 x 220 mm&lt;/li&gt;&lt;li&gt;a víztartály méretei (SZ x H x M): 360 x 200 x 330 mm&lt;/li&gt;&lt;li&gt;csendes vízszivattyú&lt;/li&gt;&lt;li&gt;elektromos védelem&lt;/li&gt;&lt;li&gt;alacsony vízfogyasztás&lt;/li&gt;&lt;li&gt;minimális karbantartási igény&lt;/li&gt;&lt;li&gt;elektronikus, mikroprocesszoros irányítás	&lt;ul&gt;		&lt;li&gt;a ventilátor sebességének irányítására&lt;/li&gt;		&lt;li&gt;a használati idő beprogramozására&lt;/li&gt;		&lt;li&gt;a vízszint magasságának ellenőrzésére&lt;/li&gt;		&lt;li&gt;a vízszivattyú működésének kijelzésére&lt;/li&gt;	&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;a tetőegység átfesthető a jármű színére&lt;/li&gt;', '                                                                                                                                                                                                &lt;h4 style=&quot;color: #0e417a&quot;&gt;ÓVJA A GÉPJÁRMŰ MOTORJÁT&lt;/h4&gt;&lt;p&gt;A hűtőegység gépjármű leállított motorja mellett is dolgozik. Alkalmas a megállók alatti használatra, kivéve a kempingekben, ahol lehetőség van a 230 V-ra történő csatlakoztatásra.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;KÖRNYEZETBARÁT BERENDEZÉS&lt;/h4&gt;&lt;p&gt;A berendezésnek nem kell külső energiaforráshoz kapcsolódnia. Csak minimális mennyiségű vizet fogyaszt.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;NAGYTELJESÍTMÉNYŰ PÁROLOGTATÓS HŰTÉS&lt;/h4&gt;&lt;p&gt;Az összes funkció távirányítóval vezérelhető vagy egyenesen a berendezés vezérlőpaneljéről. Csúcsminőségű belső irányító és elosztópanel.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;BIZTONSÁG&lt;/h4&gt;&lt;p&gt;Beépített riasztóval - a raktér biztosítására szolgáló modul mint opció.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;2 ÉV GARANCIA&lt;/h4&gt;&lt;p&gt;Az összes alkatrészre.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;NEMZETKÖZI SZERVIZHÁLÓZAT&lt;/h4&gt;                                                                                                                                                                                                ', '', 'Camper 12V', '', '', '', '                                                                                                &lt;p&gt;&lt;br&gt;&lt;/p&gt;                                                                                        ', '', '                                                                                                &lt;p&gt;&lt;br&gt;&lt;/p&gt;                                                                                        ', '', '                                                                                                &lt;p&gt;&lt;br&gt;&lt;/p&gt;                                                                                        '),
(1447, 4, 'Camper 24V', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '&lt;li&gt;12 és 24 Voltos kivitelben is&lt;/li&gt;&lt;li&gt;Az összes funkció távirányítóval vezérelhető vagy egyenesen a berendezés vezérlőpaneljéről&lt;/li&gt;&lt;li&gt;a távirányítót nem kell a szenzorra irányítani, ezzel a sofőr elkerüli a vezetés közbeni felesleges figyelemmegosztást&lt;/li&gt;&lt;li&gt;aerodinamikus forma&lt;/li&gt;&lt;li&gt;két víztartály, egyik beépítve a berendezésbe, ellátva túlcsordulás, illetve túltelítődés elleni védelemmel és egy másik, 20 l kapacitással, elrejtve a burkolat mögött, összekötve a gépjármű központi víztartályával&lt;/li&gt;&lt;li&gt;motor:	&lt;ul&gt;		&lt;li&gt;kettős axiális ventilátor&lt;/li&gt;		&lt;li&gt;alacsony elektromos fogyasztás 12V (0,8 A-tól 8 A-ig)&lt;/li&gt;		&lt;li&gt;légcirkuláció: 900m3 /óra&lt;/li&gt;	&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;méretek (SZ x H x M): 790 x 860 x 220 mm&lt;/li&gt;&lt;li&gt;a víztartály méretei (SZ x H x M): 360 x 200 x 330 mm&lt;/li&gt;&lt;li&gt;csendes vízszivattyú&lt;/li&gt;&lt;li&gt;elektromos védelem&lt;/li&gt;&lt;li&gt;alacsony vízfogyasztás&lt;/li&gt;&lt;li&gt;minimális karbantartási igény&lt;/li&gt;&lt;li&gt;elektronikus, mikroprocesszoros irányítás	&lt;ul&gt;		&lt;li&gt;a ventilátor sebességének irányítására&lt;/li&gt;		&lt;li&gt;a használati idő beprogramozására&lt;/li&gt;		&lt;li&gt;a vízszint magasságának ellenőrzésére&lt;/li&gt;		&lt;li&gt;a vízszivattyú működésének kijelzésére&lt;/li&gt;	&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;a tetőegység átfesthető a jármű színére&lt;/li&gt;', '                                                                                                                                                                                                                                                &lt;h4 style=&quot;color: #0e417a&quot;&gt;ÓVJA A GÉPJÁRMŰ MOTORJÁT&lt;/h4&gt;&lt;p&gt;A hűtőegység gépjármű leállított motorja mellett is dolgozik. Alkalmas a megállók alatti használatra, kivéve a kempingekben, ahol lehetőség van a 230 V-ra történő csatlakoztatásra.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;KÖRNYEZETBARÁT BERENDEZÉS&lt;/h4&gt;&lt;p&gt;A berendezésnek nem kell külső energiaforráshoz kapcsolódnia. Csak minimális mennyiségű vizet fogyaszt.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;NAGYTELJESÍTMÉNYŰ PÁROLOGTATÓS HŰTÉS&lt;/h4&gt;&lt;p&gt;Az összes funkció távirányítóval vezérelhető vagy egyenesen a berendezés vezérlőpaneljéről. Csúcsminőségű belső irányító és elosztópanel.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;BIZTONSÁG&lt;/h4&gt;&lt;p&gt;Beépített riasztóval - a raktér biztosítására szolgáló modul mint opció.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;2 ÉV GARANCIA&lt;/h4&gt;&lt;p&gt;Az összes alkatrészre.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;NEMZETKÖZI SZERVIZHÁLÓZAT&lt;/h4&gt;                                                                                                                                                                                                                                                ', '', 'Camper 24V', '', '', '', '                                                                                                                                                                                                                                      ', '', '                                                                                                                                                                                                                                      ', '', '                                                                                                                                                                                                                                      '),
(1447, 3, 'Camper 24V', '&lt;p&gt;Camper ist ein hochleistungsfähiges Verdunstersystem, das perfekt für Wohnmobile und andere Freizeitfahrzeuge geeignet ist.&lt;/p&gt;', '&lt;li&gt;Ausführungen: 12 und 24 Volt &lt;/li&gt;&lt;li&gt;Steuerung aller Funktionen über die Fernbedienung oder über das elektronische Tastenfeld&lt;/li&gt;&lt;li&gt;der Sensor muss nicht angetastet werden, somit werden Ablenkungen während der Fahrt vermieden&lt;/li&gt;&lt;li&gt;aerodynamisches Design&lt;/li&gt;&lt;li&gt;zwei Wasserbehälter, ein interner Tank im Gerät, auslaufgeschützt, ein zweiter 20 Liter-Tank hinter Verkleidung versteckt und mit dem Wassertank im Fahrzeug verbunden&lt;/li&gt;&lt;li&gt;Motor:	&lt;ul&gt;		&lt;li&gt;doppelter Axiallüfter&lt;/li&gt;		&lt;li&gt;geringer Stromverbrauch bei 12V (von 0,8A bis 8A)&lt;/li&gt;		&lt;li&gt;Luftdurchsatz: 900m3 /Std.&lt;/li&gt;	&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;Abmessungen (B x L x H): 790 x 860 x 220 mm&lt;/li&gt;&lt;li&gt;Abmessungen, Wassertank (B x L x H): 360 x 200 x 330 mm&lt;/li&gt;&lt;li&gt;geräuscharme Wasserpumpe&lt;/li&gt;&lt;li&gt;Unterspannungsschutz&lt;/li&gt;&lt;li&gt;geringer Wasserverbrauch&lt;/li&gt;&lt;li&gt;minimaler Wartungsaufwand&lt;/li&gt;&lt;li&gt;Mikroprozessor zur elektronischen Gerätesteuerung mit:	&lt;ul&gt;		&lt;li&gt;Gebläsedrehzahl regulierbar&lt;/li&gt;		&lt;li&gt;programmierbare Zeitsteuerung&lt;/li&gt;		&lt;li&gt;Wasserstandkontrolle&lt;/li&gt;		&lt;li&gt;optische Anzeige der Wasserpumpenfunktion&lt;/li&gt;	&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;lackierbar in jeder Fahrzeugfarbe&lt;/li&gt;', '                                                                                                                                                                                                                                                &lt;h4 style=&quot;color: #0e417a&quot;&gt;SCHÜTZT DEN FAHRZEUGMOTOR&lt;/h4&gt;&lt;p&gt;Die Kühlanlage arbeitet bei abgestelltem Fahrzeugmotor und eignet sich deshalb für einen Halt außerhalb von Campingplätzen.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;ÖKOLOGISCH&lt;/h4&gt;&lt;p&gt;Die Anlage braucht keinen Netzanschluß. Verbraucht nur Wasser.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;HOCHLEISTUNGSKÜHLANLAGE&lt;/h4&gt;&lt;p&gt;Alle Funktionen werden über die Fernbedienung oder die elektronische Tastatur gesteuert. Bedien- und Luftverteilungsarmatur sind in hoher Qualität gefertigt.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;SICHERHEIT&lt;/h4&gt;&lt;p&gt;Mit integrierter Alarmanlage - Modul zur Sicherung des Frachtraumes als Option.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;2 JAHRE GEWÄHRLEISTUNG&lt;/h4&gt;&lt;p&gt;Auf alle Bauteile.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;INTERNATIONALES SERVICENETZ&lt;/h4&gt;                                                                                                                                                                                                                                                ', '', 'Camper 24V', '', '', '', '                                                                                                                                                                                                                                      ', '', '                                                                                                                                                                                                                                      ', '', '                                                                                                                                                                                                                                      '),
(1445, 4, 'Mochila 24V', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '&lt;li&gt;12 és 24 Voltos kivitelben is&lt;/li&gt;&lt;li&gt;Az összes funkció távirányítóval vezérelhető vagy egyenesen a berendezés vezérlőpaneljéről&lt;/li&gt;&lt;li&gt;a távirányítót nem kell a szenzorra irányítani, ezzel a sofőr elkerüli a vezetés közbeni felesleges figyelemmegosztást&lt;/li&gt;&lt;li&gt;aerodinamikus forma&lt;/li&gt;&lt;li&gt;két víztartály, egy külső tartály 35 liter kapacitással és egy beépítve a berendezésbe, túlcsordulás, illetve túltelítődés elleni védelemmel&lt;/li&gt;&lt;li&gt;a légbeszívó nyílásokban aktívszenes szűrők találhatók, amelyek biztosítják, hogy a gépjármű fülkéjébe kerülő levegő ne tartalmazzon port, virágport vagy egyéb nem kívánatos részecskéket&lt;/li&gt;&lt;li&gt;motor:&lt;ul&gt;&lt;li&gt;kettős axiális ventilátor&lt;/li&gt;&lt;li&gt;24 V mellett alacsony elektromos fogyasztás (0,4 A-tól 4 A-ig)&lt;/li&gt;&lt;li&gt;légcirkuláció: 900 m3/óra&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;kapható ADR kivitelben is, veszélyes anyagok szállításához&lt;/li&gt;&lt;li&gt;méretek (SZ x H x M): 150 x 832 x 496 mm&lt;/li&gt;&lt;li&gt;csendes vízszivattyú&lt;/li&gt;&lt;li&gt;elektromos védelem&lt;/li&gt;&lt;li&gt;alacsony vízfogyasztás&lt;/li&gt;&lt;li&gt;minimális karbantartási igény&lt;/li&gt;&lt;li&gt;elektronikus, mikroprocesszoros irányítás&lt;ul&gt;&lt;li&gt;a ventilátor sebességének irányítására&lt;/li&gt;&lt;li&gt;a használati idő beprogramozására&lt;/li&gt;&lt;li&gt;a vízszint magasságának ellenőrzésére&lt;/li&gt;&lt;li&gt;a vízszivattyú működésének kijelzésére&lt;/li&gt;&lt;li&gt;az akusztikai jelzőrendszer irányítására&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;', '                                                                                                &lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;JAVÍTJA A SOFŐR MUNKAKÖRNYEZETÉT&lt;/h4&gt;&lt;p&gt;Az aktív szénfilterek biztosítják, hogy a fülkébe kerülő levegő nem tartalmaz port, virágport és egyéb nemkívánatos részecskéket.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;KÍMÉLI A JÁRMŰ MOTORJÁT&lt;/h4&gt;&lt;p&gt;A hűtőegység gépjármű leállított motorja mellett is dolgozik. Lehetővé teszi, hogy Ön kellemes hőmérsékleti viszonyok között vezessen vagy pihenjen a fülkében.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;KÖRNYEZETBARÁT ÜZEMELÉS&lt;/h4&gt;&lt;p&gt;Csupán minimális mennyiségű vizet fogyaszt. Környezetbarát.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;NAGYTELJESÍTMÉNYŰ PÁROLOGTATÓS HŰTÉS&lt;/h4&gt;&lt;p&gt;Használható olyan gépjárműveken, melyek felépítése megköveteli a fülke hátsó oldalára történő felszerelést. Az összes funkció távirányítóval vezérelhető vagy egyenesen a berendezés vezérlőpaneljéről. Csúcsminőségű belső irányító és elosztópanel.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;2 ÉV GARANCIA&lt;/h4&gt;&lt;p&gt;Az összes alkatrészre.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;NEMZETKÖZI SZERVIZHÁLÓZAT&lt;/h4&gt;                                                                                                                                                ', '', 'Mochila 24V', '', '', '', '', '', '', '', ''),
(1454, 1, 'Compact 24V 1,4kW Standard with Cubi-Gel compressor', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '                                                                                                                                                                                                                                                ', '', 'Compact 24V 1,4kW Standard with Cubi-Gel compressor', '', '', '', '', '', '', '', ''),
(1454, 2, 'Compact 24V 1,4kW Standard s Cubi-Gel kompresorom', '&lt;p&gt;Model MiniCool COMPACT je klimatizačná jednotka určená pre použitie v noci. Pracuje s dvomi kompresormi, ďalej má dva nezávislé chladiace okruhy a funguje ako dve klimatizácie v jednej. MiniCool COMPACT ponúka nízku spotrebu, nevyžaduje údržbu a umožňuje reguláciu teploty pre pokojný spánok v noci s vypnutým motorom vozidla. Tým je zabezpečený pokojný a osviežujúci odpočinok.&lt;/p&gt;&lt;p&gt;Toto zariadenie je navrhnuté pre montáž na strechu kabíny nákladného vozidla. Jeho montáž je jednoduchá a rýchla, nevyžaduje žiadny zásah do kabíny vozidla. Pracuje v manuálnom alebo automatickom režime. Výhodou automatického režimu je, že sa vodič nemusí starať o reguláciu teploty, klimatizácia si toto reguluje automaticky.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;ZÁRUKA 2 ROKY&lt;/h4&gt;&lt;p&gt;Na všetky diely.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;MEDZINÁRODNÁ SERVISNÁ SIEŤ&lt;/h4&gt;', '&lt;!-- TECH SPECS --&gt;&lt;li&gt;výkon 1,4 kW&lt;/li&gt;&lt;li&gt;napätie: 12V/24V&lt;/li&gt;&lt;li&gt;2 režimy nastavenia:	&lt;ul&gt;		&lt;li&gt;manuálny – F0&lt;/li&gt;		&lt;li&gt;automatický – F4&lt;br&gt;	  požiadavky napájania pre automatický režim:	  	&lt;ul&gt;		    &lt;li&gt;24V: 12,2Ah min. – 17Ah. max.&lt;/li&gt;		    &lt;li&gt;12V: 18,0Ah min. – 28Ah. max.&lt;/li&gt;	    &lt;/ul&gt;    &lt;/li&gt;  &lt;/ul&gt;&lt;/li&gt;&lt;li&gt;maximálny prietok vzduchu: 800m3/h&lt;/li&gt;&lt;li&gt;časovač programu až do 9 hodím prevádzky&lt;/li&gt;&lt;li&gt;digitálny teplomer v °C alebo °F&lt;/li&gt;&lt;li&gt;diaľkové ovládanie&lt;/li&gt;&lt;li&gt;ochranná poistka systému&lt;/li&gt;&lt;li&gt;homologizácia a certifikáty č. e9&lt;/li&gt;&lt;li&gt;hlavné rozmery 726mm x 826mm x 176mm (d x š x v)&lt;/li&gt;&lt;li&gt;hmotnosť 28kg&lt;/li&gt;&lt;li&gt;dvojitá ochrana akumulátora:	&lt;ul&gt;		&lt;li&gt;ochrana akumulátora kompresorov&lt;/li&gt;		&lt;li&gt;elektronické ovládanie akumulátora&lt;/li&gt;	&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;jednotka je predplnená chladiacim médiom&lt;/li&gt;&lt;li&gt;upevnenie na strešné okno bez akýchkoľvek zmien v konštrukcii kabíny&lt;/li&gt;&lt;li&gt;aerodynamický dizajn&lt;/li&gt;&lt;li&gt;UV ochranný kryt&lt;/li&gt;&lt;li&gt;jednoduchá výmena náhradných dielov&lt;/li&gt;&lt;li&gt;rýchla montáž&lt;/li&gt;', '                                                                                                &lt;p&gt;Model MiniCool COMPACT je klimatizačná jednotka určená pre použitie v noci. Pracuje s dvomi kompresormi, ďalej má dva nezávislé chladiace okruhy a funguje ako dve klimatizácie v jednej. MiniCool COMPACT ponúka nízku spotrebu, nevyžaduje údržbu a umožňuje reguláciu teploty pre pokojný spánok v noci s vypnutým motorom vozidla. Tým je zabezpečený pokojný a osviežujúci odpočinok.&lt;/p&gt;&lt;p&gt;Toto zariadenie je navrhnuté pre montáž na strechu kabíny nákladného vozidla. Jeho montáž je jednoduchá a rýchla, nevyžaduje žiadny zásah do kabíny vozidla. Pracuje v manuálnom alebo automatickom režime. Výhodou automatického režimu je, že sa vodič nemusí starať o reguláciu teploty, klimatizácia si toto reguluje automaticky.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;ZÁRUKA 2 ROKY&lt;/h4&gt;&lt;p&gt;Na všetky diely.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;MEDZINÁRODNÁ SERVISNÁ SIEŤ&lt;/h4&gt;                                                                                                ', '', 'Compact 24V 1,4kW Standard s Cubi-Gel kompresorom', '', '', '', '', '', '', '', ''),
(1449, 2, 'Compact 24V 3,0kW Night &amp; Day', '&lt;p&gt;Minicool Compact Night &amp;amp; Day - je kompaktná klimatizácia, ktorá môže byť použitá ako cez deň, tak aj v noci (so zapnutým alebo vypnutým motorom). Hlavné využitie je na chladenie kabíny vozidla počas prestávok, nakládky a vykládky ale aj počas cesty. S kapacitou chladenia 3000W je táto klimatizácia schopná chladiť aj počas dňa, keď slnko silno svieti, pričom jediným zdrojom energie je batéria vozidla.&lt;/p&gt;', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '                                                &lt;p&gt;Minicool Compact Night &amp;amp; Day - je kompaktná klimatizácia, ktorá môže byť použitá ako cez deň, tak aj v noci (so zapnutým alebo vypnutým motorom). Hlavné využitie je na chladenie kabíny vozidla počas prestávok, nakládky a vykládky ale aj počas cesty. S kapacitou chladenia 3000W je táto klimatizácia schopná chladiť aj počas dňa, keď slnko silno svieti, pričom jediným zdrojom energie je batéria vozidla.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;INÉ MOŽNOSTI VYUŽITIA&lt;/h4&gt;&lt;p&gt;Napr: elektrické vozidlá, poľnohospodárske stroje, off-road stroje, ako náhrada tradičných klimatizácií integrovaných v motore, vozidlá na čistenie ciest, žeriavy a iné...&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;KLIMATIZÁCIA SA DODÁVA AKO 24V&lt;/h4&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;OPERAČNÉ REŽIMY:&lt;/h4&gt;&lt;ul&gt;	&lt;li&gt;MANUÁLNY REŽIM&lt;br&gt;	Sila a výkon sú nastavené vodičom (používateľom).	&lt;/li&gt;		&lt;li&gt;AUTOMATICKÝ REŽIM&lt;br&gt;	Pri aktivácii automatického režimu systém automaticky meria a sleduje nasledovné: 		&lt;ul&gt;			&lt;li&gt;1. Ak je motor vozidla naštartovaný, systém sa automaticky nastaví tak, aby mohol pracovať na plný výkon bez rizika vybitia batérie vozidla. Tento režim sa používa počas šoférovania cez deň a v noci.&lt;/li&gt;			&lt;li&gt;2. Ak motor vozidla nie je naštartovaný, systém reguluje výkon, aby sa predišlo nechcenému vybitiu batérie. Tento režim sa používa počas prestávok v jazde, určených k odpočinku (väčšinou v noci).&lt;/li&gt;		&lt;/ul&gt;	&lt;/li&gt;&lt;/ul&gt;&lt;br&gt;&lt;p&gt;V ktoromkoľvek režime jednotka meria teplotu cirkulujúcu v kabíne a prispôsobí kapacitu chladenia teplote v kabíne, klimatizácia sa logicky prispôsobí spotrebe elektrickej energie. Druhá generácia technológie invertorov.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;ZÁRUKA 2 ROKY&lt;/h4&gt;&lt;p&gt;Na všetky diely.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;MEDZINÁRODNÁ SERVISNÁ SIEŤ &lt;/h4&gt;                                                ', '', 'Compact 24V 3,0kW Night &amp; Day', '', '', '', '', '', '', '', ''),
