(1449, 4, 'Compact 24V 3,0kW Night &amp; Day', '&lt;p&gt;Agy kompakt klímaberendezés, melyet akár nappal akár éjjel is lehet használni (álló motor mellett és menet közben is).  Alkalmazása főleg a pihenőkben, ki-be rakodáskor, de utazás közben is az utasfüke levegőjének lehűtése. 3000W - os hűtőteljesítmény lehetővé teszi a kabin levegőének lehűtését erős napsütésben is, és az egyetlen energiaforrás a gépjármű akkumulátora.&lt;/p&gt;', '&lt;h4&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;Teljesítmény&lt;/span&gt;&lt;/h4&gt; &lt;ul&gt;	&lt;li&gt;3,0 kW (BTU 10236) tesztelve JIS (*) 33%-os páratartalomnál&lt;/li&gt;&lt;/ul&gt;&lt;h4&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;Energiafogyasztás&lt;/span&gt;&lt;/h4&gt;&lt;ul&gt;	&lt;li&gt;éjszaka (max. 23,5 A/h - min. 12,6 A/óra.) * külső hőmérséklet: 35º&lt;/li&gt;	&lt;li&gt;nappal (max. 38,2 A/h - min. 29,4 A/óra.) * külső hőmérséklet 42º&lt;/li&gt;&lt;/ul&gt;&lt;h4&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;Súly és maximális levegőáramlás&lt;/span&gt;&lt;/h4&gt;&lt;ul&gt;	&lt;li&gt;súly: 38 kg&lt;/li&gt;	&lt;li&gt;levegőáramlás: 530 m3/óra.&lt;/li&gt;&lt;/ul&gt;&lt;h4&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;Dupla védelem akkumulátor feszültség csökkenés esetén&lt;/span&gt;&lt;/h4&gt;&lt;p&gt;Kompresszor  és akkumulátor védelem(feszültség csökkenés esetén a kompresszor leáll, amíg a feszültség újra megfelelő nem lesz). Nagyobb akkumulátor feszülség csökkenés esetében pedig teljesen kikapcsol. &lt;/p&gt;&lt;h4&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;Gyors beszerelé&lt;/span&gt;&lt;/h4&gt;&lt;p&gt;Mivel a klímaegység már fel van töltve hűtőfolyadékkal azonnal felszerelhető a gépjármű tetőablaka helyére destruktív beavatkozás nélkül.&lt;/p&gt;', '                                                                        &lt;p&gt;Agy kompakt klímaberendezés, melyet akár nappal akár éjjel is lehet használni (álló motor mellett és menet közben is). Alkalmazása főleg a pihenőkben, ki-be rakodáskor, de utazás közben is az utasfüke levegőjének lehűtése. 3000W - os hűtőteljesítmény lehetővé teszi a kabin levegőének lehűtését erős napsütésben is, és az egyetlen energiaforrás a gépjármű akkumulátora.&lt;/p&gt;                                                                        ', '', 'Compact 24V 3,0kW Night &amp; Day', '', '', '', '', '', '', '', ''),
