(1453, 4, 'Compact 24V 1,4kW', '&lt;p&gt;A MiniCool COMPACT modell éjszakai használatra kifejlesztett klimatizációs egység. Két kompresszorral dolgozik, továbbá két független hűtőköre van és úgy működik, mint két klimatizáció egyben. A MiniCool COMPACT fogyasztása alacsony, nem igényel karbantartást és a gépjármű leállított motorja mellett, békés, éjszakai alvást biztosít, amit elősegít a hőmérséklet szabályozhatósága is. Ezáltal biztosítva van a békés és felfrissítő pihenés.&lt;/p&gt;&lt;h4&gt;MINICOOL COMPACT&lt;/h4&gt;&lt;p&gt;A berendezést a tehergépjárművek fülkéjének tetejére való felszerelésre tervezték. Felszerelése egyszerű és gyors, nem igényel semmilyen beavatkozást a jármű fülkéjébe. Manuális vagy automatikus üzemmódban is dolgozik. Az automatikus üzemmód előnye, hogy a sofőrnek nem kell a hőmérséklet szabályozásával törődnie, a klimatizáció azt automatikusan szabályozza.&lt;/p&gt;&lt;h4&gt;2 ÉV GARANCIA&lt;/h4&gt;&lt;p&gt;Az összes alkatrészre.&lt;/p&gt;&lt;h4&gt;NEMZETKÖZI SZERVIZHÁLÓZAT &lt;/h4&gt;', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '                                                &lt;p&gt;A MiniCool COMPACT modell éjszakai használatra kifejlesztett klimatizációs egység. Két kompresszorral dolgozik, továbbá két független hűtőköre van és úgy működik, mint két klimatizáció egyben. A MiniCool COMPACT fogyasztása alacsony, nem igényel karbantartást és a gépjármű leállított motorja mellett, békés, éjszakai alvást biztosít, amit elősegít a hőmérséklet szabályozhatósága is. Ezáltal biztosítva van a békés és felfrissítő pihenés.&lt;/p&gt;&lt;h4&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;MINICOOL COMPACT&lt;/span&gt;&lt;/h4&gt;&lt;p&gt;A berendezést a tehergépjárművek fülkéjének tetejére való felszerelésre tervezték. Felszerelése egyszerű és gyors, nem igényel semmilyen beavatkozást a jármű fülkéjébe. Manuális vagy automatikus üzemmódban is dolgozik. Az automatikus üzemmód előnye, hogy a sofőrnek nem kell a hőmérséklet szabályozásával törődnie, a klimatizáció azt automatikusan szabályozza.&lt;/p&gt;&lt;h4&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;2 ÉV GARANCIA&lt;/span&gt;&lt;/h4&gt;&lt;p&gt;Az összes alkatrészre.&lt;/p&gt;&lt;h4&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;NEMZETKÖZI SZERVIZHÁLÓZAT &lt;/span&gt;&lt;/h4&gt;                                                ', '', 'Compact 24V 1,4kW', '', '', '', '', '', '', '', ''),
