ő pihenés.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;MINICOOL COMPACT&lt;/span&gt;&lt;/h4&gt;&lt;p&gt;A berendezést a tehergépjárművek fülkéjének tetejére való felszerelésre tervezték. Felszerelése egyszerű és gyors, nem igényel semmilyen beavatkozást a jármű fülkéjébe. Manuális vagy automatikus üzemmódban is dolgozik. Az automatikus üzemmód előnye, hogy a sofőrnek nem kell a hőmérséklet szabályozásával törődnie, a klimatizáció azt automatikusan szabályozza.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;2 ÉV GARANCIA&lt;/span&gt;&lt;/h4&gt;&lt;p&gt;Az összes alkatrészre.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;NEMZETKÖZI SZERVIZHÁLÓZAT&lt;/span&gt;&lt;/h4&gt;                                                                                                                                                ', '', 'Compact 12V 2,0kW', '', '', '', '', '', '', '', ''),
(1450, 2, 'Compact 24V 1,6kW - MAN TGX', '&lt;p&gt;Model MiniCool COMPACT je klimatizačná jednotka určená pre použitie v noci. Pracuje s dvomi kompresormi, ďalej má dva nezávislé chladiace okruhy a funguje ako dve klimatizácie v jednej. MiniCool COMPACT ponúka nízku spotrebu, nevyžaduje údržbu a umožňuje reguláciu teploty pre pokojný spánok v noci s vypnutým motorom vozidla. Tým je zabezpečený pokojný a osviežujúci odpočinok.&lt;/p&gt;&lt;p&gt;Toto zariadenie je navrhnuté pre montáž na strechu kabíny nákladného vozidla. Jeho montáž je jednoduchá a rýchla, nevyžaduje žiadny zásah do kabíny vozidla. Pracuje v manuálnom alebo automatickom režime. Výhodou automatického režimu je, že sa vodič nemusí starať o reguláciu teploty, klimatizácia si toto reguluje automaticky.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;ZÁRUKA 2 ROKY&lt;/h4&gt;&lt;p&gt;Na všetky diely.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;MEDZINÁRODNÁ SERVISNÁ SIEŤ&lt;/h4&gt;', '&lt;!-- TECH SPECS --&gt;&lt;li&gt;výkon 1,6 kW&lt;/li&gt;&lt;li&gt;napätie: 24V&lt;/li&gt;&lt;li&gt;2 režimy nastavenia:	&lt;ul&gt;		&lt;li&gt;manuálny – F0&lt;/li&gt;		&lt;li&gt;automatický – F4&lt;br&gt;			požiadavky napájania pre automatický režim:		  	&lt;ul&gt;		  		&lt;li&gt;24V: 7Ah min. – 22Ah. max.&lt;/li&gt;	  		&lt;/ul&gt;    &lt;/li&gt;  &lt;/ul&gt;&lt;/li&gt;&lt;li&gt;maximálny prietok vzduchu: 800m3/h&lt;/li&gt;&lt;li&gt;časovač programu až do 9 hodím prevádzky&lt;/li&gt;&lt;li&gt;digitálny teplomer v °C alebo °F&lt;/li&gt;&lt;li&gt;diaľkové ovládanie&lt;/li&gt;&lt;li&gt;ochranná poistka systému&lt;/li&gt;&lt;li&gt;homologizácia a certifikáty č. e9&lt;/li&gt;&lt;li&gt;hlavné rozmery 726mm x 826mm x 203mm (d x š x v)&lt;/li&gt;&lt;li&gt;hmotnosť 33kg&lt;/li&gt;&lt;li&gt;dvojitá ochrana akumulátorov	&lt;ul&gt;			&lt;li&gt;ochrana akumulátorov kompresorov&lt;/li&gt;		&lt;li&gt;elektronické ovládanie akumulátora&lt;/li&gt;	&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;jednotka je predplnená chladiacim médiom&lt;/li&gt