(1452, 4, 'Compact 24V 1,6kW - Molpir', '&lt;p&gt;A MiniCool COMPACT modell éjszakai használatra kifejlesztett klimatizációs egység. Két kompresszorral dolgozik, továbbá két független hűtőköre van és úgy működik, mint két klimatizáció egyben. A MiniCool COMPACT fogyasztása alacsony, nem igényel karbantartást és a gépjármű leállított motorja mellett, békés, éjszakai alvást biztosít, amit elősegít a hőmérséklet szabályozhatósága is. Ezáltal biztosítva van a békés és felfrissítő pihenés.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;MINICOOL COMPACT&lt;/span&gt;&lt;/h4&gt;&lt;p&gt;A berendezést a tehergépjárművek fülkéjének tetejére való felszerelésre tervezték. Felszerelése egyszerű és gyors, nem igényel semmilyen beavatkozást a jármű fülkéjébe. Manuális vagy automatikus üzemmódban is dolgozik. Az automatikus üzemmód előnye, hogy a sofőrnek nem kell a hőmérséklet szabályozásával törődnie, a klimatizáció azt automatikusan szabályozza.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;2 ÉV GARANCIA&lt;/span&gt;&lt;/h4&gt;&lt;p&gt;Az összes alkatrészre.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;NEMZETKÖZI SZERVIZHÁLÓZAT&lt;/span&gt;&lt;/h4&gt;', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '                                                &lt;p&gt;A MiniCool COMPACT modell éjszakai használatra kifejlesztett klimatizációs egység. Két kompresszorral dolgozik, továbbá két független hűtőköre van és úgy működik, mint két klimatizáció egyben. A MiniCool COMPACT fogyasztása alacsony, nem igényel karbantartást és a gépjármű leállított motorja mellett, békés, éjszakai alvást biztosít, amit elősegít a hőmérséklet szabályozhatósága is. Ezáltal biztosítva van a békés és felfrissítő pihenés.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;MINICOOL COMPACT&lt;/span&gt;&lt;/h4&gt;&lt;p&gt;A berendezést a tehergépjárművek fülkéjének tetejére való felszerelésre tervezték. Felszerelése egyszerű és gyors, nem igényel semmilyen beavatkozást a jármű fülkéjébe. Manuális vagy automatikus üzemmódban is dolgozik. Az automatikus üzemmód előnye, hogy a sofőrnek nem kell a hőmérséklet szabályozásával törődnie, a klimatizáció azt automatikusan szabályozza.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;2 ÉV GARANCIA&lt;/span&gt;&lt;/h4&gt;&lt;p&gt;Az összes alkatrészre.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;color: rgb(14, 65, 122);&quot;&gt;NEMZETKÖZI SZERVIZHÁLÓZAT&lt;/span&gt;&lt;/h4&gt;                                                                                                                                                                                                ', '', 'Compact 24V 1,6kW - Molpir', '', '', '', '', '', '', '', ''),
(1456, 2, 'Dinamic 12V 1,05kW', '&lt;p&gt;Dirna ponúka v modelovom rade Minicool klimatizačnú jednotku pracujúcu s jedným alebo dvomi kompresormi. MiniCool má nízku spotrebu, nevyžaduje údržbu a umožňuje reguláciu teploty pre pokojný spánok v noci s vypnutým motorom vozidla. Tým je zabezpečený pokojný a osviežujúci odpočinok.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;MINICOOL DINAMIC&lt;/h4&gt;&lt;p&gt;Týmto modelom pokračuje DIRNA v rozširovaní produktovej rady klimatizačných jednotiek určených na dosiahnutie vyššej úrovne komfortu v kabíne nákladných vozidiel. Tento zdokonalený produkt má veľmi nízku spotrebu, a preto je špeciálne určený na prevádzku v noci a v prípadoch, keď je motor vozidla vypnutý. Umožňuje osviežujúci oddych, pričom zároveň šetrí palivo, zabraňuje vytváraniu nadmerného hluku a opotrebeniu motora bežného pri používaní štandardných klimatizačných systémov.&lt;br&gt;&lt;br&gt;Ochrana čalúnenia so zabudovanou výparníkovou jednotkou a distribútormi vzduchu nastaviteľnými do rôznych smerov.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;ZÁRUKA 2 ROKY&lt;/h4&gt;&lt;p&gt;Na všetky diely.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;MEDZINÁRODNÁ SERVISNÁ SIEŤ&lt;/h4&gt;', '&lt;ul&gt;	&lt;li&gt;12V/24V&lt;/li&gt;	&lt;li&gt;Spotreba 9,5 - 16 A/h (24V) / 12 - 27 A/h (12V)&lt;/li&gt;	&lt;li&gt;ovládanie všetkých funkcií cez kontrolný panel&lt;/li&gt;	&lt;li&gt;prepínač automatický/manuálny režim&lt;/li&gt;	&lt;li&gt;digitálny teplomer v °C alebo °F&lt;/li&gt;	&lt;li&gt;diaľkové ovládanie&lt;/li&gt;	&lt;li&gt;dvojitá ochrana akumulátorov&lt;/li&gt;	&lt;li&gt;Night Use System&lt;/li&gt;	&lt;li&gt;Prevádzka nezávisle od chodu motora&lt;/li&gt;	&lt;li&gt;Minimálna údržba&lt;/li&gt;	&lt;li&gt;Nový kompresor BD 350&lt;/li&gt;	&lt;li&gt;Rozmery 630 x 197 x 785 mm&lt;/li&gt;&lt;/ul&gt;', '                                                                        &lt;p&gt;Dirna ponúka v modelovom rade Minicool klimatizačnú jednotku pracujúcu s jedným alebo dvomi kompresormi. MiniCool má nízku spotrebu, nevyžaduje údržbu a umožňuje reguláciu teploty pre pokojný spánok v noci s vypnutým motorom vozidla. Tým je zabezpečený pokojný a osviežujúci odpočinok.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;MINICOOL DINAMIC&lt;/h4&gt;&lt;p&gt;Týmto modelom pokračuje DIRNA v rozširovaní produktovej rady klimatizačných jednotiek určených na dosiahnutie vyššej úrovne komfortu v kabíne nákladných vozidiel. Tento zdokonalený produkt má veľmi nízku spotrebu, a preto je špeciálne určený na prevádzku v noci a v prípadoch, keď je motor vozidla vypnutý. Umožňuje osviežujúci oddych, pričom zároveň šetrí palivo, zabraňuje vytváraniu nadmerného hluku a opotrebeniu motora bežného pri používaní štandardných klimatizačných systémov.&lt;br&gt;&lt;br&gt;Ochrana čalúnenia so zabudovanou výparníkovou jednotkou a distribútormi vzduchu nastaviteľnými do rôznych smerov.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;ZÁRUKA 2 ROKY&lt;/h4&gt;&lt;p&gt;Na všetky diely.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;MEDZINÁRODNÁ SERVISNÁ SIEŤ&lt;/h4&gt;                                                                                                                        ', '', 'Dinamic 12V 1,05kW', '', '', '', '', '', '', '', ''),
(1456, 1, 'Dinamic 12V 1,05kW', '&lt;p&gt;With a very low electrical consumption, the Dinamic standalone air conditioning unit is particularly suitable for night-time use when the engine is off.&lt;/p&gt;&lt;p&gt;The Dinamic – which is available in 12V and 24V – is exclusively designed for on-road vehicles such as car transporter trucks, cabins with excess height, American cabins or cabins without a hatch.&lt;/p&gt;&lt;p&gt;The unit is fitted on the rear part of the cabin and the original hatch remains intact. It regulates the temperature inside the cabin during overnight stops and during the loading and unloading operations with the engine off.&lt;/p&gt;', '&lt;ul&gt;	&lt;li&gt;12V/24V&lt;/li&gt;	&lt;li&gt;Electrical consumption 9,5 - 16 A/h (24V) / 12 - 27 A/h (12V)&lt;/li&gt;	&lt;li&gt;Control panel&lt;/li&gt;	&lt;li&gt;Manual and automatic function&lt;/li&gt;	&lt;li&gt;Digital thermometer (°C or °F)&lt;/li&gt;	&lt;li&gt;Remote control&lt;/li&gt;	&lt;li&gt;Double battery protection&lt;/li&gt;	&lt;li&gt;Night Use System&lt;/li&gt;	&lt;li&gt;Works without engine running&lt;/li&gt;	&lt;li&gt;Virtually maintenance free&lt;/li&gt;	&lt;li&gt;New compressor BD 350&lt;/li&gt;	&lt;li&gt;Dimensions 630 x 197 x 785 mm&lt;/li&gt;&lt;/ul&gt;', '                                                                        &lt;p&gt;With a very low electrical consumption, the Dinamic standalone air conditioning unit is particularly suitable for night-time use when the engine is off.&lt;/p&gt;&lt;p&gt;The Dinamic – which is available in 12V and 24V – is exclusively designed for on-road vehicles such as car transporter trucks, cabins with excess height, American cabins or cabins without a hatch.&lt;/p&gt;&lt;p&gt;The unit is fitted on the rear part of the cabin and the original hatch remains intact. It regulates the temperature inside the cabin during overnight stops and during the loading and unloading operations with the engine off.&lt;/p&gt;                                                                                                                        ', '', 'Dinamic 12V 1,05kW', '', '', '', '', '', '', '', ''),
(1456, 3, 'Dinamic 12V 1,05kW', '&lt;p&gt;Dirna bieter mit Minicool eine Klimaanlage an, die mit einem oder zwei Kompressoren arbeitet. Die Klimaanlage Minicool ahat geringen Stromverbrauch, der Wartungsaufwand ist minimal und sie reguliert die Temperatur für den angenehmen Schlaf in der Nacht bei abgeschaltetem Fahrzeugmotor. Dadurch ist eine erfrischende Erholung gewährleistet.&lt;/p&gt; &lt;h4 style=&quot;color: #0e417a&quot;&gt;MINICOOL DINAMIC&lt;/h4&gt;&lt;p&gt;Die neue Minicool Dinamic ermöglicht dem Fahrer sich angemessen in den Stand- und Ruhephasen in der Fahrerkabine zu erholen. Das bedeutet höheren Komfort in den Nutzfahrzeugen. Diese neu entwickelte Klimaanlage funktioniert mit sehr geringem Stromverbrauch und ist somit ein ideales Gerät für den Nachtbetrieb ohne Motorlauf. Die Minicool Dinamic garantiert dem Fahrer eine angenehme und erholsame Nachtruhe, sowie Kraftstoffeinsparungen und dank dieser Technologie muss der Fahrer nicht die lästigen Geräusche des Motorlaufes ertragen. Elektronische Bedienungseinheit mit ausrichtbaren Luftdüsen.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;2 JAHRE GEWÄHRLEISTUNG&lt;/h4&gt;&lt;p&gt;Auf alle Bauteile.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;INTERNATIONALES SERVICENETZ&lt;/h4&gt;', '&lt;ul&gt;	&lt;li&gt;Ausführung: 24 Volt &lt;/li&gt;	&lt;li&gt;Steuerung aller Funktionen über das elektronische Tastenfeld&lt;/li&gt;	&lt;li&gt;mehr Kälteleistung mit nur einem Kompressor&lt;/li&gt;	&lt;li&gt;automatische Temperaturregulierung durch die Invertor-Technologie&lt;/li&gt;	&lt;li&gt;Taste F0 = manuelle Funktion&lt;/li&gt;	&lt;li&gt;Taste F4 = automatische Funktion nach Einschalten der Anlage&lt;/li&gt;	&lt;li&gt;Modell Minicool Dinamic:&lt;/li&gt;		&lt;ul&gt;			&lt;li&gt;geringer Stromverbrauch bei 24 V (Taste F0: 11 bis 14A, Taste F4: 9,5 bis 14A) &lt;/li&gt;			&lt;li&gt;Kälteleistung bei 24 V (1050 W)&lt;/li&gt;		&lt;/ul&gt;	&lt;li&gt;Abmessungen (B x L x H): 630 x 197 x 785 mm&lt;/li&gt;	&lt;li&gt;Night use system&lt;/li&gt;	&lt;li&gt;funktioniert ohne Motorlauf&lt;/li&gt;	&lt;li&gt;minimaler Wartungsaufwand&lt;/li&gt;	&lt;li&gt;doppeltes Batterieschutzsystem&lt;/li&gt;	&lt;li&gt;externes Gehäuse hergestellt in Plastikinjektion ABS mit UV-Schutz&lt;/li&gt;	&lt;li&gt;neuer Kompressor BD 350&lt;/li&gt;&lt;/ul&gt;', '                                                                        &lt;p&gt;Dirna bieter mit Minicool eine Klimaanlage an, die mit einem oder zwei Kompressoren arbeitet. Die Klimaanlage Minicool ahat geringen Stromverbrauch, der Wartungsaufwand ist minimal und sie reguliert die Temperatur für den angenehmen Schlaf in der Nacht bei abgeschaltetem Fahrzeugmotor. Dadurch ist eine erfrischende Erholung gewährleistet.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;MINICOOL DINAMIC&lt;/h4&gt;&lt;p&gt;Die neue Minicool Dinamic ermöglicht dem Fahrer sich angemessen in den Stand- und Ruhephasen in der Fahrerkabine zu erholen. Das bedeutet höheren Komfort in den Nutzfahrzeugen. Diese neu entwickelte Klimaanlage funktioniert mit sehr geringem Stromverbrauch und ist somit ein ideales Gerät für den Nachtbetrieb ohne Motorlauf. Die Minicool Dinamic garantiert dem Fahrer eine angenehme und erholsame Nachtruhe, sowie Kraftstoffeinsparungen und dank dieser Technologie muss der Fahrer nicht die lästigen Geräusche des Motorlaufes ertragen. Elektronische Bedienungseinheit mit ausrichtbaren Luftdüsen.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;2 JAHRE GEWÄHRLEISTUNG&lt;/h4&gt;&lt;p&gt;Auf alle Bauteile.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;INTERNATIONALES SERVICENETZ&lt;/h4&gt;                                                                                                                        ', '', 'Dinamic 12V 1,05kW', '', '', '', '', '', '', '', ''),
(1456, 4, 'Dinamic 12V 1,05kW', '&lt;p&gt;A Dirna cég, a Minicool modellsorozatban egy vagy két kompresszorral dolgozó klimatizációs egységet kínál. A MiniCool fogyasztása alacsony, nem igényel karbantartást és a gépjármű leállított motorja mellett, békés, éjszakai alvást biztosít, amit elősegít a hőmérséklet szabályozhatósága is. Ezáltal biztosítva van a békés és felfrissítő pihenés.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;MINICOOL DINAMIC&lt;/h4&gt;&lt;p&gt;Ezzel a modellel a DIRNA cég folytatja klimatizációs egységekből álló terméksorozatának bővítését, melyek a tehergépjárművek fülkéjének komfortját hivatottak növelni. Ennek a továbbfejlesztett változatnak nagyon alacsony a fogyasztása, és ezért kimondottan éjszakai használatra készült, valamint azokra az esetekre, mikor a jármű motorja áll. Lehetővé teszi a frissítő pihenést, miközben üzemanyagot takarít meg. Meggátolja a túlzott zaj keletkezését és a motor kopását, melyek a standard klímaberendezések használatának mindennapos velejárói. A kárpit védelme beépített párologtatós egységgel és különböző irányokba állítható levegőfúvókkal.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;2 ÉV GARANCIA&lt;/h4&gt;&lt;p&gt;Az összes alkatrészre.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;NEMZETKÖZI SZERVIZHÁLÓZAT&lt;/h4&gt;', '&lt;ul&gt;	&lt;li&gt;24 Volt–os kivitel&lt;/li&gt;	&lt;li&gt;az összes funkció közvetlenül az irányítópanelről irányítható&lt;/li&gt;	&lt;li&gt;nagyobb teljesítmény egy kompresszor használata mellett&lt;/li&gt;	&lt;li&gt;inverterek használatával elért automatikus szabályozás&lt;/li&gt;	&lt;li&gt;F0 üzemmód = manuális üzemmód&lt;/li&gt;	&lt;li&gt;F4 üzemmód = automatikus üzemmód&lt;/li&gt;	&lt;li&gt;modell Minicool Dinamic:		&lt;ul&gt;			&lt;li&gt;alacsony elektromos fogyasztás 24 V mellett (F0 üzemmódban: 11-től 14 A-ig, F4 üzemmódban: 9,5-től 14 A-ig) &lt;/li&gt;			&lt;li&gt;nagy teljesítmény 24 V mellett (1050 W)&lt;/li&gt;		&lt;/ul&gt;	&lt;/li&gt;	&lt;li&gt;méretek (SZ x H x M): 630 x 197 x 785 mm&lt;/li&gt;	&lt;li&gt;Night use system = éjszakai üzemmód&lt;/li&gt;	&lt;li&gt;a gépjármű leállított motorja mellett is működik&lt;/li&gt;	&lt;li&gt;minimális karbantartási igény&lt;/li&gt;	&lt;li&gt;beépített védelem alacsony akkumulátor-feszültség esetére&lt;/li&gt;	&lt;li&gt;a külső burkolat hőálló, UVA védelemmel ellátott műanyagból készült (ellenálló a mechanikus károsodásokkal szemben)&lt;/li&gt;	&lt;li&gt;új BD 350 kompresszor&lt;/li&gt;&lt;/ul&gt;', '                                                                        &lt;p&gt;A Dirna cég, a Minicool modellsorozatban egy vagy két kompresszorral dolgozó klimatizációs egységet kínál. A MiniCool fogyasztása alacsony, nem igényel karbantartást és a gépjármű leállított motorja mellett, békés, éjszakai alvást biztosít, amit elősegít a hőmérséklet szabályozhatósága is. Ezáltal biztosítva van a békés és felfrissítő pihenés.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;MINICOOL DINAMIC&lt;/h4&gt;&lt;p&gt;Ezzel a modellel a DIRNA cég folytatja klimatizációs egységekből álló terméksorozatának bővítését, melyek a tehergépjárművek fülkéjének komfortját hivatottak növelni. Ennek a továbbfejlesztett változatnak nagyon alacsony a fogyasztása, és ezért kimondottan éjszakai használatra készült, valamint azokra az esetekre, mikor a jármű motorja áll. Lehetővé teszi a frissítő pihenést, miközben üzemanyagot takarít meg. Meggátolja a túlzott zaj keletkezését és a motor kopását, melyek a standard klímaberendezések használatának mindennapos velejárói. A kárpit védelme beépített párologtatós egységgel és különböző irányokba állítható levegőfúvókkal.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;2 ÉV GARANCIA&lt;/h4&gt;&lt;p&gt;Az összes alkatrészre.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;NEMZETKÖZI SZERVIZHÁLÓZAT&lt;/h4&gt;                                                                                                                        ', '', 'Dinamic 12V 1,05kW', '', '', '', '', '', '', '', ''),
(1455, 2, 'Dinamic 24V 1,05kW', '&lt;p&gt;Dirna ponúka v modelovom rade Minicool klimatizačnú jednotku pracujúcu s jedným alebo dvomi kompresormi. MiniCool má nízku spotrebu, nevyžaduje údržbu a umožňuje reguláciu teploty pre pokojný spánok v noci s vypnutým motorom vozidla. Tým je zabezpečený pokojný a osviežujúci odpočinok.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;MINICOOL DINAMIC&lt;/h4&gt;&lt;p&gt;Týmto modelom pokračuje DIRNA v rozširovaní produktovej rady klimatizačných jednotiek určených na dosiahnutie vyššej úrovne komfortu v kabíne nákladných vozidiel. Tento zdokonalený produkt má veľmi nízku spotrebu, a preto je špeciálne určený na prevádzku v noci a v prípadoch, keď je motor vozidla vypnutý. Umožňuje osviežujúci oddych, pričom zároveň šetrí palivo, zabraňuje vytváraniu nadmerného hluku a opotrebeniu motora bežného pri používaní štandardných klimatizačných systémov.&lt;br&gt;&lt;br&gt;Ochrana čalúnenia so zabudovanou výparníkovou jednotkou a distribútormi vzduchu nastaviteľnými do rôznych smerov.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;ZÁRUKA 2 ROKY&lt;/h4&gt;&lt;p&gt;Na všetky diely.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;MEDZINÁRODNÁ SERVISNÁ SIEŤ&lt;/h4&gt;', '&lt;ul&gt;	&lt;li&gt;12V/24V&lt;/li&gt;	&lt;li&gt;Spotreba 9,5 - 16 A/h (24V) / 12 - 27 A/h (12V)&lt;/li&gt;	&lt;li&gt;ovládanie všetkých funkcií cez kontrolný panel&lt;/li&gt;	&lt;li&gt;prepínač automatický/manuálny režim&lt;/li&gt;	&lt;li&gt;digitálny teplomer v °C alebo °F&lt;/li&gt;	&lt;li&gt;diaľkové ovládanie&lt;/li&gt;	&lt;li&gt;dvojitá ochrana akumulátorov&lt;/li&gt;	&lt;li&gt;Night Use System&lt;/li&gt;	&lt;li&gt;Prevádzka nezávisle od chodu motora&lt;/li&gt;	&lt;li&gt;Minimálna údržba&lt;/li&gt;	&lt;li&gt;Nový kompresor BD 350&lt;/li&gt;	&lt;li&gt;Rozmery 630 x 197 x 785 mm&lt;/li&gt;&lt;/ul&gt;', '                                                &lt;p&gt;Dirna ponúka v modelovom rade Minicool klimatizačnú jednotku pracujúcu s jedným alebo dvomi kompresormi. MiniCool má nízku spotrebu, nevyžaduje údržbu a umožňuje reguláciu teploty pre pokojný spánok v noci s vypnutým motorom vozidla. Tým je zabezpečený pokojný a osviežujúci odpočinok.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;MINICOOL DINAMIC&lt;/h4&gt;&lt;p&gt;Týmto modelom pokračuje DIRNA v rozširovaní produktovej rady klimatizačných jednotiek určených na dosiahnutie vyššej úrovne komfortu v kabíne nákladných vozidiel. Tento zdokonalený produkt má veľmi nízku spotrebu, a preto je špeciálne určený na prevádzku v noci a v prípadoch, keď je motor vozidla vypnutý. Umožňuje osviežujúci oddych, pričom zároveň šetrí palivo, zabraňuje vytváraniu nadmerného hluku a opotrebeniu motora bežného pri používaní štandardných klimatizačných systémov.&lt;br&gt;&lt;br&gt;Ochrana čalúnenia so zabudovanou výparníkovou jednotkou a distribútormi vzduchu nastaviteľnými do rôznych smerov.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;ZÁRUKA 2 ROKY&lt;/h4&gt;&lt;p&gt;Na všetky diely.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;MEDZINÁRODNÁ SERVISNÁ SIEŤ&lt;/h4&gt;                                                                                                ', '', 'Dinamic 24V 1,05kW', '', '', '', '', '', '', '', ''),
(1455, 1, 'Dinamic 24V 1,05kW', '&lt;p&gt;With a very low electrical consumption, the Dinamic standalone air conditioning unit is particularly suitable for night-time use when the engine is off.&lt;/p&gt;&lt;p&gt;The Dinamic – which is available in 12V and 24V – is exclusively designed for on-road vehicles such as car transporter trucks, cabins with excess height, American cabins or cabins without a hatch.&lt;/p&gt;&lt;p&gt;The unit is fitted on the rear part of the cabin and the original hatch remains intact. It regulates the temperature inside the cabin during overnight stops and during the loading and unloading operations with the engine off.&lt;/p&gt;', '&lt;ul&gt;	&lt;li&gt;12V/24V&lt;/li&gt;	&lt;li&gt;Electrical consumption 9,5 - 16 A/h (24V) / 12 - 27 A/h (12V)&lt;/li&gt;	&lt;li&gt;Control panel&lt;/li&gt;	&lt;li&gt;Manual and automatic function&lt;/li&gt;	&lt;li&gt;Digital thermometer (°C or °F)&lt;/li&gt;	&lt;li&gt;Remote control&lt;/li&gt;	&lt;li&gt;Double battery protection&lt;/li&gt;	&lt;li&gt;Night Use System&lt;/li&gt;	&lt;li&gt;Works without engine running&lt;/li&gt;	&lt;li&gt;Virtually maintenance free&lt;/li&gt;	&lt;li&gt;New compressor BD 350&lt;/li&gt;	&lt;li&gt;Dimensions 630 x 197 x 785 mm&lt;/li&gt;&lt;/ul&gt;', '                                                &lt;p&gt;With a very low electrical consumption, the Dinamic standalone air conditioning unit is particularly suitable for night-time use when the engine is off.&lt;/p&gt;&lt;p&gt;The Dinamic – which is available in 12V and 24V – is exclusively designed for on-road vehicles such as car transporter trucks, cabins with excess height, American cabins or cabins without a hatch.&lt;/p&gt;&lt;p&gt;The unit is fitted on the rear part of the cabin and the original hatch remains intact. It regulates the temperature inside the cabin during overnight stops and during the loading and unloading operations with the engine off.&lt;/p&gt;                                                                                                ', '', 'Dinamic 24V 1,05kW', '', '', '', '', '', '', '', ''),
(1455, 3, 'Dinamic 24V 1,05kW', '&lt;p&gt;Dirna bieter mit Minicool eine Klimaanlage an, die mit einem oder zwei Kompressoren arbeitet. Die Klimaanlage Minicool ahat geringen Stromverbrauch, der Wartungsaufwand ist minimal und sie reguliert die Temperatur für den angenehmen Schlaf in der Nacht bei abgeschaltetem Fahrzeugmotor. Dadurch ist eine erfrischende Erholung gewährleistet.&lt;/p&gt; &lt;h4 style=&quot;color: #0e417a&quot;&gt;MINICOOL DINAMIC&lt;/h4&gt;&lt;p&gt;Die neue Minicool Dinamic ermöglicht dem Fahrer sich angemessen in den Stand- und Ruhephasen in der Fahrerkabine zu erholen. Das bedeutet höheren Komfort in den Nutzfahrzeugen. Diese neu entwickelte Klimaanlage funktioniert mit sehr geringem Stromverbrauch und ist somit ein ideales Gerät für den Nachtbetrieb ohne Motorlauf. Die Minicool Dinamic garantiert dem Fahrer eine angenehme und erholsame Nachtruhe, sowie Kraftstoffeinsparungen und dank dieser Technologie muss der Fahrer nicht die lästigen Geräusche des Motorlaufes ertragen. Elektronische Bedienungseinheit mit ausrichtbaren Luftdüsen.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;2 JAHRE GEWÄHRLEISTUNG&lt;/h4&gt;&lt;p&gt;Auf alle Bauteile.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;INTERNATIONALES SERVICENETZ&lt;/h4&gt;', '&lt;ul&gt;	&lt;li&gt;Ausführung: 24 Volt &lt;/li&gt;	&lt;li&gt;Steuerung aller Funktionen über das elektronische Tastenfeld&lt;/li&gt;	&lt;li&gt;mehr Kälteleistung mit nur einem Kompressor&lt;/li&gt;	&lt;li&gt;automatische Temperaturregulierung durch die Invertor-Technologie&lt;/li&gt;	&lt;li&gt;Taste F0 = manuelle Funktion&lt;/li&gt;	&lt;li&gt;Taste F4 = automatische Funktion nach Einschalten der Anlage&lt;/li&gt;	&lt;li&gt;Modell Minicool Dinamic:&lt;/li&gt;		&lt;ul&gt;			&lt;li&gt;geringer Stromverbrauch bei 24 V (Taste F0: 11 bis 14A, Taste F4: 9,5 bis 14A) &lt;/li&gt;			&lt;li&gt;Kälteleistung bei 24 V (1050 W)&lt;/li&gt;		&lt;/ul&gt;	&lt;li&gt;Abmessungen (B x L x H): 630 x 197 x 785 mm&lt;/li&gt;	&lt;li&gt;Night use system&lt;/li&gt;	&lt;li&gt;funktioniert ohne Motorlauf&lt;/li&gt;	&lt;li&gt;minimaler Wartungsaufwand&lt;/li&gt;	&lt;li&gt;doppeltes Batterieschutzsystem&lt;/li&gt;	&lt;li&gt;externes Gehäuse hergestellt in Plastikinjektion ABS mit UV-Schutz&lt;/li&gt;	&lt;li&gt;neuer Kompressor BD 350&lt;/li&gt;&lt;/ul&gt;', '                                                &lt;p&gt;Dirna bieter mit Minicool eine Klimaanlage an, die mit einem oder zwei Kompressoren arbeitet. Die Klimaanlage Minicool ahat geringen Stromverbrauch, der Wartungsaufwand ist minimal und sie reguliert die Temperatur für den angenehmen Schlaf in der Nacht bei abgeschaltetem Fahrzeugmotor. Dadurch ist eine erfrischende Erholung gewährleistet.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;MINICOOL DINAMIC&lt;/h4&gt;&lt;p&gt;Die neue Minicool Dinamic ermöglicht dem Fahrer sich angemessen in den Stand- und Ruhephasen in der Fahrerkabine zu erholen. Das bedeutet höheren Komfort in den Nutzfahrzeugen. Diese neu entwickelte Klimaanlage funktioniert mit sehr geringem Stromverbrauch und ist somit ein ideales Gerät für den Nachtbetrieb ohne Motorlauf. Die Minicool Dinamic garantiert dem Fahrer eine angenehme und erholsame Nachtruhe, sowie Kraftstoffeinsparungen und dank dieser Technologie muss der Fahrer nicht die lästigen Geräusche des Motorlaufes ertragen. Elektronische Bedienungseinheit mit ausrichtbaren Luftdüsen.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;2 JAHRE GEWÄHRLEISTUNG&lt;/h4&gt;&lt;p&gt;Auf alle Bauteile.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;INTERNATIONALES SERVICENETZ&lt;/h4&gt;                                                                                                ', '', 'Dinamic 24V 1,05kW', '', '', '', '', '', '', '', ''),
(1455, 4, 'Dinamic 24V 1,05kW', '&lt;p&gt;A Dirna cég, a Minicool modellsorozatban egy vagy két kompresszorral dolgozó klimatizációs egységet kínál. A MiniCool fogyasztása alacsony, nem igényel karbantartást és a gépjármű leállított motorja mellett, békés, éjszakai alvást biztosít, amit elősegít a hőmérséklet szabályozhatósága is. Ezáltal biztosítva van a békés és felfrissítő pihenés.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;MINICOOL DINAMIC&lt;/h4&gt;&lt;p&gt;Ezzel a modellel a DIRNA cég folytatja klimatizációs egységekből álló terméksorozatának bővítését, melyek a tehergépjárművek fülkéjének komfortját hivatottak növelni. Ennek a továbbfejlesztett változatnak nagyon alacsony a fogyasztása, és ezért kimondottan éjszakai használatra készült, valamint azokra az esetekre, mikor a jármű motorja áll. Lehetővé teszi a frissítő pihenést, miközben üzemanyagot takarít meg. Meggátolja a túlzott zaj keletkezését és a motor kopását, melyek a standard klímaberendezések használatának mindennapos velejárói. A kárpit védelme beépített párologtatós egységgel és különböző irányokba állítható levegőfúvókkal.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;2 ÉV GARANCIA&lt;/h4&gt;&lt;p&gt;Az összes alkatrészre.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;NEMZETKÖZI SZERVIZHÁLÓZAT&lt;/h4&gt;', '&lt;ul&gt;	&lt;li&gt;24 Volt–os kivitel&lt;/li&gt;	&lt;li&gt;az összes funkció közvetlenül az irányítópanelről irányítható&lt;/li&gt;	&lt;li&gt;nagyobb teljesítmény egy kompresszor használata mellett&lt;/li&gt;	&lt;li&gt;inverterek használatával elért automatikus szabályozás&lt;/li&gt;	&lt;li&gt;F0 üzemmód = manuális üzemmód&lt;/li&gt;	&lt;li&gt;F4 üzemmód = automatikus üzemmód&lt;/li&gt;	&lt;li&gt;modell Minicool Dinamic:		&lt;ul&gt;			&lt;li&gt;alacsony elektromos fogyasztás 24 V mellett (F0 üzemmódban: 11-től 14 A-ig, F4 üzemmódban: 9,5-től 14 A-ig) &lt;/li&gt;			&lt;li&gt;nagy teljesítmény 24 V mellett (1050 W)&lt;/li&gt;		&lt;/ul&gt;	&lt;/li&gt;	&lt;li&gt;méretek (SZ x H x M): 630 x 197 x 785 mm&lt;/li&gt;	&lt;li&gt;Night use system = éjszakai üzemmód&lt;/li&gt;	&lt;li&gt;a gépjármű leállított motorja mellett is működik&lt;/li&gt;	&lt;li&gt;minimális karbantartási igény&lt;/li&gt;	&lt;li&gt;beépített védelem alacsony akkumulátor-feszültség esetére&lt;/li&gt;	&lt;li&gt;a külső burkolat hőálló, UVA védelemmel ellátott műanyagból készült (ellenálló a mechanikus károsodásokkal szemben)&lt;/li&gt;	&lt;li&gt;új BD 350 kompresszor&lt;/li&gt;&lt;/ul&gt;', '                                                &lt;p&gt;A Dirna cég, a Minicool modellsorozatban egy vagy két kompresszorral dolgozó klimatizációs egységet kínál. A MiniCool fogyasztása alacsony, nem igényel karbantartást és a gépjármű leállított motorja mellett, békés, éjszakai alvást biztosít, amit elősegít a hőmérséklet szabályozhatósága is. Ezáltal biztosítva van a békés és felfrissítő pihenés.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;MINICOOL DINAMIC&lt;/h4&gt;&lt;p&gt;Ezzel a modellel a DIRNA cég folytatja klimatizációs egységekből álló terméksorozatának bővítését, melyek a tehergépjárművek fülkéjének komfortját hivatottak növelni. Ennek a továbbfejlesztett változatnak nagyon alacsony a fogyasztása, és ezért kimondottan éjszakai használatra készült, valamint azokra az esetekre, mikor a jármű motorja áll. Lehetővé teszi a frissítő pihenést, miközben üzemanyagot takarít meg. Meggátolja a túlzott zaj keletkezését és a motor kopását, melyek a standard klímaberendezések használatának mindennapos velejárói. A kárpit védelme beépített párologtatós egységgel és különböző irányokba állítható levegőfúvókkal.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;2 ÉV GARANCIA&lt;/h4&gt;&lt;p&gt;Az összes alkatrészre.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;NEMZETKÖZI SZERVIZHÁLÓZAT&lt;/h4&gt;                                      