(1457, 3, 'Integral Power 12V 2,0kW', '&lt;p&gt;Integral Power ist ein kompaktes Klimagerät mit integriertem Motorkompressor, der durch die Fahrzeugbatterie mit Strom versorgt wird. Dieses Gerät wird auf dem Kabinendach installiert und ist ideal für Offroad-Fahrzeuge wie Bagger, Kipper, Planierraupen, landwirtschaftliche Fahrzeuge sowie für Krane, Gabelstapler usw.&lt;/p&gt;', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '                                                Integral Power ist ein kompaktes Klimagerät mit integriertem Motorkompressor, der durch die Fahrzeugbatterie mit Strom versorgt wird. Dieses Gerät wird auf dem Kabinendach installiert und ist ideal für Offroad-Fahrzeuge wie Bagger, Kipper, Planierraupen, landwirtschaftliche Fahrzeuge sowie für Krane, Gabelstapler usw.                                                                                                ', '', 'Integral Power 12V 2,0kW', '', '', '', '', '', '', '', ''),
(1457, 1, 'Integral Power 12V 2,0kW', '&lt;p&gt;Integral Power is a compact air conditioning unit with an integrated moto-compressor that is powered by the vehicle battery. The system is roof mounted and ideal for off-road vehicles such as earth moving machines, mining trucks, cranes, bulldozers, agricultural vehicles and forklift trucks.&lt;/p&gt;', '&lt;ul&gt;	&lt;li&gt;2,0kW&lt;/li&gt;	&lt;li&gt;Voltage 12V DC&lt;/li&gt;	&lt;li&gt;Power 6824 BTU&lt;/li&gt;	&lt;li&gt;Power 1720 kcal/h&lt;/li&gt;	&lt;li&gt;Electrical consumption 32A/h ~ 65A/h&lt;/li&gt;	&lt;li&gt;Maximum air flow: 700m3/h&lt;/li&gt;	&lt;li&gt;5 ventilation speeds&lt;/li&gt;	&lt;li&gt;Remote control&lt;/li&gt;	&lt;li&gt;Minimum alternator required 80A/h – 15V&lt;/li&gt;	&lt;li&gt;Easy installation&lt;/li&gt;	&lt;li&gt;Manual and automatic function&lt;/li&gt;	&lt;li&gt;Digital thermometer (°C or °F)&lt;/li&gt;	&lt;li&gt;Double battery protection&lt;/li&gt;	&lt;li&gt;Dimensions 655 x 730 x 210mm&lt;/li&gt;	&lt;li&gt;Weight 43,5kg&lt;/li&gt;&lt;/ul&gt;', '                                                Integral Power is a compact air conditioning unit with an integrated moto-compressor that is powered by the vehicle battery. The system is roof mounted and ideal for off-road vehicles such as earth moving machines, mining trucks, cranes, bulldozers, agricultural vehicles and forklift trucks.                                                                                                ', '', 'Integral Power 12V 2,0kW', '', '', '', '', '', '', '', ''),
(1458, 2, 'Integral Power 24V 3,2kW', '&lt;p&gt;Integral power je kompaktná klimatizačná jednotka s integraovaným kompresorom poháňaným batériou vozidla. Inštaluje sa na strechu vozidla a je ideálna pre ťažkú techniku a poľnohospodárske stroje.&lt;/p&gt;', '&lt;ul&gt;	&lt;li&gt;3,2kW&lt;/li&gt;	&lt;li&gt;napätie 24V DC&lt;/li&gt;	&lt;li&gt;výkon 10921 BTU&lt;/li&gt;	&lt;li&gt;výkon 2752 kcal/h&lt;/li&gt;	&lt;li&gt;spotreba el.energie 30A/h ~ 45A/h&lt;/li&gt;	&lt;li&gt;maximálny prietok vzduchu: 700m3/h&lt;/li&gt;	&lt;li&gt;5 rýchlostí ventilátora&lt;/li&gt;	&lt;li&gt;požadované minimum na alternátor 75A/h – 28V&lt;/li&gt;	&lt;li&gt;ľahká montáž&lt;/li&gt;	&lt;li&gt;prepínač automatický/manuálny režim&lt;/li&gt;	&lt;li&gt;digitálny teplomer v °C alebo °F&lt;/li&gt;	&lt;li&gt;diaľkové ovládanie&lt;/li&gt;	&lt;li&gt;dvojitá ochrana akumulátorov&lt;/li&gt;	&lt;li&gt;ochrana akumulátorov kompresorov&lt;/li&gt;	&lt;li&gt;elektronické ovládanie akumulátora&lt;/li&gt;	&lt;li&gt;hlavné rozmery 655 x 730 x 210mm&lt;/li&gt;	&lt;li&gt;hmotnosť 43,5kg	&lt;/li&gt;	&lt;/ul&gt;', '                                                                                                Integral power je kompaktná klimatizačná jednotka s integraovaným kompresorom poháňaným batériou vozidla. Inštaluje sa na strechu vozidla a je ideálna pre ťažkú techniku a poľnohospodárske stroje.                                                                                                                                                ', '', 'Integral Power 24V 3,2kW', '', '', '', '', '', '', '', ''),
(1458, 1, 'Integral Power 24V 3,2kW', '&lt;p&gt;Integral Power is a compact air conditioning unit with an integrated moto-compressor that is powered by the vehicle battery. The system is roof mounted and ideal for off-road vehicles such as earth moving machines, mining trucks, cranes, bulldozers, agricultural vehicles and forklift trucks.&lt;/p&gt;', '&lt;ul&gt;	&lt;li&gt;3,2kW&lt;/li&gt;	&lt;li&gt;Voltage 24V DC&lt;/li&gt;	&lt;li&gt;Power 10921 BTU&lt;/li&gt;	&lt;li&gt;Power 2752 kcal/h&lt;/li&gt;	&lt;li&gt;Electrical consumption 30A/h ~ 45A/h&lt;/li&gt;	&lt;li&gt;Maximum air flow: 700m3/h&lt;/li&gt;	&lt;li&gt;5 ventilation speeds&lt;/li&gt;	&lt;li&gt;Remote control&lt;/li&gt;	&lt;li&gt;Minimum alternator required 75A/h – 28V&lt;/li&gt;	&lt;li&gt;Easy installation&lt;/li&gt;	&lt;li&gt;Manual and automatic function&lt;/li&gt;	&lt;li&gt;Digital thermometer (°C or °F)&lt;/li&gt;	&lt;li&gt;Double battery protection&lt;/li&gt;	&lt;li&gt;Dimensions 655 x 730 x 210mm&lt;/li&gt;	&lt;li&gt;Weight 43,5kg&lt;/li&gt;	&lt;/ul&gt;', '                                                                                                Integral Power is a compact air conditioning unit with an integrated moto-compressor that is powered by the vehicle battery. The system is roof mounted and ideal for off-road vehicles such as earth moving machines, mining trucks, cranes, bulldozers, agricultural vehicles and forklift trucks.                                                                                                                                                ', '', 'Integral Power 24V 3,2kW', '', '', '', '', '', '', '', ''),
(1459, 2, 'SlimFit 24V 1,4kW', '&lt;p&gt;Model SlimFIT je najnižšia samostatná klimatizácia pre nákladnú dopravu na trhu. Vďaka svojmu nízkemu profilu je vhodná pre vozidlá s vysokou kabínou.&lt;/p&gt;&lt;p&gt;Budete spokojný so všetkými výhodami:&lt;/p&gt;&lt;ul&gt;	&lt;li&gt;&lt;strong&gt;Šetrí palivo&lt;/strong&gt; - udržuje kabíny vychladené i v noci bez voľnobehu motora kamiónu.&lt;/li&gt;	&lt;li&gt;&lt;strong&gt;Pohodlie vodiča&lt;/strong&gt; - udržuje príjemnú teplotu v kabíne.&lt;/li&gt;	&lt;li&gt;&lt;strong&gt;Znižuje nároky na údržbu&lt;/strong&gt; - vzhľadom k tomu, že motor pracuje menej na voľnobeh sa predlžuje jeho životnosť, čím sa predlžuje interval údržby.&lt;/li&gt;	&lt;li&gt;&lt;strong&gt;Kompatibilná s normou EURO 6&lt;/strong&gt; - jednotka je extrémne nízka, ideálna na splnenie potrieb vzhľadom na jej minimálnu výšku.&lt;/li&gt;	&lt;li&gt;&lt;strong&gt;Jednoduchá montáž&lt;/strong&gt; - nie je potrebné vŕtať strechu kabíny nákladných vozidiel s poklopom.&lt;/li&gt;&lt;/ul&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;ZÁRUKA 2 ROKY&lt;/h4&gt;&lt;p&gt;Na všetky diely.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;MEDZINÁRODNÁ SERVISNÁ SIEŤ&lt;/h4&gt;', '&lt;ul&gt;	&lt;li&gt;napätie 24V&lt;/li&gt;	&lt;li&gt;výkon 1,4 kW&lt;/li&gt;	&lt;li&gt;spotreba el. energie 10,5 ~ 18A/hod&lt;/li&gt;	&lt;li&gt;maximálny prietok vzduchu 840m3/h&lt;/li&gt;	&lt;li&gt;hmotnosť 34 kg&lt;/li&gt;	&lt;li&gt;manuálny alebo automatický režim&lt;/li&gt;	&lt;li&gt;funkcia programovania času&lt;/li&gt;	&lt;li&gt;digitálny teplomer v °C alebo °F&lt;/li&gt;	&lt;li&gt;diaľkové ovládanie&lt;/li&gt;	&lt;li&gt;predplnený systém s chladivom R134a&lt;/li&gt;	&lt;li&gt;dvojitá ochrana akumulátora&lt;/li&gt;	&lt;li&gt;elektrická AC jednotka s 5 rýchlosťami ventilátora&lt;/li&gt;&lt;/ul&gt;', '                                                                        &lt;p&gt;Model SlimFIT je najnižšia samostatná klimatizácia pre nákladnú dopravu na trhu. Vďaka svojmu nízkemu profilu je vhodná pre vozidlá s vysokou kabínou.&lt;/p&gt;&lt;p&gt;Budete spokojný so všetkými výhodami:&lt;/p&gt;&lt;ul&gt;&lt;li&gt;&lt;strong&gt;Šetrí palivo&lt;/strong&gt;&amp;nbsp;- udržuje kabíny vychladené i v noci bez voľnobehu motora kamiónu.&lt;/li&gt;&lt;li&gt;&lt;strong&gt;Pohodlie vodiča&lt;/strong&gt;&amp;nbsp;- udržuje príjemnú teplotu v kabíne.&lt;/li&gt;&lt;li&gt;&lt;strong&gt;Znižuje nároky na údržbu&lt;/strong&gt;&amp;nbsp;- vzhľadom k tomu, že motor pracuje menej na voľnobeh sa predlžuje jeho životnosť, čím sa predlžuje interval údržby.&lt;/li&gt;&lt;li&gt;&lt;strong&gt;Kompatibilná s normou EURO 6&lt;/strong&gt;&amp;nbsp;- jednotka je extrémne nízka, ideálna na splnenie potrieb vzhľadom na jej minimálnu výšku.&lt;/li&gt;&lt;li&gt;&lt;strong&gt;Jednoduchá montáž&lt;/strong&gt;&amp;nbsp;- nie je potrebné vŕtať strechu kabíny nákladných vozidiel s poklopom.&lt;/li&gt;&lt;/ul&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;ZÁRUKA 2 ROKY&lt;/h4&gt;&lt;p&gt;Na všetky diely.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;MEDZINÁRODNÁ SERVISNÁ SIEŤ&lt;/h4&gt;                                                                                                                        ', '', 'SlimFit 24V 1,4kW', '', '', '', '', '', '', '', ''),
(1459, 1, 'SlimFit 24V 1,4kW', '&lt;p&gt;Dirna Bergstrom’s new SlimFIT is the lowest roof-mounted compact standalone air conditioning unit in the market for on-road trucks. Powered directly from the vehicle battery, it’s an excellent cooling and fuel saving solution. Due to its reduced height, SlimFIT is the perfect fit for vehicles with high cabs.&lt;/p&gt;', '&lt;ul&gt;	&lt;li&gt;Voltage 24V&lt;/li&gt;	&lt;li&gt;Power 1,4 kW&lt;/li&gt;	&lt;li&gt;Electrical consumption 10,5 ~ 18A/h&lt;/li&gt;	&lt;li&gt;Maximum air flow 840m3/h&lt;/li&gt;	&lt;li&gt;Weight 34kg&lt;/li&gt;	&lt;li&gt;Manual and automatic function&lt;/li&gt;	&lt;li&gt;Time schedule operation&lt;/li&gt;	&lt;li&gt;Digital thermometer (°C or °F)&lt;/li&gt;	&lt;li&gt;Remote control&lt;/li&gt;	&lt;li&gt;Pre-charged system with R134A refrigerant.&lt;/li&gt;	&lt;li&gt;Double battery protection&lt;/li&gt;	&lt;li&gt;5 ventilation speeds&lt;/li&gt;&lt;/ul&gt;', '                                                                        Dirna Bergstrom’s new SlimFIT is the lowest roof-mounted compact standalone air conditioning unit in the market for on-road trucks. Powered directly from the vehicle battery, it’s an excellent cooling and fuel saving solution. Due to its reduced height, SlimFIT is the perfect fit for vehicles with high cabs.                                                                                                                        ', '', 'SlimFit 24V 1,4kW', '', '', '', '', '', '', '', ''),
(1459, 3, 'SlimFit 24V 1,4kW', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '                                                                                                                                                                                                ', '', 'SlimFit 24V 1,4kW', '', '', '', '', '', '', '', ''),
(1459, 4, 'SlimFit 24V 1,4kW', '&lt;p&gt;A legalacsonyabb kompakt állóklíma a piacon teherjárművekre.&lt;/p&gt;&lt;p&gt;A következő tulajdoságaival kényezteti Önt:&lt;/p&gt;&lt;ul&gt;	&lt;li&gt;&lt;strong&gt;Üzemanyag spórolás&lt;/strong&gt; - a motor járatása nélkül hűti a fülkét az esti pihenő alatt A sofőr kényelme - kellemes hőmérsékleten tartja a kabint.&lt;/li&gt;	&lt;li&gt;&lt;strong&gt;Karbantartási költségek csökkentése&lt;/strong&gt; - minél kevesebbet jár a motor, annál kevesebb karbantartást igényel.&lt;/li&gt;	&lt;li&gt;&lt;strong&gt;Legjobb érték&lt;/strong&gt; - &quot;strapabíró&quot; a vezető gyártótól.&lt;/li&gt;	&lt;li&gt;&lt;strong&gt;Tökéletes az EURO 6 normához&lt;/strong&gt; - extrém alacsony, ez az egység ideális megoldás a fülke magasság szabályozás betartásához.&lt;/li&gt;&lt;/ul&gt;', '&lt;ul&gt;	&lt;li&gt;24V-os változat&lt;/li&gt;	&lt;li&gt;teljesítmény 1,4 kW&lt;/li&gt;	&lt;li&gt;elektromos fogyasztás 10,5 ~ 18A/ó&lt;/li&gt;	&lt;li&gt;maximális légbefúvás 840m3&lt;/li&gt;	&lt;li&gt;súly 34 kg&lt;/li&gt;	&lt;li&gt;Kézi vagy automata vezérlés&lt;/li&gt;	&lt;li&gt;Egyszerű telepítés fúrásmentesen a lehajtható fülke tetejére&lt;/li&gt;	&lt;li&gt;Digitális hőmérő (°C vagy °F)&lt;/li&gt;	&lt;li&gt;Belső vezérlő&lt;/li&gt;	&lt;li&gt;Előtöltött R134a hűtőközeg&lt;/li&gt;	&lt;li&gt;Rádiófrekvenciás távirányító (RF)&lt;/li&gt;	&lt;li&gt;Kettős akku védelem&lt;/li&gt;	&lt;li&gt;Elektromos klíma renndszer 5 fokozattal&lt;/li&gt;	&lt;li&gt;Időzítő&lt;/li&gt;&lt;/ul&gt;', '                                                                        &lt;p&gt;A legalacsonyabb kompakt állóklíma a piacon teherjárművekre.&lt;/p&gt;&lt;p&gt;A következő tulajdoságaival kényezteti Önt:&lt;/p&gt;&lt;ul&gt;&lt;li&gt;&lt;strong&gt;Üzemanyag spórolás&lt;/strong&gt;&amp;nbsp;- a motor járatása nélkül hűti a fülkét az esti pihenő alatt A sofőr kényelme - kellemes hőmérsékleten tartja a kabint.&lt;/li&gt;&lt;li&gt;&lt;strong&gt;Karbantartási költségek csökkentése&lt;/strong&gt;&amp;nbsp;- minél kevesebbet jár a motor, annál kevesebb karbantartást igényel.&lt;/li&gt;&lt;li&gt;&lt;strong&gt;Legjobb érték&lt;/strong&gt;&amp;nbsp;- &quot;strapabíró&quot; a vezető gyártótól.&lt;/li&gt;&lt;li&gt;&lt;strong&gt;Tökéletes az EURO 6 normához&lt;/strong&gt;&amp;nbsp;- extrém alacsony, ez az egység ideális megoldás a fülke magasság szabályozás betartásához.&lt;/li&gt;&lt;/ul&gt;                                                                                                                        ', '', 'SlimFit 24V 1,4kW', '', '', '', '', '', '', '', ''),
(1460, 3, 'Split Twin 12V 2,0kW', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '                                                                                                ', '', 'Split Twin 12V 2,0kW', '', '', '', '', '', '', '', ''),
(1460, 2, 'Split Twin 12V 2,0kW', '&lt;p&gt;Split je ekologický modulárny klimatizačný systém určený predovšetkým na použitie pri vypnutom motore, ako aj pri nakladaní, vykladaní, odpočinku a spánku posádky vozidla.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;ZÁRUKA 2 ROKY&lt;/h4&gt;&lt;p&gt;Na všetky diely.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;MEDZINÁRODNÁ SERVISNÁ SIEŤ&lt;/h4&gt;', '&lt;h4 style=&quot;color: #0e417a&quot;&gt;TECHNICKÉ ÚDAJE&lt;/h4&gt;&lt;ul&gt;	&lt;li&gt;výkon 2,0 kW&lt;/li&gt;	&lt;li&gt;napätie 12V/24V DC&lt;/li&gt;	&lt;li&gt;chladice médium R134a&lt;/li&gt;	&lt;li&gt;2 režimy nastavenia:		&lt;ul&gt;			&lt;li&gt;manuálny - F0&lt;/li&gt;			&lt;li&gt;automatický - F4&lt;br&gt;					požiadavky napájania pre automatický režim F4:					&lt;ul&gt;						&lt;li&gt;12V: 42Ah min. - 62Ah. max.&lt;/li&gt;					&lt;/ul&gt;			&lt;/li&gt;		&lt;/ul&gt;	&lt;/li&gt;	&lt;li&gt;maximálny prietok vzduchu 670m3/h&lt;/li&gt;	&lt;li&gt;časovač programu až do 9 hodím prevádzky&lt;/li&gt;	&lt;li&gt;digitálny teplomer v °C alebo °F&lt;/li&gt;	&lt;li&gt;diaľkové ovládanie&lt;/li&gt;	&lt;li&gt;ochranná poistka systému		&lt;ul&gt;			&lt;li&gt;ochrana akumulátorov kompresorov&lt;/li&gt;			&lt;li&gt;elektronické ovládanie akumulátora&lt;/li&gt;		&lt;/ul&gt;	&lt;/li&gt;	&lt;li&gt;jednoduchá výmena náhradných dielov&lt;/li&gt;&lt;/ul&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;TECHNICKÉ ÚDAJE - VÝPARNÍK&lt;/h4&gt;&lt;ul&gt;	&lt;li&gt;hlavné rozmery 410 x 270 x 125mm&lt;/li&gt;	&lt;li&gt;hmotnosť 5kg&lt;/li&gt;	&lt;li&gt;prietok vzduchu 670m3/h&lt;/li&gt;	&lt;li&gt;dizajn umožňuje jednoduchú montáž v kabíne podľa individuálnych požiadaviek zákazníka&lt;/li&gt;&lt;/ul&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;TECHNICKÉ ÚDAJE - KOMPRESOR&lt;/h4&gt;&lt;ul&gt;	&lt;li&gt;hlavné rozmery 430 x 370 x 260mm&lt;/li&gt;	&lt;li&gt;hmotnosť 22kg&lt;/li&gt;&lt;/ul&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;TECHNICKÉ ÚDAJE - KONDENZÁTOR&lt;/h4&gt;&lt;ul&gt;	&lt;li&gt;hlavné rozmery 620 x 500 x 130mm&lt;/li&gt;	&lt;li&gt;hmotnosť 6,5kg&lt;/li&gt;&lt;/ul&gt;', '                        &lt;p&gt;Split je ekologický modulárny klimatizačný systém určený predovšetkým na použitie pri vypnutom motore, ako aj pri nakladaní, vykladaní, odpočinku a spánku posádky vozidla.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;ZÁRUKA 2 ROKY&lt;/h4&gt;&lt;p&gt;Na všetky diely.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;MEDZINÁRODNÁ SERVISNÁ SIEŤ&lt;/h4&gt;                                                                        ', '', 'Split Twin 12V 2,0kW', '', '', '', '', '', '', '', ''),
