INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `techspecs`, `highlights`, `tag`, `meta_title`, `meta_description`, `meta_keyword`, `custom_field_1_title`, `custom_field_1_content`, `custom_field_2_title`, `custom_field_2_content`, `custom_field_3_title`, `custom_field_3_content`) VALUES
(1461, 2, 'Split Twin 24V 3,0kW', '&lt;p&gt;Split je ekologický modulárny klimatizačný systém určený predovšetkým na použitie pri vypnutom motore, ako aj pri nakladaní, vykladaní, odpočinku a spánku posádky vozidla.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;ZÁRUKA 2 ROKY&lt;/h4&gt;&lt;p&gt;Na všetky diely.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;MEDZINÁRODNÁ SERVISNÁ SIEŤ&lt;/h4&gt;', '&lt;h4 style=&quot;color: #0e417a&quot;&gt;TECHNICKÉ ÚDAJE&lt;/h4&gt;&lt;ul&gt;	&lt;li&gt;výkon 2,0 kW&lt;/li&gt;	&lt;li&gt;napätie 12V/24V DC&lt;/li&gt;	&lt;li&gt;chladice médium R134a&lt;/li&gt;	&lt;li&gt;2 režimy nastavenia:		&lt;ul&gt;			&lt;li&gt;manuálny - F0&lt;/li&gt;			&lt;li&gt;automatický - F4&lt;br&gt;					požiadavky napájania pre automatický režim F4:					&lt;ul&gt;						&lt;li&gt;12V: 42Ah min. - 62Ah. max.&lt;/li&gt;					&lt;/ul&gt;			&lt;/li&gt;		&lt;/ul&gt;	&lt;/li&gt;	&lt;li&gt;maximálny prietok vzduchu 670m3/h&lt;/li&gt;	&lt;li&gt;časovač programu až do 9 hodím prevádzky&lt;/li&gt;	&lt;li&gt;digitálny teplomer v °C alebo °F&lt;/li&gt;	&lt;li&gt;diaľkové ovládanie&lt;/li&gt;	&lt;li&gt;ochranná poistka systému		&lt;ul&gt;			&lt;li&gt;ochrana akumulátorov kompresorov&lt;/li&gt;			&lt;li&gt;elektronické ovládanie akumulátora&lt;/li&gt;		&lt;/ul&gt;	&lt;/li&gt;	&lt;li&gt;jednoduchá výmena náhradných dielov&lt;/li&gt;&lt;/ul&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;TECHNICKÉ ÚDAJE - VÝPARNÍK&lt;/h4&gt;&lt;ul&gt;	&lt;li&gt;hlavné rozmery 410 x 270 x 125mm&lt;/li&gt;	&lt;li&gt;hmotnosť 5kg&lt;/li&gt;	&lt;li&gt;prietok vzduchu 670m3/h&lt;/li&gt;	&lt;li&gt;dizajn umožňuje jednoduchú montáž v kabíne podľa individuálnych požiadaviek zákazníka&lt;/li&gt;&lt;/ul&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;TECHNICKÉ ÚDAJE - KOMPRESOR&lt;/h4&gt;&lt;ul&gt;	&lt;li&gt;hlavné rozmery 430 x 370 x 260mm&lt;/li&gt;	&lt;li&gt;hmotnosť 22kg&lt;/li&gt;&lt;/ul&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;TECHNICKÉ ÚDAJE - KONDENZÁTOR&lt;/h4&gt;&lt;ul&gt;	&lt;li&gt;hlavné rozmery 620 x 500 x 130mm&lt;/li&gt;	&lt;li&gt;hmotnosť 6,5kg&lt;/li&gt;&lt;/ul&gt;', '                        &lt;p&gt;Split je ekologický modulárny klimatizačný systém určený predovšetkým na použitie pri vypnutom motore, ako aj pri nakladaní, vykladaní, odpočinku a spánku posádky vozidla.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;ZÁRUKA 2 ROKY&lt;/h4&gt;&lt;p&gt;Na všetky diely.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;MEDZINÁRODNÁ SERVISNÁ SIEŤ&lt;/h4&gt;                                                                        ', '', 'Split Twin 24V 3,0kW', '', '', '', '', '', '', '', ''),
(1464, 3, 'Sun 12V 500W 100m3/h 3 tempo', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '                                                                                                                                                ', '', 'Sun 12V 500W 100m3/h 3 tempo', '', '', '', '', '', '', '', ''),
(1464, 1, 'Sun 12V 500W 100m3/h 3 speeds', '&lt;p&gt;The compact electrical heating unit SUN is designed to heat the cabin of the vehicles as efficiently as possible. Independent from the engine and connected directly to the battery, maintains the cabin at favorable temperature conditions and prevents emissions of CO2 into the atmosphere.&lt;/p&gt;', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '                                                The compact electrical heating unit SUN is designed to heat the cabin of the vehicles as efficiently as possible. Independent from the engine and connected directly to the battery, maintains the cabin at favorable temperature conditions and prevents emissions of CO2 into the atmosphere.                                                                                                ', '', 'Sun 12V 500W 100m3/h 3 speeds', '', '', '', '', '', '', '', ''),
(1465, 3, 'Sun 12V 500W 100m3/h 3 tempo mit Mundstück', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '                                                                                                ', '', 'Sun 12V 500W 100m3/h 3 tempo mit Mundstück', '', '', '', '', '', '', '', ''),
(1465, 2, 'Sun 12V 500W 100m3/h 3 rýchlosti s nátrubkom', '&lt;p&gt;Sun je kompaktná elektrická vykurovacia jednotka a elektronikou s diaľkovým ovládaním, určená na vykurovanie kabíny vozidla najefektívnejšie, ako je to možné. Výhrevné teleso je napojené na elektrickú sieť autiomobilu, nezávislé na bežiacom motore je pripojené priamo k akumulátoru. Je šetrné k životnému prostrediu a neprodukuje emisie CO2. Určená je pre nákladné automobily.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;ZÁRUKA 2 ROKY&lt;/h4&gt;&lt;p&gt;Na všetky diely.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;MEDZINÁRODNÁ SERVISNÁ SIEŤ&lt;/h4&gt;', '&lt;ul&gt;	&lt;li&gt;napätie 12V&lt;/li&gt;	&lt;li&gt;spotreba el. energie 22~33A (25~39A)&lt;/li&gt;	&lt;li&gt;maximálny prietok vzduchu 100m3/h&lt;/li&gt;	&lt;li&gt;hmotnosť 2,76kg (2,76kg)&lt;/li&gt;	&lt;li&gt;hlavné rozmery 300 x 240 x 139mm&lt;/li&gt;	&lt;li&gt;manuálny alebo automatický režim&lt;/li&gt;	&lt;li&gt;prepínač automatický/manuálny režim&lt;/li&gt;	&lt;li&gt;digitálny teplomer v °C alebo °F&lt;/li&gt;	&lt;li&gt;diaľkové ovládanie&lt;/li&gt;	&lt;li&gt;ochrana akumulátora&lt;/li&gt;	&lt;li&gt;ukazovateľ stavu akumulátora&lt;/li&gt;&lt;/ul&gt;', '                        &lt;p&gt;Sun je kompaktná elektrická vykurovacia jednotka a elektronikou s diaľkovým ovládaním, určená na vykurovanie kabíny vozidla najefektívnejšie, ako je to možné. Výhrevné teleso je napojené na elektrickú sieť autiomobilu, nezávislé na bežiacom motore je pripojené priamo k akumulátoru. Je šetrné k životnému prostrediu a neprodukuje emisie CO2. Určená je pre nákladné automobily.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;ZÁRUKA 2 ROKY&lt;/h4&gt;&lt;p&gt;Na všetky diely.&lt;/p&gt;&lt;h4 style=&quot;font-family: Montserrat, sans-serif; color: rgb(14, 65, 122);&quot;&gt;MEDZINÁRODNÁ SERVISNÁ SIEŤ&lt;/h4&gt;                                                                        ', '', 'Sun 12V 500W 100m3/h 3 rýchlosti s nátrubkom', '', '', '', '', '', '', '', ''),
