                           ', '', 'Sun 24V 1000W 250m3/h 4 rýchlosti s el. displejom', '', '', '', '', '', '', '', ''),
(1457, 2, 'Integral Power 12V 2,0kW', '&lt;p&gt;Integral power je kompaktná klimatizačná jednotka s integraovaným kompresorom poháňaným batériou vozidla. Inštaluje sa na strechu vozidla a je ideálna pre ťažkú techniku a poľnohospodárske stroje.&lt;/p&gt;', '&lt;ul&gt;	&lt;li&gt;2,0kW&lt;/li&gt;	&lt;li&gt;napätie 12V DC&lt;/li&gt;	&lt;li&gt;výkon 6824 BTU&lt;/li&gt;	&lt;li&gt;výkon 1720 kcal/h&lt;/li&gt;	&lt;li&gt;spotreba el.energie 32A/h ~ 65A/h&lt;/li&gt;	&lt;li&gt;maximálny prietok vzduchu: 700m3/h&lt;/li&gt;	&lt;li&gt;5 rýchlostí ventilátora&lt;/li&gt;	&lt;li&gt;požadované minimum na alternátor 80A/h – 15V&lt;/li&gt;	&lt;li&gt;ľahká montáž&lt;/li&gt;	&lt;li&gt;prepínač automatický/manuálny režim&lt;/li&gt;	&lt;li&gt;digitálny teplomer v °C alebo °F&lt;/li&gt;	&lt;li&gt;diaľkové ovládanie&lt;/li&gt;	&lt;li&gt;dvojitá ochrana akumulátorov&lt;/li&gt;	&lt;li&gt;ochrana akumulátorov kompresorov&lt;/li&gt;	&lt;li&gt;elektronické ovládanie akumulátora&lt;/li&gt;	&lt;li&gt;hlavné rozmery 655 x 730 x 210mm&lt;/li&gt;	&lt;li&gt;hmotnosť 43,5kg	&lt;/li&gt;&lt;/ul&gt;', '                                                Integral power je kompaktná klimatizačná jednotka s integraovaným kompresorom poháňaným batériou vozidla. Inštaluje sa na strechu vozidla a je ideálna pre ťažkú techniku a poľnohospodárske stroje.                                                                                                ', '', 'Integral Power 12V 2,0kW', '', '', '', '', '', '', '', ''),
(1458, 3, 'Integral Power 24V 3,2kW', '&lt;p&gt;Integral Power ist ein kompaktes Klimagerät mit integriertem Motorkompressor, der durch die Fahrzeugbatterie mit Strom versorgt wird. Dieses Gerät wird auf dem Kabinendach installiert und ist ideal für Offroad-Fahrzeuge wie Bagger, Kipper, Planierraupen, landwirtschaftliche Fahrzeuge sowie für Krane, Gabelstapler usw.&lt;/p&gt;', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '                                                                                                Integral Power ist ein kompaktes Klimagerät mit integriertem Motorkompressor, der durch die Fahrzeugbatterie mit Strom versorgt wird. Dieses Gerät wird auf dem Kabinendach installiert und ist ideal für Offroad-Fahrzeuge wie Bagger, Kipper, Planierraupen, landwirtschaftliche Fahrzeuge sowie für Krane, Gabelstapler usw.                                                                                                                                                ', '', 'Integral Power 24V 3,2kW', '', '', '', '', '', '', '', ''),
