(1448, 3, 'Camper 12V', '&lt;p&gt;Camper ist ein hochleistungsfähiges Verdunstersystem, das perfekt für Wohnmobile und andere Freizeitfahrzeuge geeignet ist.&lt;/p&gt;', '&lt;li&gt;Ausführungen: 12 und 24 Volt &lt;/li&gt;&lt;li&gt;Steuerung aller Funktionen über die Fernbedienung oder über das elektronische Tastenfeld&lt;/li&gt;&lt;li&gt;der Sensor muss nicht angetastet werden, somit werden Ablenkungen während der Fahrt vermieden&lt;/li&gt;&lt;li&gt;aerodynamisches Design&lt;/li&gt;&lt;li&gt;zwei Wasserbehälter, ein interner Tank im Gerät, auslaufgeschützt, ein zweiter 20 Liter-Tank hinter Verkleidung versteckt und mit dem Wassertank im Fahrzeug verbunden&lt;/li&gt;&lt;li&gt;Motor:	&lt;ul&gt;		&lt;li&gt;doppelter Axiallüfter&lt;/li&gt;		&lt;li&gt;geringer Stromverbrauch bei 12V (von 0,8A bis 8A)&lt;/li&gt;		&lt;li&gt;Luftdurchsatz: 900m3 /Std.&lt;/li&gt;	&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;Abmessungen (B x L x H): 790 x 860 x 220 mm&lt;/li&gt;&lt;li&gt;Abmessungen, Wassertank (B x L x H): 360 x 200 x 330 mm&lt;/li&gt;&lt;li&gt;geräuscharme Wasserpumpe&lt;/li&gt;&lt;li&gt;Unterspannungsschutz&lt;/li&gt;&lt;li&gt;geringer Wasserverbrauch&lt;/li&gt;&lt;li&gt;minimaler Wartungsaufwand&lt;/li&gt;&lt;li&gt;Mikroprozessor zur elektronischen Gerätesteuerung mit:	&lt;ul&gt;		&lt;li&gt;Gebläsedrehzahl regulierbar&lt;/li&gt;		&lt;li&gt;programmierbare Zeitsteuerung&lt;/li&gt;		&lt;li&gt;Wasserstandkontrolle&lt;/li&gt;		&lt;li&gt;optische Anzeige der Wasserpumpenfunktion&lt;/li&gt;	&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;lackierbar in jeder Fahrzeugfarbe&lt;/li&gt;', '                                                                                                                                                                                                &lt;h4 style=&quot;color: #0e417a&quot;&gt;SCHÜTZT DEN FAHRZEUGMOTOR&lt;/h4&gt;&lt;p&gt;Die Kühlanlage arbeitet bei abgestelltem Fahrzeugmotor und eignet sich deshalb für einen Halt außerhalb von Campingplätzen.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;ÖKOLOGISCH&lt;/h4&gt;&lt;p&gt;Die Anlage braucht keinen Netzanschluß. Verbraucht nur Wasser.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;HOCHLEISTUNGSKÜHLANLAGE&lt;/h4&gt;&lt;p&gt;Alle Funktionen werden über die Fernbedienung oder die elektronische Tastatur gesteuert. Bedien- und Luftverteilungsarmatur sind in hoher Qualität gefertigt.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;SICHERHEIT&lt;/h4&gt;&lt;p&gt;Mit integrierter Alarmanlage - Modul zur Sicherung des Frachtraumes als Option.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;2 JAHRE GEWÄHRLEISTUNG&lt;/h4&gt;&lt;p&gt;Auf alle Bauteile.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;INTERNATIONALES SERVICENETZ&lt;/h4&gt;                                                                                                                                                                                                ', '', 'Camper 12V', '', '', '', '                                                                                                &lt;p&gt;&lt;br&gt;&lt;/p&gt;                                                                                        ', '', '                                                                                                &lt;p&gt;&lt;br&gt;&lt;/p&gt;                                                                                        ', '', '                                                                                                &lt;p&gt;&lt;br&gt;&lt;/p&gt;                                                                                        '),
