(1447, 2, 'Camper 24V', '&lt;p&gt;Camper je výparníková klimatizačná jednotka určená najmä pre mobilné domy a karavany.&lt;br&gt;&lt;/p&gt;', '&lt;li&gt;prevedenia 12 aj 24 Volt&lt;/li&gt;&lt;li&gt;ovládanie všetkých funkcií diaľkovým ovládačom alebo priamo na ovládacom paneli zariadenia&lt;/li&gt;&lt;li&gt;nie je potrebné nasmerovať diaľkový ovládač na senzor, tým sa vodič vyhne zbytočnému rozptyľovaniu sa počas jazdy&lt;/li&gt;&lt;li&gt;aerodynamický tvar&lt;/li&gt;&lt;li&gt;dve nádrže na vodu, jedna zabudovaná do zariadenia s ochranou proti pretečeniu, resp. preplneniu a druhá s kapacitou 20 l ukrytá za obkladom a prepojená s centrálnou nádržou na vodu vo vozidle&lt;/li&gt;&lt;li&gt;motor:	&lt;ul&gt;		dvojitý axiálny ventilátor		nízky odber prúdu 12V (od 0,8A do 8A)		cirkulácia vzduchu: 900m3 /hod.	&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;rozmery (Š x D x V): 790 x 860 x 220 mm&lt;/li&gt;&lt;li&gt;rozmery nádrže na vodu (Š x D x V): 360 x 200 x 330 mm &lt;/li&gt;&lt;li&gt;nehlučné vodné čerpadlo&lt;/li&gt;&lt;li&gt;elektrická ochrana&lt;/li&gt;&lt;li&gt;nízka spotreba vody&lt;/li&gt;&lt;li&gt;nenáročná údržba&lt;/li&gt;&lt;li&gt;elektronický riadiaci mikroprocesor	&lt;ul&gt;		&lt;li&gt;s ovládaním rýchlosti ventilátora&lt;/li&gt;		&lt;li&gt;s programovaním času používania&lt;/li&gt;		&lt;li&gt;s kontrolou výšky hladiny vody&lt;/li&gt;		&lt;li&gt;s indikáciou činnosti vodného čerpadla&lt;/li&gt;	&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;možnosť prelakovania strešnej jednotky vo farbe vozidla&lt;/li&gt;', '                                                                                                                                                                                                                                                &lt;h4 style=&quot;color: #0e417a&quot;&gt;CHRÁNI MOTOR VOZIDLA&lt;/h4&gt;&lt;p&gt;Pracuje, keď je motor vozidla vypnutý. Vhodné na používanie počas zastávok, okrem zastávok v kempingoch, kde je možnosť pripojenia na 230V.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;EKOLOGICKÉ ZARIADENIE&lt;/h4&gt;&lt;p&gt;Zariadenie nemusí byť pripojené k vonkajšiemu zdroju energie. Spotrebuje minimálne množstvo vody.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;VYSOKOVÝKONNÉ VÝPARNÍKOVÉ CHLADENIE&lt;/h4&gt;&lt;p&gt;Úplné ovládanie všetkých funkcií diaľkovým ovládačom alebo priamo na ovládacom paneli zariadenia. Vnútorný ovládací a distribučný panel veľmi vysokej kvality.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;BEZPEČNOSŤ&lt;/h4&gt;&lt;p&gt;S integrovaným alarmom - modul pre zabezpečenie ložného priestoru ako opcia.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;ZÁRUKA 2 ROKY&lt;/h4&gt;&lt;p&gt;Na všetky diely.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;MEDZINÁRODNÁ SERVISNÁ SIEŤ&lt;/h4&gt;                                                                                                                                                                                                                                                ', '', 'Camper 24V', '', '', '', '', '', '', '', ''),
(1448, 2, 'Camper 12V', '&lt;p&gt;Camper je výparníková klimatizačná jednotka určená najmä pre mobilné domy a karavany.&lt;/p&gt;', '&lt;li&gt;prevedenia 12 aj 24 Volt&lt;/li&gt;&lt;li&gt;ovládanie všetkých funkcií diaľkovým ovládačom alebo priamo na ovládacom paneli zariadenia&lt;/li&gt;&lt;li&gt;nie je potrebné nasmerovať diaľkový ovládač na senzor, tým sa vodič vyhne zbytočnému rozptyľovaniu sa počas jazdy&lt;/li&gt;&lt;li&gt;aerodynamický tvar&lt;/li&gt;&lt;li&gt;dve nádrže na vodu, jedna zabudovaná do zariadenia s ochranou proti pretečeniu, resp. preplneniu a druhá s kapacitou 20 l ukrytá za obkladom a prepojená s centrálnou nádržou na vodu vo vozidle&lt;/li&gt;&lt;li&gt;motor:	&lt;ul&gt;		dvojitý axiálny ventilátor		nízky odber prúdu 12V (od 0,8A do 8A)		cirkulácia vzduchu: 900m3 /hod.	&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;rozmery (Š x D x V): 790 x 860 x 220 mm&lt;/li&gt;&lt;li&gt;rozmery nádrže na vodu (Š x D x V): 360 x 200 x 330 mm &lt;/li&gt;&lt;li&gt;nehlučné vodné čerpadlo&lt;/li&gt;&lt;li&gt;elektrická ochrana&lt;/li&gt;&lt;li&gt;nízka spotreba vody&lt;/li&gt;&lt;li&gt;nenáročná údržba&lt;/li&gt;&lt;li&gt;elektronický riadiaci mikroprocesor	&lt;ul&gt;		&lt;li&gt;s ovládaním rýchlosti ventilátora&lt;/li&gt;		&lt;li&gt;s programovaním času používania&lt;/li&gt;		&lt;li&gt;s kontrolou výšky hladiny vody&lt;/li&gt;		&lt;li&gt;s indikáciou činnosti vodného čerpadla&lt;/li&gt;	&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;možnosť prelakovania strešnej jednotky vo farbe vozidla&lt;/li&gt;', '                                                                                                                                                                                                &lt;h4 style=&quot;color: #0e417a&quot;&gt;CHRÁNI MOTOR VOZIDLA&lt;/h4&gt;&lt;p&gt;Pracuje, keď je motor vozidla vypnutý. Vhodné na používanie počas zastávok, okrem zastávok v kempingoch, kde je možnosť pripojenia na 230V.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;EKOLOGICKÉ ZARIADENIE&lt;/h4&gt;&lt;p&gt;Zariadenie nemusí byť pripojené k vonkajšiemu zdroju energie. Spotrebuje minimálne množstvo vody.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;VYSOKOVÝKONNÉ VÝPARNÍKOVÉ CHLADENIE&lt;/h4&gt;&lt;p&gt;Úplné ovládanie všetkých funkcií diaľkovým ovládačom alebo priamo na ovládacom paneli zariadenia. Vnútorný ovládací a distribučný panel veľmi vysokej kvality.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;BEZPEČNOSŤ&lt;/h4&gt;&lt;p&gt;S integrovaným alarmom - modul pre zabezpečenie ložného priestoru ako opcia.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;ZÁRUKA 2 ROKY&lt;/h4&gt;&lt;p&gt;Na všetky diely.&lt;/p&gt;&lt;h4 style=&quot;color: #0e417a&quot;&gt;MEDZINÁRODNÁ SERVISNÁ SIEŤ&lt;/h4&gt;                                                                                                                                                                                                ', '', 'Camper 12V', '', '', 'Užívateľský a montážny návod', '                                                                                                &lt;p&gt;&lt;br&gt;&lt;/p&gt;                                                                                        ', 'Chybové hlásenia', '                                                                                                &lt;p&gt;&lt;br&gt;&lt;/p&gt;                                                                                        ', '', '                                                                                                &lt;p&gt;&lt;br&gt;&lt;/p&gt;                                                                                        '),
